class Solution:
    def minOperations(self, nums: List[int]) -> int:    
        def spf(x):
            if x <= 1:
                return x
            if x % 2 == 0:
                return 2
            max_div = int(math.isqrt(x)) + 1
            for i in range(3, max_div, 2):
                if x % i == 0:
                    return i
            return x  

        n = len(nums)
        ops = 0
        for i in range(n - 1, 0, -1):
            while nums[i - 1] > nums[i]:
                if nums[i - 1] == 1:
                    return -1
                factor = spf(nums[i - 1])
                if factor == nums[i - 1]:
                    return -1
                nums[i - 1] = factor
                ops += 1
                if nums[i - 1] > nums[i]:
                    if nums[i - 1] == 1:
                        return -1
                    return -1
        return ops

