        int ans = 0, n = s.size();
        for(int i = 0; i < n; ++i){
            int r = s[i] - 'a';
            t[r][++cnt[r]] = i;
            int u = -1;
            for(int j = 0; j < 26; ++j)
                if(cnt[j] >= k)
                    u = std::max(u, t[j][cnt[j] - k + 1]);
            ans += u + 1;
        }
        return ans;
    }
};

