        vector<vector<int>>v(26); int ans = 0;
        for (int i = 0; i < s.size(); i++) {
            int c = s[i] - 'a';
            v[c].push_back(i);
            int ma = -1;
            for (int j = 0; j < 26; j++) {
                if (v[j].size() >= k) ma = max(ma, v[j][v[j].size() - k]);
            }

