            v[ET.tout[i]] = s[i];
        }
        string res = "";
        for (auto i : v) res += i;
        string rev = res; reverse(rev.begin(), rev.end());
        // cout << res << endl;
        // cout << rev << endl;
        StringHash SHF(res);
        StringHash SHR(rev);
        vector<bool>ans;
        for (int i = 0; i < n; i++) {
