class Solution
{
public:
    int minOperations(vector<int> &nums)
    {
        int n = sz(nums),ans = 0;
        const int MAXN = 1e6 + 1;
        vi spf(MAXN);
        for (int i = 0; i < MAXN; ++i)
        {
            spf[i] = i;
        }
        for (int i = 2; i * i < MAXN; ++i)
        {
            if (spf[i] == i)
            {
                for (int j = i * i; j < MAXN; j += i)
                {
                    if (spf[j] == j)
                    {
                        spf[j] = i;
                    }
                }
            }
        }

        loopD(i, n - 1, 1)
        {
            if (nums[i - 1] > nums[i])
            {
                if (nums[i - 1] == spf[nums[i - 1]])
                    return -1;
                if (spf[nums[i - 1]] > nums[i]) return -1;

                    nums[i - 1] = spf[nums[i - 1]];
                    ans += 1;
            }
        }
        return ans;
    }
};

