def manacher(s):
    s = ''.join(chain('.',*zip(s,repeat('.'))))
    n = len(s)
    max_rad = [0]*n
    ctr = rad = 0
    while ctr < n:
        while ctr-rad-1 >= 0 and ctr+rad+1 < n and s[ctr-rad-1] == s[ctr+rad+1]:
            rad += 1
        max_rad[ctr] = rad
        ctr0 = ctr
        rad0 = rad
        ctr += 1
        rad = 0
        while ctr <= ctr0+rad0:
            ctr_refl = 2*ctr0-ctr
            rad_edge = ctr0+rad0-ctr
            if max_rad[ctr_refl] == rad_edge:
                rad = rad_edge
                break
            max_rad[ctr] = min(max_rad[ctr_refl],rad_edge)
            ctr += 1
    return max_rad

