class Solution {
public:
    int minOperations(vector<int>& nums) {

        int ops = 0;

        auto divide = [&](int idx) -> int {
            // cout << "idx : " << idx << " nums[idx] : " << nums[idx] << '\n';
            for(int i = 2; i * i <= nums[idx]; ++i) {
                if(nums[idx] % i == 0) {
                    nums[idx] /= nums[idx] / i;
                    return 1;
                }
            }
            return 0;
        };

        int lo = INT_MAX;
        for(int i = nums.size() - 1; i >= 0; i--) {
            while(nums[i] > lo) {
                if(!divide(i)) {
                    return -1;
                }
                ops++;
            }
            lo = min(lo, nums[i]);
        }
        return ops;
    }
};

