                int idx = s[j] - 'a';
                if(idx < 0 || idx >= 26){
                    // If the character is not a lowercase letter, skip or handle as needed
                    continue;
                }
                f[idx] += 1;
                if(f[idx] == k){
                    c += 1;
                }
                if(c > 0){
                    r += 1;
                }
            }
        }
        return r;
    }
};

