class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();
        const int mx = 32000; 
        vector<bool> sv(mx, true);
        vector<int> pr;
        sv[0] = sv[1] = false;
        for(int i = 2; i < mx; ++i){
            if(sv[i]){
                pr.push_back(i);
                for(int j = i * i; j < mx; j += i){
                    sv[j] = false;
                }
            }
        }

        // Lambda function to find the smallest prime factor of x
        auto spf = [&](int x) -> int {
            for(auto &p : pr){
                if((long long)p * p > x){
                    break;
                }
                if(x % p == 0){
                    return p;
                }
            }
            return x;
        };

        int res = 0;
        int mn = INT32_MAX;

        for(int i = n - 1; i >= 0; --i){
            while(nums[i] > mn){
                if(nums[i] == 1){
                    return -1;
                }
                int f = spf(nums[i]);
                if(f == nums[i]){
                    return -1;
                }
                nums[i] = f;
                res += 1;
            }
            mn = nums[i];
        }

        return res;
    }
};

