    int numberOfSubstrings(string s, int K) {
        int i, j, c, n = s.size(), l, r, q, res = 0;
        vector<int> f[26];
        for (i = 0; i < n; ++i){
            c = s[i] - 'a';
            f[c].push_back(i);
        }

        for (i = 0; i < n; ++i){
            q = n;
            for (j = 0; j < 26; ++j){
                l = lower_bound(f[j].begin(), f[j].end(), i) - f[j].begin();
                if (l + K - 1 < f[j].size()) q = min(q, f[j][l + K - 1]);
            }

            if (q < n) res += n - q;
        }

        return res;
    }
};

