class Solution {
public:
    int seed = 500002961, mo = 1000000007;
    vector<int> g[100005];
    int f[100005], f2[100005], ge[100005], yh[100005], n;
    string s;

    void dfs(int p, bool zheng){
        int i, j;
        if (g[p].size() == 0){
            f[p] = s[p] - 'a' + 1;
            ge[p] = 1;
            return;
        }

        ge[p] = 0;
        f[p] = 0;
        if (!zheng){
            for (i = 0; i < g[p].size(); ++i){
                j = g[p][i];
                dfs(j, zheng);
                f[p] = (f[p] + 1LL * f[j] * yh[ge[p]]) % mo;
                ge[p] += ge[j];
            }

            f[p] = (f[p] + 1LL * (s[p] - 'a' + 1) * yh[ge[p]]) % mo;
            ++ge[p];
        }
        else{
            f[p] = s[p] - 'a' + 1;
            ge[p] = 1;
            for (i = g[p].size() -1; i >= 0; --i){
                j = g[p][i];
                dfs(j, zheng);
                f[p] = (f[p] + 1LL * f[j] * yh[ge[p]]) % mo;
                ge[p] += ge[j];
            }
        }

    }

    vector<bool> findAnswer(vector<int>& par, string ss) {
        int i, j;
        n = par.size();
        s = ss;
        for (i = 0; i < n; ++i) g[i].clear();
        for (i = 0; i < n; ++i) 
            if (par[i] != -1)
                g[par[i]].push_back(i);

        yh[0] = 1;
        for (i = 1; i <= n; ++i) yh[i] = (1LL * seed * yh[i - 1]) % mo;
        dfs(0, true);
        for (i = 0; i < n; ++i) f2[i] = f[i];
        dfs(0, false);
        vector<bool> res;
        for (i = 0; i < n; ++i)
            res.push_back(f[i] == f2[i]);
        return res;
    }
};

