        int res= 0;
        for (int i = nums.size()-2; i >= 0; i--) {
            while (nums[i] > nums[i+1]) {
                int g = 1;
                for (int j = 2; j * j <= nums[i]; j++) {
                    if (nums[i] % j == 0) {
                        g = nums[i]/j;
                        break;
                    }
                }
                if (g == 1) return -1;
                else {
                    nums[i] /= g;
                    res++;
                }
            }
        }
        return res;
    }
};

