class Solution {
    public int numberOfSubstrings(String s, int k) {
        int n = s.length();
        int[] freq = new int[26];
        int count = 0;
        int res = 0;
        for (int i = 0, j = 0; i < n; i++) {
            while (j < n && count == 0) {
                char c = s.charAt(j);
                freq[c - 'a']++;
                if (freq[c - 'a'] == k) count++;
                j++;
            }
            if (count > 0) res += n - j + 1;
            freq[s.charAt(i) - 'a']--;
            if (freq[s.charAt(i) - 'a'] == k - 1) count--;
        }
        return res;
    }
}

