import java.util.List;

class Solution {
    int n, t;
    int[] in, out;
    char[] ch;
    public boolean[] findAnswer(int[] parent, String s) {
        n = parent.length;
        ch = s.toCharArray();
        List<Integer>[] adj = new List[n];
        for (int i = 0; i < n; i++) adj[i] = new ArrayList<>();
        for (int i = 1; i < n; i++) {
            adj[i].add(parent[i]);
            adj[parent[i]].add(i);
        }
        char[] list = new char[n];
        in = new int[n];
        out = new int[n];
        dfs(adj, 0, -1, list);
        int[] man = ManachersAlgorithm.manachers(list);
        boolean[] res = new boolean[n];
        for (int i = 0; i < n; i++) {
            int start = in[i], end = out[i];
            int mid = (2 * start + 2 * end) / 2 + 2;
            res[i] = man[mid] >= end - start;
        }
        return res;
    }

    private void dfs(List<Integer>[] adj, int v, int parent, char[] list) {
        in[v] = t;
        for (int w : adj[v]) {
            if (w == parent) continue;
            dfs(adj, w, v, list);
        }
        out[v] = t;
        list[t++] = ch[v];
    }

    public static class ManachersAlgorithm {

        public static int[] manachers(char[] str) {
            char[] arr = preProcess(str);
            int n = arr.length, c = 0, r = 0;
            int[] p = new int[n];
            for (int i = 1; i < n - 1; i++) {
                int invI = 2 * c - i;
                p[i] = r > i ? Math.min(r - i, p[invI]) : 0;
                while (arr[i + 1 + p[i]] == arr[i - 1 - p[i]]) p[i]++;
                if (i + p[i] > r) {
                    c = i;
                    r = i + p[i];
                }
            }
            return p;
        }

        private static char[] preProcess(char[] str) {
            char[] arr = new char[str.length * 2 + 3];
            arr[0] = '^';
            for (int i = 0; i < str.length; i++) {
                arr[i * 2 + 1] = '#';
                arr[i * 2 + 2] = str[i];
            }
            arr[arr.length - 2] = '#';
            arr[arr.length - 1] = '$';
            return arr;
        }
    }
}

class Solution {
    static int N = 1_000_000;
    static int[] spf;
    public int minOperations(int[] nums) {
        if (spf == null) init();
        int n = nums.length;
        int res = 0;
        for (int i = n - 2; i >= 0; i--) {
            if (nums[i] > nums[i + 1]) {
                nums[i] = spf[nums[i]];
                res++;
            }
            if (nums[i] > nums[i + 1]) return -1;
        }
        return res;
    }

    private static void init() {
        spf = new int[N + 1];
        for (int i = 2; i <= N; i++) {
            if (spf[i] == 0) {
                for (int j = i; j <= N; j += i) {
                    if (spf[j] == 0) spf[j] = i;
                }
            }
        }
        spf[1] = 1;
    }
}

