            iota(criba, criba + maxx, 0);
            for (int i = 4; i < maxx; i += 2){
                criba[i] = 2;
            }
            for (int i = 3; i < maxx; i += 2){
                if (criba[i] == i){
                    for (ll j = (ll)i * i; j < maxx; j += i){
                        criba[j] = min(criba[j], i);
                    }
                }
            }
            computed = true;
        }
