        for (int i = 1; i < n; i++) {
            g[parent[i]].push_back(i);
        }

        vector<int> indfs(n), outdfs(n);
        int ndfn = 0;

        string s;
        y_comb([&](auto dfs, int u) -> void {
            indfs[u] = ndfn;
            for (int v : g[u]) {
                dfs(v);
            }
            s += val[u];
            outdfs[u] = ndfn++;
        })(0);

