vector<int> isp, pri, minfac, maxfac;
void init_prime(int n) {
  isp.assign(n + 1, 1); isp[0] = isp[1] = 0;
  minfac.assign(n + 1, 0);
  maxfac.assign(n + 1, 0);
  for(int i = 2; i <= n; i++) {
    if(isp[i]) { pri.push_back(i); isp[i] = pri.size(); minfac[i] = i; }
    for(int p : pri) {
      if (i > n / p) break;
      isp[i * p] = 0;
      minfac[i * p] = p;
      if(i % p == 0) break;
    }
  }
  for (int i = 2; i <= n; i++) {
    maxfac[i] = max(maxfac[i / minfac[i]], minfac[i]);
  }
}

