class Solution {
    // https://cp-algorithms.com/string/manacher.html
    vector<int> manacher_odd(string s) {
        int n = s.size();
        s = "$" + s + "^";
        vector<int> p(n + 2);
        int l = 1, r = 1;
        for(int i = 1; i <= n; i++) {
            p[i] = max(0, min(r - i, p[l + (r - i)]));
            while(s[i - p[i]] == s[i + p[i]]) {
                p[i]++;
            }
            if(i + p[i] > r) {
                l = i - p[i], r = i + p[i];
            }
        }
        return vector<int>(begin(p) + 1, end(p) - 1);
    }
    vector<int> manacher(string s) {
        string t;
        for(auto c: s) {
            t += string("#") + c;
        }
        auto res = manacher_odd(t + "#");
        return vector<int>(begin(res) + 1, end(res) - 1);
    }
    void dfs(int u,const vector<vector<int>>& children,const string& s,string& o,vector<pair<int,int>>& lr){
        lr[u].first=o.size();
        for(int v:children[u])
            dfs(v,children,s,o,lr);
        o+=s[u];
        lr[u].second=o.size();
    }
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n=s.size();
        vector<vector<int>> children(n);
        for(int i=1;i<n;i++)
            children[parent[i]].push_back(i);
        string o;
        vector<pair<int,int>> lr(n);
        dfs(0,children,s,o,lr);
        auto d=manacher(o);
        vector<bool> ans(n);
        for(int i=0;i<n;i++){
            auto [l,r]=lr[i];
            ans[i]=d[l+r-1]-1>=r-l;
        }
        return ans;
    }
};

class Solution {
    // https://cp-algorithms.com/algebra/prime-sieve-linear.html
    vector<int> linear_sieve(int N){
        vector<int> lp(N+1);
        vector<int> pr;

        for (int i=2; i <= N; ++i) {
            if (lp[i] == 0) {
                lp[i] = i;
                pr.push_back(i);
            }
            for (int j = 0; i * pr[j] <= N; ++j) {
                lp[i * pr[j]] = pr[j];
                if (pr[j] == lp[i]) {
                    break;
                }
            }
        }
        return lp;
    }
public:
    int minOperations(vector<int>& nums) {
        constexpr int INF=1e9;
        auto lp=linear_sieve(*max_element(nums.begin(),nums.end()));
        array<int,2> dp{0,1};
        for(int i=1;i<nums.size();i++){
            array<int,2> dp2{INF,INF};
            if(nums[i]>=nums[i-1])
                dp2[0]=min(dp2[0],dp[0]);
            if(nums[i]>=lp[nums[i-1]])
                dp2[0]=min(dp2[0],dp[1]);
            if(lp[nums[i]]>1){
                if(lp[nums[i]]>=nums[i-1])
                    dp2[1]=min(dp2[1],dp[0]+1);
                if(lp[nums[i]]>=lp[nums[i-1]])
                    dp2[1]=min(dp2[1],dp[1]+1);
            }
            dp=dp2;
        }
        int ans=min(dp[0],dp[1]);
        return ans==INF?-1:ans;
    }
};

