class Solution {
public:
    vector<bool> findAnswer(vector<int>& par, string s) {


        int n = s.length();
        vector<bool> res(n);

        vector< vector<int> > adj( n, vector<int>());
        vector< pair<int,int> > cover(n);        
        string t = "";

        for( int i=1; i<n; i++) {
            adj[par[i]].push_back(i);
        }

        function<void(int)> dfs;

        dfs = [&]( int idx)->void {
            int sIdx = t.length();
            sort( adj[idx].begin(), adj[idx].end());
            for( int child: adj[idx]) {
                dfs(child);
            }
            int eIdx = t.length();
            t.push_back(s[idx]);
            cover[idx] = { sIdx, eIdx};
        };

        dfs(0);

        vector<int> d1( n, 1);
        vector<int> d2( n, 0);

        for( int i=0, l=-1, r=-1; i<n; i++) {
            int k = (i>r)?1:min( d1[l+r-i], r-i+1);
            while((i-k>=0) && (i+k<n) && (t[i-k]==t[i+k])) {
                k += 1;
            }
            d1[i] = k--;
            if(i+k>r) {
                l = i-k;
                r = i+k;
            }
        }

        for( int i=1, l=0, r=0; i<n; i++) {
            int k = (i>r)?0:min( d2[l+r-i+1], r-i+1);
            while((i-k-1>=0) && (i+k<n) && (t[i-k-1]==t[i+k])) {
                k += 1;
            }
            d2[i] = k--;
            if(i+k>r) {
                l = i-k-1;
                r = i+k;
            }
        }

        for( int i=0; i<n; i++) {
            int l = cover[i].second - cover[i].first + 1;
            int mid = (cover[i].second + cover[i].first + 1)/2;
            if(l%2==0) {
                res[i] = (d2[mid]>=(cover[i].second-mid+1));
            } else {
                res[i] = (d1[mid]>=(cover[i].second-mid+1));
            }
        }

        return res;
    }
};

const int N = 1e6;
int spd[N+1];

class Solution {
public:

    Solution() {
        if(spd[0]==-1) {
            return;
        }
        fill( begin(spd), end(spd), -1);
        for( int i=2; i<=N; i++) {
            if(spd[i]==-1) {
                for( int j=i+i; j<=N; j+=i) {
                    if(spd[j]==-1) {
                        spd[j] = i;
                    }
                }
            }
        }
    }

    int minOperations(vector<int>& arr) {
        int n = arr.size();
        int c0 = 0;
        int c1 = (spd[arr[0]]==-1)?(2*n):1;
        for( int i=1; i<n; i++) {
            int nc0 = 2*n;
            int nc1 = 2*n;
            if(arr[i]>=arr[i-1]) {
                nc0 = min( nc0, c0);
            }
            if((spd[arr[i-1]]!=-1) && (arr[i]>=spd[arr[i-1]])) {
                nc0 = min( nc0, c1);
            }
            if((spd[arr[i]]!=-1) && (spd[arr[i]]>=arr[i-1])) {
                nc1 = min( nc1, 1+c0);
            }
            if((spd[arr[i]]!=-1) && (spd[arr[i-1]]!=-1) && (spd[arr[i]]>=spd[arr[i-1]])) {
                nc1 = min( nc1, 1+c1);
            }
            c0 = nc0;
            c1 = nc1;
        }
        int ans = min( c0, c1);
        return (ans>n)?(-1):ans;
    }
};

