    spf[0], spf[1] = 0, 1
    for i in range(2, MAXN + 1):
        if spf[i] == 0:
            spf[i] = i
            for j in range(i * 2, MAXN + 1, i):
                if spf[j] == 0:
                    spf[j] = i
    return spf
