class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        count = {}
        total = 0
        left = 0
        for right in range(len(s)):
            cur = s[right]
            count[cur] = count.get(cur, 0) + 1
            while left <= right and count[cur] >= k:
                temp = s[left]
                count[temp] -= 1
                left += 1
            total += right - left + 1

        res = (len(s) + 1) * len(s) // 2
        res -= total
        return res

