    # print(s)
    t = '#'.join('^' + s + '$')
    p = [0] * len(t)
    c = r = 0
    for i in range(2, len(t) - 2):
        p[i] = int(r > i) and min(r - i, p[2 * c - i])
        while t[i + p[i] + 1] == t[i - p[i] - 1]:
            p[i] += 1
        if i + p[i] > r:
            c, r = i, i + p[i]
    return p

