void calc() {
  int k=0;
  stack<P> s;
  s.push(P(0,-1));
  while(!s.empty()) {
    P q=s.top();s.pop();
    int x=q.F,p=q.S;
    if(x<0||!x&&p>0) {
      a[-x].S=k;
      continue;
    }
    s.push(P(-x,-p));
    a[x].F=k++;
    for(int i=0; i<v[x].size(); i++) {
      int y=v[x][i];
      if(y==p) continue;
      s.push(P(y,x));
    }
  }
}

