  int minOperations(vector<int>& a) {
    map<ll,ll> ma;
    int ans=0;
    rrep(i,a.size()-1) {
      while(a[i]>a[i+1]) {
        if(!ma.count(a[i])) {
          ll M=1;
          for(ll j=2; j*j<=a[i]; j++) {
            if(a[i]%j==0) {
              M=max(M,j);
              M=max(M,a[i]/j);
            }
          }
          ma[a[i]]=M;
        }
        ll d=ma[a[i]];
        if(d==1) return -1;
        a[i]/=d;
        ans++;
      }
    }
    return ans;
  }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size(); 
        vector<vector<int>> dp(n, vector<int>(n, 0)); 
        vector<vector<int>> pos(26); 
        for (int i = 0; i < n; ++i) {
            pos[s[i] - 'a'].push_back(i); 
        }
        for (auto v: pos) {
            if (v.size() < k) continue; 
            for (int i = 0; i + k - 1 < v.size(); ++i) {
                dp[v[i]][v[i + k - 1]] = 1; 
            }
        }
        int ans = 0; 
        for (int l = n - 1; l >= 0; --l) {
            for (int r = l; r < n; ++r) {
                if (dp[l][r]) ans++; 
                if (l) dp[l-1][r] |= dp[l][r]; 
                if (r + 1 < n) dp[l][r+1] |= dp[l][r]; 
            }
        }
        return ans; 
    }
};

