            t[tout[i]] = s[i]; 
        }
        // cout << t << '\n';
        s = t; 
        reverse(s.begin(), s.end()); 
        HashedString ha(t); 
        HashedString hb(s); 

        vector<bool> res(n); 
        for (int i = 0; i < n; ++i) {
            int l = tin[i], r = tout[i]; 
            // cout << tin[i] << ' ' << tout[i] << '\n';
            // cout << ha.get(l, r) << ' ' << hb.get(n - 1 - r, n - 1 - l) << '\n';
            res[i] = ha.get(l, r) == hb.get(n - 1 - r, n - 1 - l); 
