                if (a[i] % 2 == 0) {
                    a[i] = 2; 
                    ans++; 
                    continue; 
                }
                for (int j = 3; j * j <= a[i]; j += 2) {
                    if (a[i] % j == 0) {
                        a[i] = j; 
                        ans++; 
                        break; 
                    }
                }
                if (a[i] > a[i + 1]) return -1; 
            }
        }
        return ans; 
    }
};

