int MX = 1e6;

struct Divisors {
    vector<int> fs;
    Divisors() : fs(MX + 1) {
        for (int p = 2; p <= MX; ++p) {
            for (int q = 2 * p; q <= MX; q += p) {
                fs[q] = p;
            }
        }
    }  
} divisors;

class Solution {
public:
    int minOperations(vector<int>& A) {
        int n = A.size(), res = 0;
        for (int i = n - 2; i >= 0; --i) {
            if (A[i] > A[i + 1]) {
                auto f = divisors.fs[A[i]];
                if (f == 0) return -1;
                if ((A[i] /= f) > A[i + 1]) return -1;
                ++res;
            }
        }

        return res;
    }
};

