        for(int i = 1; i <= 1000; ++i) vis[i] = 1;
        vis[1] = 0;
        for(int i = 2; i <= 1000; ++i){
            if(vis[i]) p[++cnt] = i;
            for(int j = 1; j <= cnt && i * p[j] <= 1000; ++j){
                vis[i * p[j]] = 0;
            }
        }
        int n = nums.size(), ans = 0, lst = 1000000;
        for(int i = n - 1; i >= 0; --i){
            if(nums[i] <= lst){
                lst = nums[i];
                continue;
            }
            int f = -1;
            for(int j = 1; j <= cnt; ++j)
                if(nums[i] % p[j] == 0){
                    f = p[j];
                    break;
                }
            if(f == -1 || f > lst) return -1;
            ans += 1;
            lst = f;
        }
        return ans;
    }
};

