    vector<bool> findAnswer(vector<int>& parent, string ss) {
        n = parent.size(); s = ss;
        e = vector<vector<int>>(n);
        for (int i = 0; i < n; i++) {
            if (parent[i] != -1) e[parent[i]].push_back(i);
        }
        for (auto &i : e) sort(i.begin(), i.end());
        EulerTourTree ET(n, e, 0);
        // for (auto i : ET.tin) cout << i << ",";
