class Solution {
public:

    int smallestPrimeFactor(int x) {
        if (x % 2 == 0) return 2;
        for (int i = 3; i <= sqrt(x); i += 2) {
            if (x % i == 0) return i;
        }
        return x; 
    }

    int minOperations(std::vector<int>& nums) {
        int operations = 0;
        int n = nums.size();
        for (int i = n - 2; i >= 0; --i) {

            if (nums[i] <= nums[i + 1]) {
                continue;
            }


            if (nums[i] == 1) {
                return -1;
            }


            int spf = smallestPrimeFactor(nums[i]);
            nums[i] = spf;
            operations += 1;


            if (nums[i] > nums[i + 1]) {
                return -1;
            }
        }
        return operations;
    }
};

class Solution {
    public int numberOfSubstrings(String s, int k) {

        int [] count = new int [26];

        int total = 0;

        for (int i = 0; i < s.length(); ++i) {
            Arrays.fill(count, 0);
            int val;
            boolean seen = false;

            for (int j = i; j < s.length(); ++j) {
                val = s.charAt(j) - 'a';

                count[val]++;

                if (count[val] == k)
                    seen = true;

                total += seen ? 1 : 0;
            }
        }

        return total;
    }
}

