class Solution {

    List<Integer> [] graph;

    int [][] pos;

    int idx;

    public boolean[] findAnswer(int[] parent, String s) {
        int n = parent.length;

        graph = new List[n];

        for (int i = 0; i < n; ++i) {
            graph[i] = new ArrayList<>();
        }

        for (int i = 1; i < n; ++i) {
            graph[parent[i]].add(i);
        }

        StringBuilder sb = new StringBuilder();
        pos = new int [n][2];

        dfs(0, sb, s);

        String val = sb.toString();

        boolean [] res = new boolean [n];

        RollingHashLong roll = RollingHashLong.getHashFromString(val, 30, 1_000_000_007);

        int a, b;

        for (int i = 0; i < n; ++i) {
            a = pos[i][0];
            b = pos[i][1];

            res[i] = roll.getHashLong(a, b) == roll.getHashLong(b, a);
        }

        return res;
    }

    private void dfs(int node, StringBuilder sb, String s) {

        pos[node][0] = sb.length();


        for (int child : graph[node]) {
            dfs(child, sb, s);
        }


        pos[node][1] = sb.length();
        sb.append(s.charAt(node));
    }


}
class RollingHashLong {

	long [] mArr;
	long [] forwardArr;
	long [] backArr;


	long [] mArr2;
	long [] forwardArr2;
	long [] backArr2;


	int [] requestArr;
	int reqMul, reqMul2;

	long mod, mod2;

	static Random rand = new Random();

	static int addMul =  1_005 + rand.nextInt(100);
	static int addMod = 1_000_016 + 2 * rand.nextInt(100_000);

	// lower case alpha
	public static RollingHashLong getHashFromString(String s, int mul, int mod) {
		int [] arr = new int[s.length()];

		for (int i = 0; i < s.length(); ++i) {
			arr[i] = s.charAt(i) - 'a';
		}

		return new RollingHashLong(arr, mul, mod);
	}

	// zero indexex
	public RollingHashLong(int [] arr, int mul, int mod) {

		long cHash = 0;
		long mHash = 1;

		mArr = new long [arr.length + 1];
		forwardArr = new long [arr.length];
		backArr = new long [arr.length];

		this.mod = mod;
		this.requestArr = arr;
		this.reqMul = mul;

		mArr[0] = 1;

		for (int i = 0; i < arr.length; ++i) {
			cHash *= mul;
			cHash += arr[i];
			cHash %= mod;

			forwardArr[i] = cHash;

			mHash *= mul;
			mHash %= mod;

			mArr[i + 1] = mHash;
		}

		cHash = 0;

		for (int i = arr.length - 1; i >= 0; --i) {
			cHash *= mul;
			cHash += arr[i];
			cHash %= mod;

			backArr[i] = cHash;
		}






		cHash = 0;
		mHash = 1;

		mArr2 = new long [arr.length + 1];
		forwardArr2 = new long [arr.length];
		backArr2 = new long [arr.length];

		this.mod2 = mod + addMod;
		this.reqMul2 = mul + addMul;
		int mul2 = reqMul2;

		mArr2[0] = 1;

		for (int i = 0; i < arr.length; ++i) {
			cHash *= mul2;
			cHash += arr[i];
			cHash %= mod2;

			forwardArr2[i] = cHash;

			mHash *= mul2;
			mHash %= mod2;

			mArr2[i + 1] = mHash;
		}

		cHash = 0;

		for (int i = arr.length - 1; i >= 0; --i) {
			cHash *= mul2;
			cHash += arr[i];
			cHash %= mod2;

			backArr2[i] = cHash;
		}
	}

	public long getHashLong(int from, int to) {
        // System.out.println(from + " " + to);
		long hash = getHash(from, to, forwardArr, backArr, mArr, mod);
		hash *= mod2;
		hash += getHash(from, to, forwardArr2, backArr2, mArr2, mod2);
		return hash;
	}

	// abcdefg
	// def - abcdef - abc * 3

	private long getHash(int from, int to, 
			long [] forwardArr, long [] backArr, long [] mArr, long mod) {

		long result;
		int prev;

		if (to >= from) {
			result = forwardArr[to];
			prev = from - 1;

			long sub = prev == -1 ? 0 : forwardArr[prev];
			sub *= mArr[to - prev];
			sub %= mod;

			result += mod;
			result -= sub;
			result %= mod;
		}else {
			result = backArr[to];
			prev = from + 1;

			long sub = prev == backArr.length ? 0 : backArr[prev];
			sub *= mArr[prev - to];
			sub %= mod;

			result += mod;
			result -= sub;
			result %= mod;
		}

		return result;
	}
}

class Solution {

    static int [] maxDiv;

    static {
        int length = 1_000_001;
        maxDiv = new int [length];

        for (int i = 1; i < length; ++i) {
            for (int j = 2 * i; j < length; j += i) {
                maxDiv[j] = i;
            }
        }
    }

    public int minOperations(int[] nums) {

        int max;

        int total = 0;

        for (int i = nums.length - 2; i >= 0; --i) {

            while (nums[i] > nums[i + 1]) {
                max = maxDiv[nums[i]];

                if (max < 2)
                    return -1;

                ++total;

                nums[i] /= max;
            }
        }

        return total;
    }
}

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int cnt[26]={};
        int ans=0;
        for (int j=0, i=0; i<s.size(); ++i) {
            ++cnt[s[i]-'a'];
            while(*max_element(cnt, cnt+26)>=k) {
                --cnt[s[j]-'a'];
                ++j;
            }
            if (j) {
                --j;
                ++cnt[s[j]-'a'];
            }
            if (*max_element(cnt, cnt+26)>=k) {
                ans+=j+1;
            }
        }
        return ans;
    }
};

