class Solution {
public:
    int n;
    vector<vector<int>> adj;
    vector<bool> ans;
    vector<int> sz;
    string s;

    ar<ar<int, 2>, 2> dfs(int u=0) {
        ar<int, 2> h1={}, h2={};
        int cur=0;
        for (int v : adj[u]) {
            ar<ar<int, 2>, 2> x = dfs(v);
            h1=h1*pows[sz[v]]+x[0];
            h2=x[1]*pows[sz[u]-1]+h2;
            sz[u]+=sz[v];
        }
        //cout << pows.size() << " " << s[u] << endl;
        h1=h1*pows[1]+make_hash(s[u]);
        h2=make_hash(s[u])*pows[sz[u]-1]+h2;
        // if (u==1) {
        //     cout << (make_hash('a')+make_hash('b')*pows[1]+make_hash('a')*pows[2])[0] << endl;
        //     cout << h1[0] << " " << h2[0] << endl;
        // }
        ans[u]=h1==h2;
        return {h1, h2};
    }

    vector<bool> findAnswer(vector<int>& parent, string _s) {
        s=_s;
        n=parent.size();
        adj.resize(n);
        ans.resize(n);
        sz.assign(n, 1);
        for (int i=1; i<n; ++i)
            adj[parent[i]].push_back(i);
        extend(n+5);
        dfs();
        return ans;
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        vector<int> a(*max_element(nums.begin(), nums.end())+1);
        for (int i=2; i<a.size(); ++i) {
            if (a[i])
                continue;
            for (int j=i; j<a.size(); j+=i)
                if (!a[j])
                    a[j]=i;
        }
        reverse(nums.begin(), nums.end());
        int ans=0;
        for (int i=1; i<nums.size(); ++i) {
            if (nums[i]>nums[i-1]) {
                nums[i]=a[nums[i]];
                ++ans;
                if (nums[i]>nums[i-1])
                    return -1;
            }
        }
        return ans;
    }
};

