class Solution:
    def minOperations(self, nums: List[int]) -> int:
        @cache
        def f(i,prev):
            if i == len(nums):
                return 0
            if nums[i] < prev:
                return inf
            if (x := p(nums[i])) >= prev:
                return min(1+f(i+1,x),f(i+1,nums[i]))
            return f(i+1,nums[i])
        result = f(0,0)
        f.cache_clear()
        return result if result != inf else -1

