//manacher algorithm
//http://snuke.hatenablog.com/entry/2014/12/02/235837

//longest palindrome(length:odd)
//if you want to find the answer for even palindrome,
//you can use dummy letter.
//ex. $a$b$c$c$b$a$
vector<int> manacher(string &s){
  int i,j,k,l;
  l=s.size();
  vector<int> arr(l);
  i=0;j=0;
  while(i<l){
    while((i-j)>=0 && (i+j)<l){
      if(s[i-j]!=s[i+j]){break;}
      j++;
    }
    arr[i]=j;
    k=1;
    while((i-k)>=0 && (i+k)<l){
      if(k+arr[i-k]>=arr[i]){break;}
      arr[i+k]=arr[i-k];
      k++;
    }
    j=arr[i]-k;
    i+=k;
  }
  return arr;
}

vector<int> pal_build(string s){
  string ms="$";
  for(auto &nx : s){
    ms.push_back(nx);
    ms.push_back('$');
  }
  return manacher(ms);
}

// 0-indexed ask [l,r]
bool pal_ask(int l,int r,vector<int> &pal_dat){
  int len=r-l+1;
  int cent=l+r+1;
  return (pal_dat[cent]>=len);
}

