            for(auto &nx : mv){nx=1e9;}
            for(int i=2;i<MXM;i++){
                if(mv[i]>5e8){
                    for(int j=2*i;j<MXM;j+=i){
                        mv[j]=min(i,mv[j]);
                    }
                }
            }
        }
        // for(int i=0;i<10;i++){cout << mv[i] << "\n";}
        int n=nums.size();
        int d0=0,d1;
