        else{d1=1;}
        for(int i=1;i<n;i++){
            int nd0=1e9;
            int nd1=1e9;
            if(nums[i-1]<=nums[i]){nd0=min(nd0,d0);}
            if(nums[i-1]<=mv[nums[i]] && mv[nums[i]]<5e8){nd1=min(nd1,d0+1);}
            if(mv[nums[i-1]]<=nums[i]){nd0=min(nd0,d1);}
