class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans = 0;
        int n = sz(s);
        vector<vector<int>> pre(n, vector<int>(26));
        for(int i = 0; i < sz(s); i++){
            if(i) pre[i] = pre[i - 1];
            pre[i][s[i] - 'a']++;
        }

        auto val = [&](int l, int r) -> bool{
            for(int i = 0; i < 26; i++){
                int cnt = pre[r][i] - (l == 0 ? 0 : pre[l - 1][i]);
                if(cnt >= k) return 1;
            }
            return 0;
        };

        for(int i = 0; i < sz(s); i++){
            int start = 0, end = sz(s) - 1, mid, res = -1;
            while(start <= end){
                mid = (start + end) / 2;
                if(val(i, mid)){
                    res = mid;
                    end = mid - 1;
                }
                else{
                    start = mid + 1;
                }
            }
            if(res == -1) break;
            ans += n - res;
        }
        return ans;
    }
};

