    int numberOfSubstrings(string s, int k) {
        vector<int> freq(26);
        multiset<int> fr;
        for (int i = 0; i < 26; i++ ) fr.insert(0);
        int l = 0;
        int r = 0;
        int res = 0;
        int n = s.size();
        while (l != n) {
            while (-(*fr.begin()) < k && r != n) {
                fr.erase(-freq[s[r]-'a']);
                freq[s[r]-'a']++;
                fr.insert(-freq[s[r]-'a']);
                r++;
