class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        vector<vector<int> > c(n, vector<int>(26));
        for (int i = 0; i < n; i ++){
            c[i][s[i] - 'a'] ++;
            for (int j = 0; j < 26; j ++){
                if (i > 0)
                    c[i][j] += c[i - 1][j];
            }
        }
        int answer = 0;
        for (int i = 0; i < n; i ++){
            int left = i, right = n;
            while(left < right){
                int mid = (left + right) / 2;
                bool oka = false;
                for (int j = 0; j < 26; j ++){
                    int hay = c[mid][j] - (i > 0 ? c[i - 1][j] : 0);
                    if (hay >= k)
                        oka = true;
                }
                if (oka){
                    right = mid;
                }
                else{
                    left = mid + 1;
                }
            }
            answer += (n - right);
        }
        return answer;
    }
};

