class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.length();

        int ans = 0;
        map<char, int> cnt;

        auto check = [&]() {
            for (auto&& [v, c] : cnt) {
                if (c >= k) return true;
            }
            return false;
        };

        int r = 0;
        for (int l = 0; l < n; l++) {
            while (r <= l || r < n && !check()) {
                cnt[s[r]]++;
                r++;
            }

            if (!check()) break;

            // cout << l << ' ' << r << endl;

            ans += n - r + 1;

            cnt[s[l]]--;
        }
        return ans;
    }
};

