class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string val) {
        int n = parent.size();
        vector<vector<int>> g(n);
        for (int i = 1; i < n; i++) {
            g[parent[i]].push_back(i);
        }

        vector<int> indfs(n), outdfs(n);
        int ndfn = 0;

        string s;
        y_comb([&](auto dfs, int u) -> void {
            indfs[u] = ndfn;
            for (int v : g[u]) {
                dfs(v);
            }
            s += val[u];
            outdfs[u] = ndfn++;
        })(0);

        // cout << s << endl;
        // for (int i : indfs) cout << i << ' ';
        // cout << endl;
        // for (int i : outdfs) cout << i << ' ';
        // cout << endl;

        Manacher mana(to_vec(s));

        vector<bool> ans(n);

        for (int i = 0; i < n; i++) {
            int l = indfs[i], r = outdfs[i];
            int len = r - l + 1;
            if (len & 1) {
                ans[i] = mana.oddlen((l + r) / 2) >= len;
            } else {
                ans[i] = mana.evenlen((l + r) / 2) >= len;
            }
        }
        return ans;
    }
};

vector<int> isp, pri, minfac, maxfac;
void init_prime(int n) {
  isp.assign(n + 1, 1); isp[0] = isp[1] = 0;
  minfac.assign(n + 1, 0);
  maxfac.assign(n + 1, 0);
  for(int i = 2; i <= n; i++) {
    if(isp[i]) { pri.push_back(i); isp[i] = pri.size(); minfac[i] = i; }
    for(int p : pri) {
      if (i > n / p) break;
      isp[i * p] = 0;
      minfac[i * p] = p;
      if(i % p == 0) break;
    }
  }
  for (int i = 2; i <= n; i++) {
    maxfac[i] = max(maxfac[i / minfac[i]], minfac[i]);
  }
}

