class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        array<int,26> cnt{};
        vector<int> cntcnt(k+1);
        int n=s.size(),j=0,ans=0;
        for(int i=0;i<n;i++){
            while(j<n&&cntcnt.back()==0){
                int& c=cnt[s[j]-'a'];
                if(c<k){
                    cntcnt[c]--;
                    cntcnt[c+1]++;
                }
                c++;
                j++;
            }
            if(cntcnt.back()>0)
                ans+=n-j+1;
            int& c=cnt[s[i]-'a'];
            if(c<=k){
                    cntcnt[c]--;
                    cntcnt[c-1]++;
            }
            c--;
        }
        return ans;
    }
};

