class Solution:
    def minOperations(self, nums: List[int]) -> int:

        ans = 0
        target = nums[-1]

        for i in range(len(nums) - 2, -1, -1):
            curr = nums[i]
            while curr > target:
                if curr == 1:
                    return -1
                gpd = curr // spf[curr]
                if gpd == 0: return -1
                if gpd == 1 and curr > target: return -1
                curr = curr // gpd
                ans += 1
            target = curr

        return ans

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        count = {}
        total = 0
        left = 0
        for right in range(len(s)):
            cur = s[right]
            count[cur] = count.get(cur, 0) + 1
            while left <= right and count[cur] >= k:
                temp = s[left]
                count[temp] -= 1
                left += 1
            total += right - left + 1

        res = (len(s) + 1) * len(s) // 2
        res -= total
        return res

