        def findDivisor(k):
            ceiling = math.floor(k ** 0.5)

            for i in range(2, ceiling + 1):
                if k % i == 0:
                    return i
            return k
        res = 0
        for i in range(len(nums)-2, -1, -1):
            if nums[i] > nums[i+1]:
                temp = findDivisor(nums[i])
                if temp > nums[i+1]:
                    return -1
                nums[i] = temp
                res += 1
        return res

