class Solution {
public:
  vector<bool> findAnswer(vector<int>& p, string ss) {
    s=ss;
    ll n=s.size();
    ans.clear();
    rep(i,n) v[i].clear(),ans.pb(0);
    REP(i,1,p.size()) v[p[i]].pb(i);
    t="";
    dfs(0);
    calc();
    RollingHash rh;
    reverse(all(t));
    auto r1=rh.build(t);
    reverse(all(t));
    auto r2=rh.build(t);
    rep(i,n) {
      ll l=a[i].F,r=a[i].S;
      ll x=t.size()-a[i].S,y=t.size()-a[i].F;
      uint64_t h1=rh.query(r1,l,r);
      uint64_t h2=rh.query(r2,x,y);
      ans[i]=h1==h2;
    }
    return ans;
  }
};

