class Solution {
public:
    vector<bool> findAnswer(vector<int>& p, string s) {
        int n = s.size(); 
        vector<vector<int>> g(n); 
        for (int i = 1; i < n; ++i) {
            g[p[i]].push_back(i); 
        }
        vector<int> tin(n), tout(n); 
        int tt = 0; 
        dfs(0, g, tin, tout, tt); 
        string t = s; 
        for (int i = 0; i < n; ++i) {
            // cout << tin[i] << ' ' << tout[i] << '\n';
            t[tout[i]] = s[i]; 
        }
        // cout << t << '\n';
        s = t; 
        reverse(s.begin(), s.end()); 
        HashedString ha(t); 
        HashedString hb(s); 

        vector<bool> res(n); 
        for (int i = 0; i < n; ++i) {
            int l = tin[i], r = tout[i]; 
            // cout << tin[i] << ' ' << tout[i] << '\n';
            // cout << ha.get(l, r) << ' ' << hb.get(n - 1 - r, n - 1 - l) << '\n';
            res[i] = ha.get(l, r) == hb.get(n - 1 - r, n - 1 - l); 
        }
