    }
    void dfs(int x, vector<vector<int>> & g, vector<int> & tin, vector<int> & tout, int & t) {
        tin[x] = t; 
        for (auto y: g[x]) {
            dfs(y, g, tin, tout, t); 
        }
        tout[x] = t; 
        t++; 
    }
};

class Solution {
public:
    int minOperations(vector<int>& a) {
        int n = a.size(); 
        int ans = 0; 
        for (int i = n - 2; i >= 0; --i) {
            if (a[i] > a[i + 1]) {
                if (a[i] % 2 == 0) {
                    a[i] = 2; 
                    ans++; 
                    continue; 
                }
                for (int j = 3; j * j <= a[i]; j += 2) {
                    if (a[i] % j == 0) {
                        a[i] = j; 
                        ans++; 
                        break; 
                    }
                }
                if (a[i] > a[i + 1]) return -1; 
            }
        }
        return ans; 
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = (int)s.size();
        int cnt = 0;
        for (int i = 0; i < n; ++i) {
            vector<int> freq(26);
            bool pos = false;
            for (int j = i; j < n; ++j) {
                if (++freq[s[j] - 'a'] >= k) {
                    pos = true;
                }
                if (pos) {
                    ++cnt;
                }
            }
        }
        return cnt;
    }
};

