class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        s = [ord(x)-ord('a') for x in s]
        tot = [0] * 26

        ans = 0

        n = len(s)
        j = 0
        for i in range(n):
            while j < n and max(tot) < k:
                tot[s[j]] += 1
                j += 1

            if max(tot) >= k:
                ans += n - j + 1

            tot[s[i]] -= 1

        return ans

