using i64 = long long;

constexpr int MAX = 100010;
constexpr i64 P = 131;
constexpr i64 Q = 997;
constexpr i64 MP = 999999937;
constexpr i64 MQ = 1000000007;

i64 Pow(i64 a, i64 b, i64 p) {
  i64 ret = 1;
  for (a %= p; b; b >>= 1) {
    if (b & 1) {
      ret = ret * a % p;
    }
    a = a * a % p;
  }
  return ret;
}

i64 Inv(i64 x, i64 p) { return Pow(x, p - 2, p); }

template<i64 P, i64 MOD>
struct Hash {
  i64 sum[MAX], inv[MAX];

  void Assign(const string& s) {
    int n = s.length();
    sum[0] = 0;
    inv[0] = 1;
    i64 w = 1;
    for (int i = 0; i < n; ++i) {
      sum[i + 1] = (sum[i] + (i64)(s[i]) * w) % MOD;
      w = w * P % MOD;
      inv[i + 1] = Inv(w, MOD);
    }
  }

  i64 Query(int l, int r) const {
    i64 ret = (sum[r] - sum[l] + MOD) % MOD;
    return ret * inv[l] % MOD;
  }
};

vector<int> adj[MAX];
int l[MAX], r[MAX];

string str, rev;
Hash<P, MP> h1, r1;
Hash<Q, MQ> h2, r2;

void DFS(const string& s, int x, int p, string& ret) {
  l[x] = ret.length();
  for (int y : adj[x]) {
    if (y != p) {
      DFS(s, y, x, ret);
    }
  }
  ret.push_back(s[x]);
  r[x] = ret.length();
}

bool Query(int n, int x) {
  i64 x1 = h1.Query(l[x], r[x]);
  i64 y1 = r1.Query(n - r[x], n - l[x]);
  i64 x2 = h2.Query(l[x], r[x]);
  i64 y2 = r2.Query(n - r[x], n - l[x]);
  return x1 == y1 && x2 == y2;
}

class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
      int n = parent.size();
      for (int i = 0; i < n; ++i) {
        vector<int>().swap(adj[i]);
      }
      for (int i = 0; i < n; ++i) {
        int p = parent[i];
        if (p != -1) {
          adj[p].push_back(i);
        }
      }
      str.clear();
      rev.clear();
      DFS(s, 0, -1, str);
      rev = str;
      reverse(rev.begin(), rev.end());
      h1.Assign(str);
      h2.Assign(str);
      r1.Assign(rev);
      r2.Assign(rev);
      vector<bool> ret(n, false);
      for (int i = 0; i < n; ++i) {
        ret[i] = Query(n, i);
      }
      return ret;
    }
};

constexpr int MAX = 1000100;

int a[MAX], p[MAX];

void Prime() {
  int n = 0;
  for (int i = 2; i < MAX; ++i) {
    if (!a[i]) {
      a[i] = i;
      p[n++] = i;
    }
    for (int j = 0; i * p[j] < MAX; ++j) {
      a[i * p[j]] = p[j];
      if (!(i % p[j])) {
        break;
      }
    }
  }
}

