import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

class Solution {
    int N;
    long P = 1001;
    long Q = 1926_0817;
    long MOD = 1_000_000_007;
    long[] p;
    long[] q;

    public boolean[] findAnswer(int[] parent, String s) {

        N = parent.length;
        p = new long[N + 1];
        q = new long[N + 1];
        p[0] = 1;
        q[0] = 1;
        for (int i = 1; i < N; i++) {
            p[i] = p[i - 1] * P % MOD;
            q[i] = q[i - 1] * Q % MOD;
        }

        List<List<Integer>> children = new ArrayList<>();
        for (int i = 0; i < N; i++) {
            children.add(new ArrayList<>());
        }
        for (int i = 1; i < N; i++) {
            int p = parent[i];
            children.get(p).add(i);
        }
        boolean[] ans = new boolean[N];
        Arrays.fill(ans, true);
        dfs(0, s, children, ans, P, p);
        dfs(0, s, children, ans, Q, q);
        return ans;
    }

    private long[] dfs(int v, String s, List<List<Integer>> children, boolean[] ans, long prime, long[] pow) {

        int c = s.charAt(v) - 'a';
        if (children.get(v).isEmpty()) {
            ans[v] = true;
            return new long[]{c, c, 1};
        }


        List<Long> inOrder = new ArrayList<>();
        List<Long> reverse = new ArrayList<>();
        List<Long> size = new ArrayList<>();
        long totalSize = 0;
        for (int w : children.get(v)) {
            long[] sub = dfs(w, s, children, ans, prime, pow);
            inOrder.add(sub[0]);
            reverse.add(sub[1]);
            size.add(sub[2]);
            totalSize += sub[2];
        }
        long l = 0;
        for (int i = 0; i < children.get(v).size(); i++) {
            long hash = inOrder.get(i);
            int sz = (int) ((long) size.get(i));
            l *= pow[sz];
            l %= MOD;
            l += hash;
            l %= MOD;
        }
        l *= prime;
        l %= MOD;
        l += c;
        l %= MOD;


        long r = c;
        for (int i = children.get(v).size() - 1; i >= 0; i--) {
            long hash = reverse.get(i);
            int sz = (int) ((long) size.get(i));
            r *= pow[sz];
            r %= MOD;
            r += hash;
            r %= MOD;
        }
        ans[v] &= (l == r);
        return new long[]{l, r, totalSize + 1};
    }
}

class Solution {
    public int minOperations(int[] arr) {
        int ans = 0;
        for (int i = arr.length - 2; i >= 0; i--) {
            int next = arr[i + 1];
            int cur = arr[i];
            while (cur > next) {
                int maxDiv = maxDiv(cur);
                if (maxDiv == -1) {
                    return -1;
                }
                ans++;
                cur /= maxDiv;
            }
            arr[i] = cur;
        }
        return ans;

    }

    private int maxDiv(int v) {
        for (int d = 2; d * d <= v; d++) {
            if (v % d == 0) {
                return v / d;
            }
        }
        return -1;
    }
}

