    string srt;
    vector<int> cnt, pos;
    void dfs(string &s, int u) {
        sort(adj[u].begin(), adj[u].end());
        for (int v : adj[u]) {
            dfs(s, v);
            cnt[u] += cnt[v];
        }
        pos[u] = (int)srt.size();
