        cnt = vector<int>(N, 1);
        pos = vector<int>(N);
        dfs(s, 0);
        vector<ll> pre = preHash(srt);
        reverse(all(srt));
        vector<ll> rev = preHash(srt);
        vector<bool> res;
        for (int i = 0; i < N; i++) {
            int r = pos[i], l = pos[i] - cnt[i] + 1;
