class Solution {
public:
    ll f(ll a){
       for(int i=2;i*i<=a;i++){
         if(a%i==0) return i;
       }
       return -1;
    }
    int minOperations(vector<int>& v) {
        ll n=v.size(),ans=0;
        for(int i=n-1;i>0;i--){
          if(v[i-1]>v[i]){
            ll val=f(v[i-1]);
            if(val==-1 || val>v[i]) return -1;
            ans++;
            v[i-1]=val;
          }
        }
        return ans;
    }
