const int A = 26;

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = (int) s.size();
        multiset<int> ms = {-1};
        vector<int> cnt(A);
        int ans = 0;
        for (int l = 0, r = -1; l < n; l++) {
            while (r + 1 < n && *ms.rbegin() < k) {
                int x = s[r + 1] - 'a';
                if (ms.find(cnt[x]) != ms.end()) {
                    ms.erase(ms.find(cnt[x]));
                }
                cnt[x]++;
                ms.emplace(cnt[x]);
                r++;
            }
            if (*ms.rbegin() >= k) {
                ans += n - r;
            }
            int x = s[l] - 'a';
            if (ms.find(cnt[x]) != ms.end()) {
                ms.erase(ms.find(cnt[x]));
            }
            cnt[x]--;
            ms.emplace(cnt[x]);
        }
        return ans;
    }
};

