class Solution {
public:
    vector<int> manacher_odd(string s) {
        int n = s.size();
        s = "$" + s + "^";
        vector<int> p(n + 2);
        int l = 1, r = 1;
        for(int i = 1; i <= n; i++) {
            p[i] = max(0, min(r - i, p[l + (r - i)]));
            while(s[i - p[i]] == s[i + p[i]]) {
                p[i]++;
            }
            if(i + p[i] > r) {
                l = i - p[i], r = i + p[i];
            }
        }
        return vector<int>(begin(p) + 1, end(p) - 1);
    }

    vector<bool> findAnswer(vector<int>& par, string s) {
        int n = (int) par.size();
        vector<vector<int>> adj(n);
        for (int i = 1; i < n; i++) {
            adj[par[i]].emplace_back(i);
        }
        for (int u = 0; u < n; u++) {
            sort(adj[u].begin(), adj[u].end());
        }
        vector<int> tin(n);
        vector<int> tout(n);
        int tim = 0;
        string str = "#";

        function<void(int)> dfs = [&](int u) {
            tin[u] = (int) str.size();
            for (int v : adj[u]) {
                dfs(v);
            }
            tout[u] = (int) str.size();
            str += s[u];
            str += "#";
        };

        dfs(0);
        vector<int> d = manacher_odd(str);
        vector<bool> ans(n);
        for (int u = 0; u < n; u++) {
            int l = tin[u];
            int r = tout[u];
            int len = r - l + 1;
            int mid = (l + r) / 2;
            ans[u] = (mid + d[mid] - 1 >= r);
        }
        return ans;
    }
};

