class Solution {
public:
    int minOperations(vector<int>& a) {
        if (!done) {
            p[1] = 1;
            for (int i = 1; i < N; i++) {
                for (int j = i + i; j < N; j += i) {
                    p[j] = i;
                }
            }
            done = true;
        }
        int n = (int) a.size();
        int ans = 0;
        for (int i = n - 2; i >= 0; i--) {
            if (a[i] <= a[i + 1]) {
                continue;
            }
            a[i] = a[i] / p[a[i]];
            if (a[i] > a[i + 1]) {
                return -1;
            }
            ++ans;
        }
        return ans;
    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        answer = 0
        i = 0
        window = Counter()
        for j in range(n):
            window[s[j]] += 1
            while i <= j:
                window[s[i]] -= 1
                if window.most_common(1)[0][1] >= k:
                    i += 1
                else:
                    window[s[i]] += 1
                    break
            if window.most_common(1)[0][1] >= k:
                answer += i + 1
        return answer

