def is_palindrome(s):
    n = len(s)
    first_half_end = (n - 2) // 2 # NOTE 4: Oops had that as `(n - 1)`.
    last_half_start = (n + 1) // 2
    return s[: first_half_end + 1] == s[: last_half_start - 1 : -1]

