class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size(), ok = 0;
        int left = 0, ans = 0;
        vector<int> M(128);
        for (int i = 0; i < n; i++) {
            M[s[i]] += 1;
            if (M[s[i]] == k) ok += 1;
            // [left, i]
            while (left <= i && ok > 0) {
                if (M[s[left]] == k) ok -= 1;
                M[s[left]] -= 1;
                left += 1;
            }
            // [left, i] not ok
            ans += left;
        }
        return ans;
    }
};

