class Machine {
public:
    vector<int> dp;
    bool is_palindrome(int left, int right) {
        int mid = ((left * 2 + 1) + (right * 2 + 1)) / 2;
        int need = right - left + 1;
        return dp[mid] >= need;
    }

    Machine(const string &s) {
        int n = s.size();

        int m = 2 * n + 1;
        dp = vector<int>(m);

        int mid = -1, right = -1;
        for (int i = 0; i < m; i++) {
            if (i <= right) {
                int shadow = mid - (i - mid);
                int upper = right - i;

                if (dp[shadow] < upper) {
                    dp[i] = dp[shadow];
                    continue;
                }
            }
            dp[i] = right - i;
            for (int j = right + 1; j < m; j++) {
                if (i - (j - i) < 0) break;
                char cr = s[j/2];
                char cl = s[(i-(j-i))/2];
                if (j & 1 && cr != cl)
                    break;
                right = j;
                mid = i;
                dp[i] = right - i;
            }
        }
    }
};

