            adj[parent[i]].push_back(i);

        string PO;
        vector<int> ID, SZ;
        auto dfs = [&](int v, auto&& dfs) -> int {
            int sz = 1;
            for (int u : adj[v])
                sz += dfs(u, dfs);
            ID.push_back(v);
            PO.push_back(s[v]);
            SZ.push_back(sz);
            return sz;
