        dfs(0, dfs);

        Machine M(PO);

        vector<bool> ans(n);
        for (int i = 0; i < n; i++) {
            int left = i - SZ[i] + 1;
            ans[ID[i]] = M.is_palindrome(left, i);
        }
        return ans;
    }
};

