        if(pre[n]) return pre[n];
        int sq= sqrt(n);
        int mx=0;
        for(int i=2;i<=sq;i++){
            if(n%i==0){
                mx=max(mx,i);
                mx=max(mx,n/i);
            }
        }
        pre[n]=mx;
        return mx;
    }
