        const int MAX_N = 1e6 + 1;
        vector<int> spf(MAX_N);

        for(int i = 0; i < MAX_N; ++i)
            spf[i] = i;

        for(int i = 2; i * i < MAX_N; ++i)
        {
            if(spf[i] == i)
            {
                for(int j = i * i; j < MAX_N; j += i) 
                {
                    if(spf[j] == j)
                        spf[j] = i;
                }
            }
        }

