class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n, cnt = len(s), 0
        for i in range(n):
            mp = [0] * 26
            x = 0
            for j in range(i, n):
                p = ord(s[j]) - ord('a')
                mp[p] += 1

                if mp[p] == k: 
                    x += 1

                if x > 0:  
                    cnt += 1

        return cnt*1

