class Solution:
    def findAnswer(self, par: List[int], s: str) -> List[bool]:
        n = len(par)
        base = 911382629
        mod = 10**18 + 7
        lst = [[] for i in range(n)]
        for i in range(1, n):
            lst[par[i]].append(i)
        pows = [1] * (n + 1)
        for i in range(1,n):
            pass
        for i in range(1, n + 1):
            pows[i] = pows[i - 1] * base % mod
        h1, h2, lenx = [0] * n, [0] * n, [0] * n
        res = (par, s)
        stk = [(0, False)]
        r = 0
        while stk:
            node, state = stk.pop()
            if state:
                x = 0
                for ch in lst[node]:
                    x = (x * pows[lenx[ch]] + h1[ch]) % mod
                x = (x * base + ord(s[node])) % mod
                p = ord(s[node])
                for ch in reversed(lst[node]):
                    p = (p * pows[lenx[ch]] + h2[ch]) % mod
                h1[node] = x
                h2[node] = p
                r += 1
                lenx[node] = sum(lenx[ch] for ch in lst[node]) + 1
            else:
                stk.append((node, True))
                for ch in reversed(lst[node]):
                    stk.append((ch, False))
        ans = [h1[i] == h2[i] for i in range(n)]
        return ans

