class Solution {
public:
#define pll pair<ll,ll>
#define ll long long
#define fs first
#define sc second
    const pll p = {29,31};
    const ll mod = 998244353;
    ll mad(ll a,ll b){
        a += b;
        return a>=mod?a-mod:a;
    }
    pll add(pll a,pll b){
        return pll(mad(a.fs,b.fs),mad(a.sc,b.sc));
    }
    pll mul(pll a,pll b){
        return pll(a.fs*b.fs%mod,a.sc*b.sc%mod);
    }
    vector<vector<int>> T;
    string val;
    vector<pll> pw;
    vector<pll> dp,rdp;
    vector<bool> ans;
    vector<int> sz;

    void dfs(int now){
        sz[now] = 1;
        sort(T[now].begin(),T[now].end());
        for(auto nxt:T[now]){
            dfs(nxt);
            sz[now] += sz[nxt];
        }
        int pref = 0;
        for(auto nxt:T[now]){
            dp[now] = add(dp[now],mul(pw[pref],dp[nxt]));
            pref += sz[nxt];
        }
        dp[now] = add(dp[now],mul(pw[pref],pll(val[now]-'a'+1,val[now]-'a'+1)));
        pref = 1;
        rdp[now] = add(rdp[now],pll(val[now]-'a'+1,val[now]-'a'+1));
        for(auto it = T[now].rbegin();it != T[now].rend();it++){
            int nxt = *it;
            rdp[now] = add(rdp[now],mul(pw[pref],rdp[nxt]));
            pref += sz[nxt];
        }
        if(dp[now].fs == rdp[now].fs&&dp[now].sc == rdp[now].sc)ans[now] = true;
        return;
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        val = s;
        int N = parent.size();
        pw = vector<pll>(N+1,pll(1,1));
        pw[1] = pll(p.fs,p.sc);
        dp = rdp = vector<pll>(N,pll(0,0));
        for(int i = 2;i<pw.size();i++)pw[i] = mul(pw[i-1],pw[1]);
        T = vector<vector<int>>(N);
        for(int i = 1;i<N;i++){
            T[parent[i]].push_back(i);
        }
        sz = vector<int>(N,1);
        ans = vector<bool>(N,0);
        dfs(0);
        return ans;
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        int N = nums.size();
        vector<int> to(N,-1);
        for(int i = 0;i<N;i++){
            to[i] = nums[i];
            for(int j = 2;j*j<=nums[i];j++){
                if(nums[i]%j == 0){
                    to[i] = j;
                    break;
                }
            }
        }
        int mx = nums.back();
        int ans = 0;
        for(int i = N-2;i>=0;i--){
            if(to[i]>mx)return -1;
            if(nums[i]>mx)ans++,mx = to[i];
            else mx = nums[i];
        }
        return ans;
    }
};

