class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        int result = 0;
         for (int i = 0; i < n; ++i) {
            unordered_map<char, int> freqMap; 
            for (int j = i; j < n; ++j) {
                freqMap[s[j]]++; 
                bool valid = false;
                for (auto &entry : freqMap) {
                    if (entry.second >= k) {
                        valid = true;
                        break;
                    }
                }
                if (valid) {
                    result += 1;
                }
            }
        }

        return result;
    }
};

