        return ans

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans = 0, n = s.size();
        for(int i = 0; i < n; ++i)
        {
            vector<int> freq(26);
            int mx = 0;
            for(int j = i; j < n; ++j)
            {
                freq[s[j] - 'a']++;
                mx = max(mx, freq[s[j] - 'a']);
                if(mx >= k) ++ans;
            }
        }
        return ans;
    }
};

class Solution {
public:
