vector<int> tour, size_;

void dfs(vector<int> adj[], int cur)
{
    tour.push_back(cur);
    size_[cur]++;

    for(int nb : adj[cur])
    {
        dfs(adj, nb);
        size_[cur] += size_[nb];
    }
}

// https://github.com/ShahjalalShohag/code-library/blob/main/Strings/Manachers.cpp
struct Manacher {
  vector<int> p[2];
  // p[1][i] = (max odd length palindrome centered at i) / 2 [floor division]
  // p[0][i] = same for even, it considers the right center
  // e.g. for s = "abbabba", p[1][3] = 3, p[0][2] = 2
  Manacher(string s) {
    int n = s.size();
    p[0].resize(n + 1);
    p[1].resize(n);
    for (int z = 0; z < 2; z++) {
      for (int i = 0, l = 0, r = 0; i < n; i++) {
        int t = r - i + !z;
        if (i < r) p[z][i] = min(t, p[z][l + t]);
        int L = i - p[z][i], R = i + p[z][i] - !z;
        while (L >= 1 && R + 1 < n && s[L - 1] == s[R + 1]) 
          p[z][i]++, L--, R++;
        if (R > r) l = L, r = R;
      }
    }
  }
  bool is_palindrome(int l, int r) {
    int mid = (l + r + 1) / 2, len = r - l + 1;
    return 2 * p[len % 2][mid] + len % 2 >= len;
  }
};

class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string str) {
        int n = str.size();
        tour.clear();
        tour.reserve(n);
        size_.clear();
        size_.resize(n);
        vector<int> adj[n];
        for(int i = 0; i < n; ++i)
        {
            int u = i, v = parent[i];
            if(v != -1) adj[v].push_back(u);
        }

        for(int i = 0; i < n; ++i)
        {
            sort(adj[i].begin(), adj[i].end());
            reverse(adj[i].begin(), adj[i].end());
        }

        dfs(adj, 0);


        string s = str;

        for(int i = 0; i < n; ++i)
        {
            s[i] = str[tour[i]];
        }


        vector<bool>ans(n);
        Manacher manacher(s);
        auto p = manacher.p;
        for(int i = 0; i < n; ++i)
        {
            int start = i;
            int end = i + size_[tour[i]] - 1;

            int len = end - start + 1;

            if(len % 2 == 0)
            {
                int c = ((start + end) / 2) + 1;
                ans[tour[i]] = 2 * p[0][c] >= len;
            }
            else
            {
                int c = ((start + end) / 2);
                ans[tour[i]] = (2 * p[1][c] + 1) >= len;
            }
        }

        return ans;
    }
};

const int N = 1e6 + 10;
int spf[N + 1], done = 0, dp[N][2];

void pre()
{
    if(done) return;

    for(int i = 1; i <= N; ++i)
        spf[i] = i;

    for(int i = 2; i <= N; ++i)
        if(spf[i] == i)
            for(int j = i; j <= N; j += i)
                spf[j] = min(spf[j], i);

    done = 1;
}

int solve(vector<int> &nums, int idx, bool changed, int prev)
{
    if(idx == nums.size()) return 0;

    int &ans = dp[idx][changed]; if(ans != -1) return ans;

    int ans1 = (nums[idx] >= prev) ? solve(nums, idx + 1, false, nums[idx]) : N;
    int ans2 = (spf[nums[idx]] >= prev) ? 1 + solve(nums, idx + 1, true, spf[nums[idx]]) : N;

    return ans = min(ans1, ans2);
}

class Solution {
public:
    int minOperations(vector<int>& nums) {
        pre();
        int n = nums.size();
        for(int i = 0; i < n; ++i) dp[i][0] = dp[i][1] = -1;
        int ans = solve(nums, 0, false, -1);
        if(ans > n) ans = -1;
        return ans;
    }
};

