struct Sieve {
    vi isp, primes, fdiv;
    vvi divisors;
    int n = -1;
    void init(int _n=maxn){
        n = _n;
        primes.clear();
        isp.assign(n, 1);
        fdiv.assign(n, 0);
        fdiv[0]=fdiv[1]=1;
        isp[0]=isp[1]=0;
        for(int i=2; i<n; ++i){
            if(!isp[i]) continue;
            fdiv[i] = i;
            primes.push_back(i);
            for(int j=i+i; j<n; j+=i) {
                isp[j] = 0;
                if(fdiv[j]==0)
                    fdiv[j] = i;
            }
        }
        fornn(x, 1, 10) debug2(x, fdiv[x]);
    }
    void computeDivs(){
        divisors.resize(n);
        fornn(i, 2, n) for(int j=i; j<n; j+=i) divisors[j].pb(i);
    }

    vi getFactorList(ll val){ // 12 = [2,2,3]
        vi ans;
        if(val < n){ // use cache
            auto x = val;
            while(x > 1){
                auto p = fdiv[x];
                ans.pb(p);
                x /= p;
            }
        } else {
            assert(val <= sqr(n - 1LL));
            auto x = val;
            for(int p: primes){
                if(p > x or p*1LL*p > val) break;
                while(x % p == 0){
                    ans.pb(p);
                    x /= p;
                }
            }
            assert(x <= numeric_limits<int>::max());
            if(x > 1) ans.pb(int(x));
        }
        return ans;
    }
    map<int,int> getFactorMap(ll val){ // 12 = [2:2, 3:1]
        map<int,int> ans;
        if(val < n){ // use cache
            auto x = val;
            while(x > 1){
                auto p = fdiv[x];
                ans[p]++;
                x /= p;
            }
        } else {
            if(!(val <= sqr(n - 1LL))) debug2(val, n);
            // else assert(val <= sqr(n - 1LL));
            auto x = val;
            for(int p: primes){
                if(p > x or p*1LL*p > val) break;
                while(x % p == 0){
                    ans[p]++;
                    x /= p;
                }
            }
            assert(x <= numeric_limits<int>::max());
            if(x > 1) ans[(int)x]++;
        }
        return ans;
    }
    void f(vpii& divs, vll &ans, int i, ll val){
        // if(val > hi) return;
        if(i < 0) {
            ans.pb(val); return;
        }
        ll cur = 1;
        f(divs, ans, i-1, val);
        auto [x, c] = divs[i];
        forn(j, c){
            cur *= x;
            f(divs, ans, i-1, val*cur);
        }
    }

    vll getAllDivs(ll x, map<int, int> factorMap = {}){ // 12 = [1 2 3 4 6 12]
        if(factorMap.empty()) factorMap = getFactorMap(x);
        else {
            ll cur = 1; for(auto [k, v]: factorMap) forn(i, v) cur *= k;
            assert(cur == x);
        }
        vpii divs; for(auto [k,v]: factorMap) divs.eb(k, v);
        vll ans; f(divs, ans, sz(factorMap)-1, 1);
        return ans;
    }
    ll getNumDivs(map<int, int>& divs){ // 12 = [2:2, 3:1] = 3 * 2
        ll ans = 1;
        for(auto [k, v]: divs) ans *= (v+1);
        return ans;
    }
    int getSquareDiv(int x){ // largest d: d*d | x;
        int val = 1;
        for(auto p: primes){
            if(p*p*p > x) break;
            int t = 0;
            while(x%p == 0){
                x /= p;
                t++;
                if(t%2 == 0) val *= p;
            }
        }
        int root = sqrt(x); if(x>1 and root*root == x) val *= root;
        return val;
    }
} sieve;


class Solution {
public:
    int minOperations(vector<int>& a) {

        if(sieve.fdiv.empty()) sieve.init();
        int n = sz(a), ans = 0;
        debug2(n, a);
        forb(i, n-1){
            int &x = a[i], y = a[i+1];
            while(x > y) {
                int d = sieve.fdiv[x];
                if(d == x) return -1;
                x = d;
                ans++;
            }
        }
        return ans;
    }
};

