class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = int(size(s));
        s = '.' + s;
        vector<vector<int>> p(26, vector<int>(n+1));
        for(int i = 1; i <= n; i++) {
            for(int j = 0; j < 26; j++) p[j][i] = p[j][i-1];
            p[s[i]-'a'][i]++;
        }

        auto f = [](int l, int r, vector<int> &v) {
            return v[r] - v[l-1];
        };

        int ret = 0;
        for(int i = 1; i <= n; i++) {
            for(int j = i; j <= n; j++) {
                int add = 0;
                for(int c = 0; c < 26; c++) {
                    if(f(i,j,p[c])>=k) {
                        add = 1;
                        break;
                    }
                }
                ret += add;
            }
        }

        return ret;
    }
};

