        for(int i = 0; auto &p: parent) {
            if(!i) {
                i++;
                continue;
            }
            adj[p].eb(i++);
        }
        string pat;
        int dfn = 0;
        function<void(int)> dfs = [&](int cur) {
            l[cur] = dfn;
            for(auto &nxt: adj[cur]) {
                dfs(nxt);
            }
            pat += s[cur];
            r[cur] = dfn++;
        };
        dfs(0);

        Hashing<27> h(pat);
        reverse(all(pat));
        Hashing<27> rh(pat);

        vector<bool> ret(n);
        for(int i = 0; i < n; i++) {
            ret[i] = (h.get(l[i], r[i]) == rh.get(n-1-r[i], n-1-l[i]));
        }

        return ret;
    }
};

