const int N = 1e6 + 10;

int sieve[N];

void pre() {
    for(int i = 0; i < N; i++) sieve[i] = i;

    for(long long i = 2; i < N; i++) {
        for(long long j = i + i; j < N; j += i) sieve[j] = i;
    }
}

class Solution {
public:
    int minOperations(vector<int>& nums) {
        if(!flag) pre(), flag = 1;

        int n = nums.size(), nxt = nums.back(), ans = 0;

        for(int i = n - 1; i >= 0; i--) {
            while(nums[i] > nxt) {
                int d = sieve[nums[i]];
                if(d == nums[i]) break;
                nums[i] /= d, ans++;
            }
            if(nums[i] > nxt) {
                ans = -1;
                break;
            }
            nxt = nums[i];
        }
        return ans;
    }
};

class Solution {
public:
  int numberOfSubstrings(string s, int k) {
    static constexpr int CHARSET = 26;
    vector<vector<int>> idx(CHARSET);
    vector<int> kth(CHARSET, -1);
    int ret = 0;
    for (int i = 0; i < (int)s.size(); ++i) {
      int ii = s[i] - 'a';
      idx[ii].push_back(i);
      kth[ii] = idx[ii].size();
      int first = -1;
      for (int j = 0; j < CHARSET; ++j) {
        if (kth[j] >= k) {
          first = max(first, idx[j][kth[j] - k]);
        }
      }
      ret += first + 1;
    }
    return ret;
  }
};

