        vector<int> cnt(26, 0);

        int hi = 0, ret = 0;
        for(int i = 0; i < n; i++) {
            while(hi < n && !check(cnt, k)) {
                cnt[s[hi] - 'a']++;
                hi++;
            }
            if(check(cnt, k))
                ret += n - hi + 1;

            cnt[s[i] - 'a']--;
        }
        return ret;
    }

