class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();
        vector<vector<int>> dp(n, vector<int>(2, 1e9));

        vector<int> alt = nums;
        for(int i = 0; i < n; i++) {
            for(int j = 2; j * j <= nums[i]; j++) {
                if(nums[i] % j == 0) {
                    alt[i] = j;
                    break;
                }
            }
        }

        // for(int i : alt)
        //     cout << i << endl;

        dp[n - 1][0] = dp[n - 1][1] = 0;

        for(int i = n - 2; i >= 0; i--) {
            if(nums[i] <= nums[i + 1]) {
                dp[i][0] = min(dp[i][0], dp[i + 1][0]);
            }
            if(nums[i] <= alt[i + 1]) {
                dp[i][0] = min(dp[i][0], dp[i + 1][1]);
            }

            if(alt[i] <= nums[i + 1]) {
                dp[i][1] = min(dp[i][0], dp[i + 1][0] + 1);
            }
            if(alt[i] <= alt[i + 1]) {
                dp[i][1] = min(dp[i][0], dp[i + 1][1] + 1);
            }
        }

        int ret = min(dp[0][0], dp[0][1]);
        if(ret == 1e9)
            return -1;
        return ret;
    }
};

