    // }
    intervals.resize(n);
    int time = 0;
    DFSFindInterval(0, time);
    Hash hash1(s);
    reverse(s.begin(), s.end());
    Hash hash2(s);
    vector<bool> ret(n);
    for (int i = 0; i < n; ++i) {
      int l1 = intervals[i].first;
      int r1 = intervals[i].second;
      auto h1 = hash1.GetSubstringHash(l1, r1);
      int l2 = n - 1 - r1;
