using i64 = long long;
using u64 = unsigned long long;

constexpr int M = 1E5 + 5;

u64 base = 131LL;
u64 multi[M];
void init() {
    multi[0] = 1;
    for (int i = 0; i < M - 1; i++){
        multi[i + 1] = multi[i] * base;
    }
}




class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        if (multi[0] == 0) init();
        int n = parent.size();
        vector<vector<int>> child(n);
        for (int i = 1; i < n; i++){
            child[parent[i]].push_back(i);
        }
        vector<int> siz(n, 0);
        vector<bool> res(n, 0);

        auto dfs = [&](auto self, int u) -> pair<u64,u64>{

            pair<u64,u64> val{0, 0};
            siz[u] = 0;
            for (auto &v : child[u]){
                auto son = self(self, v);

                val.first = combineLeft(val.first, siz[u], son.first, siz[v]);
                val.second = combineRight(val.second, siz[u], son.second, siz[v]);      
                siz[u] += siz[v];
            }
            //if (u == 1){

            //}
            val.first = val.first * base + (s[u] - 'a' + 1);
            val.second += (s[u] - 'a' + 1) * multi[siz[u]];
            //cout << u <<" "<< val.first <<" "<< val.second << "\n";
            if (val.first == val.second) res[u] = 1;
            siz[u]++;
            return val;
        };
        dfs(dfs, 0);
        return res;


    }

    u64 combineLeft(u64 l, int len_l, u64 r, int len_r){
        u64 a =  l * multi[len_r] + r;
        return a;
    }
    u64 combineRight(u64 l, int len_l, u64 r, int len_r){
        u64 a =  r * multi[len_l] + l;
        return a;
    }
};

std::vector<int> minp, primes;

void sieve(int n) {
    minp.assign(n + 1, 0);
    primes.clear();

    for (int i = 2; i <= n; i++) {
        if (minp[i] == 0) {
            minp[i] = i;
            primes.push_back(i);
        }

        for (auto p : primes) {
            if (i * p > n) {
                break;
            }
            minp[i * p] = p;
            if (p == minp[i]) {
                break;
            }
        }
    }
    minp[1] = 1;
}

class Solution {
public:
    int minOperations(vector<int>& nums) {
        if (primes.empty()) sieve(1E6 + 5);
        int n = nums.size();
        int mx = nums[n - 1];
        int res = 0;
        for (int i = n - 2; i >= 0; i--){
            while(nums[i] > mx){
                if (minp[nums[i]] == nums[i]) return -1;
                res++;
                nums[i] = minp[nums[i]];
            }
            mx = min(mx, nums[i]);
        }
        return res;
    }
};

