typedef long long ll;

class Solution
{
public:
    vector<int> temp;
    vector<bool> ans;
    const int mod = 1000000007;
    int base;
    vector<ll> pw;

    void dfs(int x, vector<vector<int>> &adj, string &s, vector<ll> &h, vector<ll> &rev, vector<int> &sz)
    {
        h[x] = 0;
        rev[x] = 0;
        sz[x] = 0;
        for (auto y : adj[x])
        {
            dfs(y, adj, s, h, rev, sz);
            h[x] = (h[x] * pw[sz[y]] + h[y]) % mod; // same order
            rev[x] = (rev[y] * pw[sz[x]] + rev[x]) % mod;
            sz[x] += sz[y];
        }
        h[x] = (h[x] * base + s[x]) % mod;
        rev[x] = (rev[x] + s[x] * pw[sz[x]]) % mod;
        sz[x] += 1;
        ans[x] = (h[x] == rev[x]);
    }

    vector<bool> findAnswer(vector<int> &parent, string s)
    {
        vector<int>vv={101,113,157,282,53,167};
        int x=rand()%6;
        base=vv[x];
        // cout<<base<<endl;
        int n = parent.size();
        vector<vector<int>> adj(n, vector<int>());
        for (int i = 1; i < n; i++)
            adj[parent[i]].push_back(i);
        for (int i = 0; i < n; i++)
            sort(adj[i].begin(), adj[i].end());

        temp = parent;
        pw.resize(n + 1, 1);
        for (int i = 1; i <= n; i++)
            pw[i] = (pw[i - 1] * base) % mod;

        ans.assign(n, false);
        vector<ll> h(n, 0), rev(n, 0);
        vector<int> sz(n, 0);
        dfs(0, adj, s, h, rev, sz);
        return ans;
    }
};

