        int n = s.size(), res = 0;
        int count[128] = {0}, cur = 0;

        for (int i = 0, j = 0; i < n; ++i) {

            while (j < n && cur == 0) {
                if (++count[s[j]] == k) ++cur;
                ++j;
            }

            if (cur) {
                res += (n - j + 1);
            }
            // cout<<i<<" "<<j<<" "<<cur<<endl;

            if (count[s[i]]-- == k) --cur;
        }

        return res;
    }
