class Solution {
    vector<vector<int>> next;
    vector<bool> res;
    vector<int> count;
    std::vector<int> dp;
    string temp;
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        next.resize(n);
        res.resize(n);
        count.resize(n);

        for (int i = 1; i < parent.size(); ++i) {
            next[parent[i]].push_back(i);
        }

        for (auto& nex : next) {
            sort(nex.begin(), nex.end());
        }
        traverse1(0, s);
        manacher(temp);
        traverse2(0, 0, n -1);

        return res;
    }

    int traverse1(int cur, string& s) {
        int ans = 1;
        for (int x : next[cur]) {
            ans += traverse1(x, s);
        }
        count[cur] = ans;
        temp.push_back(s[cur]);
        return ans;
    }

    void traverse2(int cur, int l, int r) {
        res[cur] = isP(l, r);
        for (int x : next[cur]) {
            traverse2(x, l, l + count[x] - 1);
            l += count[x];
        }
    }

    void manacher(std::string& s) {
        int len = s.size();
        int N = 2 * len + 1;
        int C = 1;
        int R = 1;
        int maxLen = 1;
        int maxI = 0;
        dp.resize(N);
        for(int i = 1; i < N; i++) {
          int mirrorI = C - (i-C);
          int delta = R - i;
          if(delta>0) {
            dp[i] = std::min(dp[mirrorI], delta);
          }
          while(( i + dp[i] < N - 1) &&
                ( i - dp[i] > 0) &&
                ( ((i + dp[i] + 1) % 2 == 0) ||
                (s[(i+dp[i]+1)/2] == s[(i-dp[i]-1) / 2]))) {
            dp[i]++;
          }
          if(dp[i] > maxLen) {
             maxLen = dp[i];
             maxI = i;
          }
          if(i + dp[i] > R) {
            C = i;
            R = i + dp[i];
          }
        }
    }

    bool isP(int l, int r) {
        l = (l * 2) + 1;
        r = (r * 2) + 1;
        int mid = ((l + r) >> 1);
        int diff = mid - l + 1;
        return dp[mid] >= diff;
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        int res = 0;    

        for (int i = nums.size() - 2; i >= 0; --i) {
            if (nums[i] > nums[i + 1]) {
                ++res;
                int temp = min((int)sqrt(nums[i]), nums[i + 1]);

                for (int j = 2; j <= temp; ++j) {
                    if ((nums[i] % j) == 0) {
                        nums[i] = j;
                        break;
                    }
                }
            }

            if (nums[i] > nums[i + 1]) {
                return -1;
            }
        }

        return res;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans = 0, n = s.size();
        for (int i = 0; i < n; ++i) {
            int j = i;
            bool mark = false;
            map<char, int> cnt;
            while(j >= 0 && !mark) {
                int& v = cnt[s[j]];
                v++;
                if (v >= k) {
                    mark = true;
                    break;
                }                    
                j--;
            }
            if (mark)
                ans += j + 1;
        }
        return ans;
    }
};

