        // }

        for(int ind=0;ind<g[u].size();ind++){
            if(g[u][ind]==p) continue;
            int it=g[u][ind];
            int nx=-1;
            int ind1=ind+1;
            while(ind1<g[u].size()){
                if(g[u][ind1]!=p){
                    nx=g[u][ind1];
                    break;
                }
                ind1++;
            }

            if(nx==-1) dfs2(it,u,sh1,sh2,index,ans,index[it],j);
            else dfs2(it,u,sh1,sh2,index,ans,index[it],index[nx]-1);
        }
    }
