        reverse(all(s2));
        StringHash sh1(s1);
        StringHash sh2(s2);
        // cout<<s2<<endl;

        vector<bool>ans(n,0);

        dfs2(0,-1,sh1,sh2,index,ans,0,n-1);
        return ans;
    }
};

