        int n=s.size(),re=0;
        for(int i=0;i<n;i++){
            array<int,26> cnt{};
            int j=i;
            while(j<n){
                int id=s[j]-'a';
                cnt[id]++;
                if(cnt[id]==k){
                    re+=n-j;
                    break;
                }
                j++;
            }
        }
        return re;
    }
};

