class StrHash:
    def __init__(self, n: int, base=13331, mod=634777849558332619) -> None:
        pw = [1] * (n+1)
        for i in range(1, n+1):
            pw[i] = pw[i-1] * base % mod
        self.n, self.b, self.M, self.pw = n, base, mod, pw
        self.table = []

    def hash(self, s: str) -> None:     
        m = len(s)                      
        f = [0] * (m+1)
        for i in range(m-1, -1, -1):
            f[i] = (f[i+1] * self.b + ord(s[i])) % self.M
        self.table.append(f)

    def get(self, i: int, l: int, r: int) -> int:  
        if l > r: return 0   
        f = self.table[i]
        return (f[l] - f[r+1] * self.pw[r+1-l]) % self.M


class Solution:
    def findAnswer(self, parent: List[int], s: str) -> List[bool]:
        n = len(parent)
        G = [[] for _ in range(n)]
        for i, p in enumerate(parent):
            if p != -1:
                G[p].append(i)
        for i in range(n):
            G[i].sort()

        l = [1] * n
        dfsstr = []
        def dfs(i):
            for j in G[i]:
                dfs(j)
                l[i] += l[j]
            dfsstr.append(s[i])
        dfs(0)

        t = ''.join(dfsstr)
        sh = StrHash(n)
        sh.hash(t)
        sh.hash(t[::-1])

        ans = [False] * n
        def dfs2(i, a, b):
            if l[i] == 1:
                ans[i] = True
                return
            if sh.get(0, a, b) == sh.get(1, n-1-b, n-1-a):
                ans[i] = True
            x = a
            for j in G[i]:
                dfs2(j, x, x+l[j]-1)
                x += l[j]

        dfs2(0, 0, n-1)
        return ans

