class Solution:
    def minOperations(self, nums: List[int]) -> int:
        n = len(nums)
        @cache
        def g(i, prev):
            if i == n:
                return 0
            if prev > nums[i]:
                return math.inf
            ans = g(i+1, nums[i])
            if f[nums[i]] != 1 and prev <= f[nums[i]]:
                ans = min(ans, g(i+1, f[nums[i]]) + 1)
            return ans

        ans = g(0, 0)
        g.cache_clear()
        return ans if ans < math.inf else -1

