        leng = len(nums)
        res = 0

        for i in range(leng - 2, -1, -1):

            cur = nums[i]
            nxt = nums[i + 1]
            if cur <= nxt:
                continue

            if cur in p or nxt == 1:
                return -1

            while cur > nxt and cur not in p:
                upp = int(sqrt(cur))
                for div in range(2, upp + 1):
                    if cur % div == 0:
                        res += 1
                        cur = div
                        break

            if cur <= nxt:
                nums[i] = cur
            else:
                return -1

        return res

