class Solution {
public:

    static const ll MOD1 = 998244353;
    static const ll MOD2 = 1000000009;
    static const ll B = 997; 

    struct Hash {
        ll h1, h2, sz;

        Hash() {
            h1 = h2 = sz = 0;
        }

        Hash(ll num) {
            h1 = (num) % MOD1;
            h2 = (num) % MOD2;
            sz = 1;
        }

        void mul(ll a, ll b) {
            h1 = (h1 * (a%MOD1)) % MOD1;
            h2 = (h2 * (b%MOD2)) % MOD2;
        }

        void add(ll a, ll b) {
            h1 = (h1 + (a%MOD1)) % MOD1;
            h2 = (h2 + (b%MOD2)) % MOD2;
        }

        bool eq(Hash o) {
            return h1 == o.h1 && h2 == o.h2 && sz == o.sz;
        }
    };

    vl p1, p2;
    Hash append(Hash h1, Hash h2) {
        h1.mul(p1[h2.sz], p2[h2.sz]);
        h1.add(h2.h1, h2.h2);
        h1.sz += h2.sz;
        return h1;
    }


    vb proc1, proc2;
    vector<Hash> dp1, dp2;


    vector<vector<int>> children;
    string t;

    Hash dfs(ll x) {
        if (proc1[x]) {
            return dp1[x]; 
        }

        Hash ans;
        for (int i = 0;i<children[x].size();i++) {
            ll y = children[x][i];
            ans = append(ans, dfs(y));
        }
        ans = append(ans, Hash(t[x]));

        proc1[x]=true;
        return dp1[x] = ans;
    }

    Hash dfsRev(ll x) {
        if (proc2[x]) {
            return dp2[x];
        }
        Hash ans(t[x]);

        for (int i = ll(children[x].size())-1;i>=0;i--) {
            ll y = children[x][i];
            ans = append(ans, dfsRev(y));
        }

        proc2[x] = true;
        return dp2[x] = ans;
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        t = s;
        p1 = p2 = {1};
        ll n = s.size();

        children = vector<vector<int>>(n+1);
        proc1 = proc2 = vb(n+1);
        dp1 = dp2 = vector<Hash>(n+1);

        for (int i = 1;i<n;i++) {
            children[parent[i]].pb(i);
        }

        for (int i = 0;i<n;i++) {
            sort(children[i].begin(), children[i].end());
        }

        for (int i = 0;i<n+2;i++) {
            p1.pb((p1.back() * B) % MOD1);
            p2.pb((p2.back() * B) % MOD2);
        }

        vector<bool> ans(n);
        for (int i =0;i<n;i++) {
            ans[i] = dfs(i).eq(dfsRev(i));
        }

        // deb(dfs(3).h1);
        return ans;
    }
};

