class Solution {
public:
    int minOperations(vector<int>& nums) {
        ll inf = 1e9;
        ll n = nums.size();

        ll mx = *max_element(all(nums))+1;

        vector<ll> lp(mx+2);
        for (ll i = 2;i<=mx;i++) {
            if (lp[i] == 0) for (ll j = i*2;j<=mx;j+=i) {
                if (lp[j]==0)lp[j] = i;
                lp[j] = min(lp[j],i);
            }
        }


        vector<vector<ll>> dp(2, vl(n,inf));

        dp[0][0] = 0;
        dp[1][0] = 1;

        // 0 normal, 1 applied

        for (int i = 1;i<n;i++) {

            // normal
            if (nums[i-1]<=nums[i]) {
                dp[0][i] = min(dp[0][i], dp[0][i-1]);
            }
            if (lp[nums[i-1]] != 0 && lp[nums[i-1]] <= nums[i]) {
                dp[0][i] = min(dp[0][i], dp[1][i-1]);
            }

            // applied
            if (lp[nums[i]] == 0) continue;

            if (nums[i-1] <= lp[nums[i]]) {
                dp[1][i] = min(dp[1][i], dp[0][i-1]+1);
            }
            if (lp[nums[i-1]] != 0 && lp[nums[i-1]] <= lp[nums[i]]) {
                dp[1][i] = min(dp[1][i], dp[1][i-1]+1);
            }
        }

        ll ans = min(dp[0].back(), dp[1].back());
        if (ans == inf) ans = -1;
        return ans;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        int ans = 0;
        for(int i = 0 ; i < n ; ++i){
            vector<int> cnt(26 , 0);
            int mx = 0;
            for(int j = i ; j < n ; ++j){
                cnt[s[j] - 'a']++;
                mx = max(cnt[s[j] - 'a'] , mx);
                if(mx >= k)ans++;
