#define ll long long
ll mod = 1e9 + 7;
class Solution {
public:
    ll power(ll a, ll b, ll p)
    {
    if(a==0)
    return 0;
    ll res=1;
    a%=p;
    while(b>0)
    {
        if(b&1)
        res=(res*a)%p;
        b>>=1;
        a=(a*a)%p;
    }
    return res;
    }
    ll getHash(vector<pair<ll,ll>> &v){
        ll base = 31 ;
        ll curLen = 0;
        ll hash = 0;
        for(auto i : v){
            hash = (hash + ((i.first * power(base , curLen , mod)) % mod)) % mod;
            curLen += i.second;
        }
        return hash;
    }
    pair<pair<ll,ll>,ll> dfs(int node , int par , vector<int> adj[] , vector<bool>& ans , string& s){
        vector<pair<ll,ll>> val;
        vector<pair<ll,ll>> valr;
        ll len = 0;
        for(auto child : adj[node]){
            if(child == par)continue;
            pair<pair<ll,ll> , ll> pr = dfs(child , node , adj , ans,s);
            val.push_back(pair<ll,ll>{pr.first.first , pr.second});
            valr.push_back(pair<ll,ll>{pr.first.second , pr.second});
            len += val.back().second;
        }
        val.push_back({s[node] - 'a' + 1 , 1});
        valr.push_back({s[node] - 'a' + 1 , 1});
        ll h1 = getHash(val);
        reverse(valr.begin() , valr.end());
        ll h2 = getHash(valr);
        // cout<<node<<" "<<h1<<" "<<h2<<"\n";
        ans[node] = (h1 == h2);
        return {{h1 , h2} , len + 1};
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<bool> ans(n);
        vector<int> adj[n];
        for(int i = 1 ; i < n ; ++i){
            adj[i].push_back(parent[i]);
            adj[parent[i]].push_back(i);
        }
        for(int i = 0 ; i < n ; ++i){
            sort(adj[i].begin() , adj[i].end());
        }
        dfs(0 , -1 , adj , ans , s);
        return ans;
    }
};

#define MAXN 1000006
bool done = false;
int spf[MAXN];

void sieve()
{
    spf[1] = 1;
    done = true;
    for (int i = 2; i < MAXN; i++)
        spf[i] = i;

    for (int i = 4; i < MAXN; i += 2)
        spf[i] = 2;

    for (int i = 3; i * i < MAXN; i++) {
        if (spf[i] == i) {
            for (int j = i * i; j < MAXN; j += i)
                if (spf[j] == j)
                    spf[j] = i;
        }
    }
}
class Solution {
public:
    int minOperations(vector<int>& nums) {
        if(!done)sieve();
        reverse(nums.begin() , nums.end());
        int smallest = MAXN;
        int tot = 0;
        for(auto &i : nums){
            // cout<<i<<" "<<spf[i]<<"\n";
            if(i > smallest){
                i = spf[i];
                ++tot;
            }
            if(i > smallest)return -1;
            smallest = i;
        }
        return tot;
    }
};

