        string cur;
        vector<string> res;
        dfs(target, 0, cur, res);
        return res;
    }

private:
    void dfs(string& t, int i, string& cur, vector<string>& res) {
        if (i == t.size()) return;
        if (cur.size() == i) {
            cur += 'a';
            res.push_back(cur);
            dfs(t, i, cur, res);
        }
        else if (t[i] != cur[i]) {
            cur[i]++;
            res.push_back(cur);
            dfs(t, i, cur, res);
        }
        else dfs(t, i + 1, cur, res);
    }
};

class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        vector<vector<int>> adj(s.size());
        int r = -1;
        for (int i = 0; i < parent.size(); i++) {
            int p = parent[i];
            if (p == -1) {
                r = i;
                continue;
            }
            adj[p].push_back(i);
        }
        int i = 2;
        vector<array<int, 2>> arr(s.size());
        int l = s.size();
        string t(2 * l + 3, '#');
        t[0] = '!';
        t.back() = '@';
        dfs(s, r, adj, arr, t, i);
        vector<int> dp(t.size());
        int c = 0;
        r = 0;
        for (i = 2; i < t.size(); i++) {
            int d = r > i ? min(r - i, dp[c * 2 - i]) : 0;
            int lo = i - d, hi = i + d;
            while (t[lo] == t[hi]) {
                lo--;
                hi++;
            }
            if (hi > r) {
                c = i;
                r = hi;
            }
            dp[i] = hi - i;
        }
        vector<bool> res;
        for (int i = 0; i < l; i++) {
            int lo = arr[i][0], hi = arr[i][1];
            int mid = (lo + hi) / 2;
            // cout << dp[mid] << endl;
            res.push_back(dp[mid] > mid - lo);
        }
        return res;
    }

private:
    void dfs(string& s, int v, vector<vector<int>>& adj, vector<array<int, 2>>& arr, string& t, int& i) {
        int lo = i;
        for (int w : adj[v]) {
            dfs(s, w, adj, arr, t, i);
        }
        t[i++] = s[v];
        arr[v] = {lo, i++};
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        arr.resize(1e6 + 1);
        int res = 0;
        for (int i = nums.size() - 2; i > -1; i--) {
            int p = nums[i + 1], n = nums[i];
            while (n > p) {
                int d = f(n);
                // cout << i << " " << p << " " << n  << " " << d<< endl;
                if (d == -1) return -1;
                res++;
                n = d;
            }
            nums[i] = n;
        }
        return res;
    }

private:
    vector<int> arr;

    int f(int n) {
        if (arr[n] != 0) return arr[n];
        for (int j = 2; j * j <= n; j++) {
            if (n % j == 0) {
                return arr[n] = j;
            }
        }
        return arr[n] = -1;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        vector<int> cnt(26, 0);
        int n = s.size(), i = 0;
        for(; i < n; i++) {
            cnt[s[i] - 'a']++;
            if(cnt[s[i] - 'a'] >= k) break;
        }
        int l = 0;
        auto check = [&]() -> bool {
            for(int x : cnt) {
                if(x >= k) return true;
            }
            return false;
        };
        int ans = 0;
        for(; i + 1 < n; i++) {
            while(check()) {
                cnt[s[l] - 'a']--;
                l++;
            }
            ans += l;
            cnt[s[i + 1] - 'a']++;
        }
        while(check()) {
            cnt[s[l] - 'a']--;
            l++;
        }
        ans += l;
        return ans;
    }
};

