class Solution {
public:
    vector<int> sz, inds;
    vector<vector<int> > G;

    void dfs(int cur, int& curind) {
        for(int x : G[cur]) {
            dfs(x, curind);
            sz[cur] += sz[x];
        }
        inds[cur] = curind++;
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        G.resize(n);
        sz.resize(n, 1);
        inds.resize(n, 0);
        for(int i = 1; i < n; i++) {
            G[parent[i]].push_back(i);
        }

        for(int i = 0; i < n; i++) {
            sort(G[i].begin(), G[i].end());
        }
        int ind = 0;
        dfs(0, ind);
        string res(n, 'a');
        for(int i = 0; i < n; i++) {
            res[inds[i]] = s[i];
        }

        const long long MOD = 1e9 + 7, p = 151583;
        vector<long long> preh(n), sufh(n), pw(n, 1);
        long long prehash = 0, sufhash = 0;
        for(int i = 0; i < n; i++) {
            if(i > 0)
                pw[i] = pw[i - 1] * p % MOD;

            prehash = (prehash + pw[i] * res[i]) % MOD;
            sufhash = (sufhash + pw[i] * res[n - 1 - i]) % MOD;

            preh[i] = prehash;
            sufh[n - 1 - i] = sufhash;
        }

        auto compare = [&] (int l, int r) -> bool {
            long long precalc = (preh[r] - (l > 0 ? preh[l - 1] : 0) + MOD) % MOD * pw[n - 1 - r] % MOD;
            long long sufcalc = (sufh[l] - (r < n - 1 ? sufh[r + 1] : 0) + MOD) % MOD * pw[l] % MOD;
            return precalc == sufcalc;
        };

        // cout << res << "\n";
        vector<bool> ans(n);
        for(int i = 0; i < n; i++) {
            int l = inds[i] - sz[i] + 1, r = inds[i];
            // cout << l << " " << r << "\n";
            ans[i] = compare(l, r);
        }



        return ans;
    }
};

