        if n % i == 0:
            return i
    return -1
class Solution:
    def minOperations(self, nums: List[int]) -> int:
        ans = 0
        dp = {1: 0}
        for x in nums:
            newdp = {}
            sx = sub(x)
            for x1, c in [(x, 0), (sx, 1)]:
                if x1 < 1:
                    continue
                for x2, val in dp.items():
                    if x2 >= 1:
                        if x1 >= x2:
                            oldv = newdp.get(x1, float('inf'))
                            newv = c + val
                            if newv < oldv:
                                newdp[x1] = newv
            dp = newdp                                
            #print(f'dp={dp}')
        if len(dp) == 0:
            return -1
        return min(dp.values())

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n=s.length(), res=0;
        for(int i=0; i<n; i++){
            vector<int> mp(26);
            for(int j=i; j<n; j++){
                mp[s[j]-'a']++;
                if(mp[s[j]-'a'] >= k){
                    res+=n-j;
                    break;
                }
            }   
        }
        return res;
    }
