class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        int cnt[26]{};
        int more = 0;
        int ans = 0;
        for(int l=0, r=0; r<n; r++) {
            more += ++cnt[s[r] - 'a'] == k;
            while(more) {
                more -= cnt[s[l++] - 'a']-- == k;
            }
            ans += l;
        }
        return ans;
    }
};

