class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<vector<int>> g(n);
        for(int i=1; i<n; i++)
            g[parent[i]].push_back(i);

        vector<pair<int,int>> span(n);

        string t = "";
        auto dfs = [&](auto&& dfs, int x) -> void {
            int st = t.size();
            for(auto y : g[x]) {
                dfs(dfs, y);
            }
            t += s[x];
            span[x] = {st, t.size() - st};
        };
        dfs(dfs, 0);

        string tt = "";
        int m = t.size();
        tt.reserve(2 * m + 1);
        tt += '#';
        for(int i = 0; i < m; i++) {
            tt += t[i];
            tt += '#';
        }

        vector<int> p(tt.size(), 0);
        int c = 0, r = 0;
        for(int i = 0; i < tt.size(); i++) {
            int mirror = 2 * c - i;
            if(i < r)
                p[i] = min(r - i, p[mirror]);
            int a = i + (1 + p[i]);
            int b = i - (1 + p[i]);
            while(a < tt.size() && b >= 0 && tt[a] == tt[b]) {
                p[i]++;
                a++;
                b--;
            }
            if(i + p[i] > r) {
                c = i;
                r = i + p[i];
            }
        }

        vector<bool> ans(n);
        for(int x = 0; x < n; x++) {
            auto [l, len] = span[x];
            int r = l + len - 1;

            l = 2 * l + 1;
            r = 2 * r + 1;

            int c = (l + r) / 2;
            int rad = r - c;

            ans[x] = p[c] >= rad;
        }

        return ans;
    }
};

