            if (nums[i] <= limit) {
                limit = nums[i];
                continue;
            }
            nums[i] = minp[nums[i]];
            if (nums[i] > limit) return -1;
            nums[i] = limit = minp[nums[i]];
            ops++;
        }
        return ops;
    }
};

