class Solution {
public:
    vector<bool> findAnswer(vector<int>& p, string s) {
        int n = s.size();
        vector<vector<int>> g(n);
        for (int i = 1; i < n; ++i) {
            g[p[i]].push_back(i);
        }
        vector<bool> sol(n,false);
        string dstr;
        vector<mint> dhash, drev;
        auto get = [&](int l, int r, bool rev = false) -> mint {
            if (r < l) return 0;
            assert(l >= 0 && l <= r && r < dhash.size() && r < drev.size());
            if (rev) {
                mint cur = drev[r];
                if (l == 0) return cur;
                cur -= drev[l-1]*prime.power(r-l+1);
                return cur;
            }
            mint cur = dhash[r];
            if (l == 0) return cur;
            cur -= dhash[l-1];
            cur/=prime.power(l);
            return cur;
        };
        auto dfs = [&](auto &&self, int u) -> int {
            mint cl = 0, cr = 0;
            int len = 0;
            int ind = dstr.size();
            for (int v : g[u]) {
                int vlen = self(self,v);
                len += vlen;
            }
            dstr.push_back(s[u]);
            if (dstr.size() == 1) {
                dhash.push_back(mint(s[u]-'a'));
                drev.push_back(mint(s[u]-'a'));
            } else {
                dhash.push_back(dhash.back() + mint(s[u]-'a')*prime.power(dhash.size()));
                drev.push_back((drev.back()*prime) + mint(s[u]-'a'));
            }
            len++;
            if (len%2) {
                int mid = len/2 + ind;
                cl = get(ind,mid-1);
                cr = get(mid+1,ind+len-1,true);
            }
            else {
                cl = get(ind,ind+len/2-1);
                cr = get(ind+len/2,ind+len-1,true);
            }
            // if (u == 0) {
            //     debug(len);
            //     debug(ind);
            //     debug(dhash);
            //     debug(drev);
            //     debug(dstr);
            //     debug(cl);
            //     debug(cr);
            // }
            sol[u] = (cl==cr);
            return len;
        };
        dfs(dfs,0);
        return sol;
    }
};

const int maxn = 1e6+5;
vector<int> spf(maxn,INT_MAX);
void init() {
    static bool init = false;
    if (init) return;
    init = true;
    for (int v = 4; v < maxn; v+=2)
        spf[v] = min(spf[v],2);
    for (int f = 3; f < maxn; ++f) {
        if (spf[f] != INT_MAX) continue;
        for (int v = 2*f; v < maxn; v += f)
            spf[v] = min(spf[v],f);
    }
}
class Solution {
public:
    int minOperations(vector<int>& vals) {
        if (is_sorted(vals.begin(),vals.end())) return 0;
        init();
        int n = vals.size();
        int sol = 0;
        for (int i = n-2; i >= 0; --i) {
            if (vals[i] > vals[i+1]) {
                if (spf[vals[i]] == INT_MAX) return -1;
                vals[i] = spf[vals[i]];
                if (vals[i] > vals[i+1]) return -1;
                sol++;
            }
        }
        return sol;
    }
};

void sliding_window(int start, int end, function<void(int)> add, function<void(int)> del, function<bool()> f, function<void(int, int)> callback) {
  for (int l = start, r = start; r != end; callback(l, r))
    for (add(r++); l != r && f(); del(l++));
}

class Solution {
public:
  int numberOfSubstrings(string s, int k) {
    int n = s.size();
    vector<int> cnt(26, 0);
    int ccnt = 0;
    auto add = [&](int i) {
      cnt[s[i] - 'a']++;
      if (cnt[s[i] - 'a'] == k) {
        ccnt++;
      }
    };
    auto del = [&](int i) {
      cnt[s[i] - 'a']--;
      if (cnt[s[i] - 'a'] == k - 1) {
        ccnt--;
      }
    };
    auto f = [&]() { return ccnt > 0; };
    int ans = 0;
    sliding_window(0, n, add, del, f, [&](int l, int r) { ans += l; });
    return ans;
  }
};

