class Solution {
public:
    vector<int> v[100010];
    string t;
    string ss;
    int in[100010], out[100010], cnt;
    // reference: https://cp-algorithms.com/string/manacher.html
    vector<int> f(string s) {
        int n = s.size();
        s = "$" + s + "^";
        vector<int> p(n + 2);
        int l = 1, r = 1;
        for(int i = 1; i <= n; i++) {
            p[i] = max(0, min(r - i, p[l + (r - i)]));
            while(s[i - p[i]] == s[i + p[i]]) {
                p[i]++;
            }
            if(i + p[i] > r) {
                l = i - p[i], r = i + p[i];
            }
        }
        return vector<int>(begin(p) + 1, end(p) - 1);
    }
    void dfs(int cur) {
        in[cur] = cnt;
        for(int nxt:v[cur]) dfs(nxt);
        out[cur] = cnt;
        t.push_back(ss[cur]);
        t.push_back('*');
        cnt+=2;
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<bool> ans(n);
        ss = s;
        for(int i=1;i<n;i++) {
            v[parent[i]].push_back(i);
        }
        dfs(0);
        vector<int> r = f(t);
        //cout << t << "\n";
        //for(int i=0;i<t.size();i++) cout << r[i] << " ";
        //cout << "\n";
        for(int i=0;i<n;i++) { //cout << in[i] << " " << out[i] << "\n"; {
            int m = (out[i] + in[i]) / 2;
            int R = out[i] - m;
            // cout << i << " " << r[m] << " " << R << "\n";
            ans[i] = r[m] > R;
        }

        return ans;
    }
};

