class Solution {

    int mod = 999983;
    int base = 130;

    boolean[] ans;
    Map<Integer, List<Integer>> map;
    int n;
    char[] s;
    int[] rc;

    public boolean[] findAnswer(int[] parent, String S) {
        n = parent.length;
        map = new HashMap<>();
        s = S.toCharArray();
        for (int i = 1; i < n; ++i) {
            map.computeIfAbsent(parent[i], x -> new ArrayList<>()).add(i);
        }
        ans = new boolean[n];
        rc = new int[n + 1];
        rc[0] = 1;
        for (int i = 1; i <= n; ++i) rc[i] = (rc[i - 1] * base) % mod;

        dfs(0);  

        return ans;
    }

    private long[] dfs(int u) {
        List<Integer> c = map.get(u);
        if (c == null) {
            ans[u] = true;
            return new long[]{s[u], s[u], 1};
        }

        Collections.sort(c);
        List<long[]> vals = new ArrayList<>();
        for (int v : c) {
            vals.add(dfs(v));
        }

        long val1 = 0, val2 = s[u];
        for (int i = 0; i < vals.size(); ++i) {
            int idx = (int) vals.get(i)[2];
            val1 = (val1 * rc[idx] % mod + vals.get(i)[0]) % mod;
        }
        val1 = (val1 * base + s[u]) % mod; 
        int tot = 1;
        for (int i = vals.size() - 1; i >= 0; --i) {
            int idx = (int) vals.get(i)[2];
            val2 = (val2 * rc[idx] % mod + vals.get(i)[1]) % mod;
            tot += idx;
        }
        // System.out.println(String.format("u = %d, val1 = %d, val2 = %d, tot = %d", u, val1, val2, tot));
        ans[u] = val1 == val2;
        return new long[]{val1, val2, tot};
    }
}

class Solution {
    public int minOperations(int[] nums) {
        Map<Integer, Integer> rc = new HashMap<>();
        int ans = 0;
        for (int i = nums.length - 2; i >= 0; --i) {
            if (nums[i] <= nums[i + 1]) continue;
            int d;
            if (rc.containsKey(nums[i])) {
                d = rc.get(nums[i]);
            } else {
                d = calc(nums[i]);
                rc.put(nums[i], d);
            }

            if (d == -1 || d > nums[i + 1]) return -1;
            ++ans;
            nums[i] = d;
        }
        return ans;
    }

    private int calc(int x) {
        for (int i = 2; i * i <= x; ++i) {
            if (x % i == 0) return i;
        }
        return -1;
    }
}

public class Solution {
    public int NumberOfSubstrings(string s, int k) {
        int[] counts = new int[26];
        int n = s.Length;
        int result = 0;
        for (int w = k; w <= n; w++)
        {
            int bigCount = 0;
            for (int i = 0; i < w; i++)
            {
                counts[s[i] - 'a']++;
                if (counts[s[i] - 'a'] == k)
                {
                    bigCount++;
                }
            }
            if (bigCount > 0)
            {
                result++;
            }
            for (int i = w; i < n; i++)
            {
                counts[s[i-w] - 'a']--;
                if (counts[s[i-w] - 'a'] == k-1)
                {
                    bigCount--;
                }
                counts[s[i] - 'a']++;
                if (counts[s[i] - 'a'] == k)
                {
                    bigCount++;
                }
                if (bigCount > 0)
                {
                    result++;
                }
            }
            for (int i = 0; i < 26; i++)
            {
                counts[i] = 0;
            }
        }
        return result;
    }
}

