class Solution {
public:
  vector<bool> findAnswer(vector<int> &par, string s) {
    const __uint128_t M = (1ULL << 61) - 1, P = 257;
    int n = par.size();
    vector g(n, vector<int>());
    for (int i = 1; i < n; i++) {
      g[par[i]].push_back(i);
    }
    for (int i = 0; i < n; i++) {
      ranges::sort(g[i]);
    }
    vector p(n + 1, uint64_t(1));
    for (int i = 1; i <= n; i++) {
      p[i] = __uint128_t(p[i - 1]) * P % M;
    }
    vector h(n, pair<int, __uint128_t>{1, 0});
    auto dfs = [&](auto &self, int u) -> void {
      __uint128_t pw = 1;
      for (int v : g[u]) {
        self(self, v);
        h[u].first += h[v].first;
        h[u].second += h[v].second * pw % M;
        h[u].second %= M;
        pw = pw * p[h[v].first] % M;
      }
      h[u].second += s[u] * pw % M;
      h[u].second %= M;
    };
    dfs(dfs, 0);
    vector h2(n, pair<int, __uint128_t>{1, 0});
    auto dfs2 = [&](auto &self, int u) -> void {
      h2[u].second = __uint128_t(s[u]) % M;
      __uint128_t pw = P;
      ranges::reverse(g[u]);
      for (int v : g[u]) {
        self(self, v);
        h2[u].first += h2[v].first;
        h2[u].second += h2[v].second * pw % M;
        h2[u].second %= M;
        pw = pw * p[h2[v].first] % M;
      }
    };
    dfs2(dfs2, 0);
    vector ans(n, false);
    for (int i = 0; i < n; i++) {
      ans[i] = h[i].second == h2[i].second;
    }
    return ans;
  }
};
