class Solution {
public:
  int numberOfSubstrings(string s, int k) {
    int n = (int)s.length();
    int res = 0;

    int tail = 0, head = -1;
    vector<int> freq(26, 0);
    while(tail < n) {
      while(head + 1 < n && *max_element(freq.begin(), freq.end()) < k && freq[s[head + 1] - 'a'] + 1 <= k) {
        head++;
        freq[s[head] - 'a']++;
      }

      if(*max_element(freq.begin(), freq.end()) == k) {
        res += (n - head);
        // cout << tail << "->" << head << endl;
      }

      if(tail > head) {
        tail++;
        head = tail - 1;
      } else {
        freq[s[tail] - 'a']--;
        tail++;
      }
    }
    return res;
  }
};

