int N = 1e6 + 10;
vector<int> isPrime(N);
vector<int> smallestDivisor(N);
bool done = false;

void sieve() {
  if(done) {
    return;
  }

  done = true;
  for(int i = 0; i < N; i++) {
    isPrime[i] = 1;
    smallestDivisor[i] = i;
  }
  isPrime[0] = isPrime[1] = 0;
  for(int i = 2; i < N; i++) {
    if(isPrime[i]) {
      for(int j = 2 * i; j < N; j += i) {
        isPrime[j] = 0;
        if(smallestDivisor[j] == j) {
          smallestDivisor[j] = i;
        }
      }
    }
  }
}

