    for(int i = n - 1; i >= 0; i--) {
      int curr = nums[i];
      if(curr > prev) {
        if(smallestDivisor[curr] != curr) {
          curr = smallestDivisor[curr];
        }

        if(curr > prev) {
          return -1;
        } else {
          res++;
        }
      }
      prev = curr;
    }
    return res;
  }
};

