class Solution {
    vector<set<int>>adj;
    vector<long long>fHash;
    vector<long long>bHash;
    vector<int>len;
    vector<long long>exps;
    vector<bool>ans;
    long long mod = 1e9+7;
    long long base = 31;
    string s;
    void precompute(int n){
        exps.resize(n+1,1);
        for (int i = 1; i <= n; i++){
            exps[i] = (exps[i - 1] * base) % mod;
        }
    }

    void dfs(int node){
        for(auto it:adj[node]){
            dfs(it);
        }
        long long currHash = 0;
        long long currLen = 0;
        for(auto it:adj[node]){
            currHash = currHash+(exps[currLen]*fHash[it])%mod;
            currHash%=mod;
            currLen = (currLen+len[it])%mod;
        }
        currHash = currHash+(exps[currLen]*(s[node]-'a'))%mod;
        currHash%=mod;
        currLen = (currLen+1)%mod;
        fHash[node] = currHash;
        len[node] = currLen;
        currLen = 1;
        currHash = s[node]-'a';

        for(auto it1 = adj[node].rbegin();it1!=adj[node].rend();it1++){
            int it = *it1;
            currHash = currHash+(exps[currLen]*bHash[it])%mod;
            currHash%=mod;
            currLen = (currLen+len[it])%mod;
        }
        bHash[node] = currHash;
        if(fHash[node]==bHash[node]) ans[node] = 1;
    }
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        this->s = s;
        int n = parent.size();
        adj.resize(n);
        fHash.resize(n,0);
        bHash.resize(n,0);
        len.resize(n,0);
        ans.resize(n,0);
        for(int i=1;i<n;i++){
            adj[parent[i]].insert(i);
        }
        precompute(n);
        dfs(0);
        return ans;
    }
};

