        for(long long i=2;(i*i)<=it;i++){
            if(it%i==0){
                mp[it] = i;
                break;
            }
        }
        if(mp.find(it)==mp.end()) mp[it] = it;
    }
    int cnt = 0;
    for (int i = n - 2; i >= 0; i--)
    {
        if (nums[i] > nums[i + 1])
        {
            if (nums[i] != mp[nums[i]])
            {
                nums[i] = mp[nums[i]];
                cnt++;
            }
        }
        if (nums[i] > nums[i + 1])
        {
            if (nums[i + 1] != mp[nums[i + 1]])
            {
                nums[i + 1] = mp[nums[i + 1]];
                cnt++;
            }
        }
