class Solution {
public:

    vector<int> manacher_odd(string &s) {
        int n = s.size();
        s = "$" + s + "^";
        vector<int> p(n + 2);
        int l = 1, r = 1;
        for(int i = 1; i <= n; i++) {
            p[i] = max(0, min(r - i, p[l + (r - i)]));
            while(s[i - p[i]] == s[i + p[i]]) {
                p[i]++;
            }
            if(i + p[i] > r) {
                l = i - p[i], r = i + p[i];
            }
        }
        return vector<int>(begin(p) + 1, end(p) - 1);
    }

    vector<int> manacher(string &s) {
        string t;
        for(auto c: s) {
            t += string("#") + c;
        }
        t.push_back('#');
        auto res = manacher_odd(t);
        return vector<int>(begin(res) + 1, end(res) - 1);
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n=parent.size();
        vector<set<int>> adj(n);
        for(int i=1; i<n; i++){
            adj[parent[i]].insert(i);
        }
        vector<int> sz(n);
        string res;
        function<void(int)> dfs1;
        dfs1 = [&](int u){
            sz[u] = 1;
            for(auto v : adj[u]){
                dfs1(v);
                sz[u] += sz[v];
            }
            res.push_back(s[u]);
        };
        dfs1(0);
        assert(res.size() == n);
        auto mana = manacher(res);
        auto isPali = [&](int l, int r){
            int m = l+r;
            return mana[m] >= r-l+1;
        };
        vector<bool> ans(n);
        function<void(int, int, int)> dfs2;
        dfs2 = [&](int u, int l, int r){
            ans[u] = isPali(l, r);
            for(auto v : adj[u]){
                dfs2(v, l, l+sz[v]-1);
                l += sz[v];
            }
        };
        dfs2(0,0,n-1);
        return ans;
    }
};

