class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n=s.size();
        vector<vector<int>> freq(n+1,vector<int>(26));
        for(int i=1;i<=n;i++)
        {
            freq[i]=freq[i-1];
            freq[i][s[i-1]-'a']++;
        }

        int out=0;
        for(int i=1;i<=n;i++)
        {
            int low=1;
            int high=i;
            int pt=0;
            while(low<=high)
            {
                int mid=(low+high)/2;

                bool ok=false;
                for(int j=0;j<26;j++)
                {
                    if(freq[i][j]-freq[mid-1][j]>=k)
                        ok=true;
                }

                if(ok)
                {
                    pt=mid;
                    low=mid+1;
                }
                else
                    high=mid-1;
            }
            out=out+pt;
        }
        return out;
    }
};

