constexpr long long MOD = 1e9 + 7;

struct RollingHash{
  long long p;
  vector<long long> hashes;
  vector<long long> pows;

  RollingHash(string &s, long long _p = 31) : p(_p) {
    long long n = s.size();
    pows = vector<long long>(n + 1);
    pows[0] = 1;
    for (int i = 1; i <= n; i++){
      pows[i] = mul(pows[i - 1], p);
    }

    hashes = vector<long long>(n + 1);
    for (int i = 1; i <= n; i++){
      hashes[i] = mod(mul(hashes[i - 1], p) + s[i - 1]);
    }
  }

  long long mul(long long a, long long b){
    return (a * b) % MOD;
  }

  long long mod(long long a){
    return ((a % MOD) + MOD) % MOD;
  }

  long long get_hash(int l, int r) {
    long long ha = hashes[r + 1] - mul(hashes[l], pows[r - l + 1]);
    return mod(ha);
  }

  long long get_hash(){
    return hashes.back();
  }
};

// constexpr long long MOD = 1e9 + 7;
long long pow_mod(long long a, long long b){
  long long ans = 1;
  while (b) {
    if (b & 1){
      ans = (ans * a) % MOD;
    }
    b >>= 1;
    a = (a * a) % MOD;
  }
  return ans;
}

struct RabinKarp {
  int P;
  vector<int> pref, inv_pows;
  RabinKarp(string &s, int p = 31) {
    P = p;
    int n = s.size();
    pref = vector<int>(n + 1);
    long long h = 0;
    long long pwr = 1;
    for (int i = 1; i <= n; i++){
      int x = s[i - 1] - 'a' + 1;
      h = (h + pwr * x) % MOD;
      pref[i] = h;
      pwr = (pwr * P) % MOD;
    }

    pwr = pow_mod(pwr, MOD - 2);
    inv_pows = vector<int>(n + 1);
    for (int i = n; i >= 0; i--){
      inv_pows[i] = pwr;
      pwr = (pwr * P) % MOD;
    }
  }

  int query(int l, int r) {
    return (((pref[r + 1] - pref[l] + MOD) % MOD) * inv_pows[l]) % MOD;
  }
};

