        int n = parent.size();
        vector<set<int>> adj(n);
        for (int i = 0; i < n; i++){
            int par = parent[i];
            if (par != -1){
                adj[par].insert(i);
            }
        }

        string p = "";
        vector<pair<int, int>> positions(n);

        function<int(int)> dfs = [&](int u) -> int {
            int mn = INT_MAX;
            for (auto &v : adj[u]) {
                mn = min(mn, dfs(v));
            }
            p += s[u];
            if (mn == INT_MAX){
                mn = p.size() - 1;
            }
            positions[u] = {mn, p.size() - 1};
            return mn;
        };

        dfs(0);
        // RollingHash fwd(p);
        RabinKarp fwd(p);
        reverse(p.begin(), p.end());
        // RollingHash bwd(p);
        RabinKarp bwd(p);
        vector<bool> res(n);
        for (int i = 0; i < n; i++){
            auto [l, r] = positions[i];
            // res[i] = fwd.get_hash(l, r) == bwd.get_hash(n - r - 1, n - l - 1);
            res[i] = fwd.query(l, r) == bwd.query(n - r - 1, n - l - 1);
        }
        return res;
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();
        int cnt = 0;
        for (int i = n - 2; i >= 0; i--){
            int nxt = nums[i + 1];
            int curr = nums[i];
            if (curr <= nxt){
                continue;
            }
            while (curr > nums[i + 1]) {
                bool found = false;
                for (long long f = 2; 1ll * f * f <= curr; f++){
                    if (curr % f == 0){
                        int mx = curr / f;
                        curr = curr / mx;
                        cnt++;
                        found = true;
                        break;
                    }
                }
                if (!found){
                    return -1;
                }
                nums[i] = curr;
            }
        }
        return cnt;
    }
};

