void sieve(int n) {
    sp[0] = sp[1] = 0;
    for (int i = 2; i < n; i++) {
        if (sp[i]) {
            lp[i] = i;
            for (int j = i * 2; j < n; j += i) {
                sp[j] = 0;
                if (lp[j] == 0) {
                    lp[j] = i;
                }
            }
        }
    }
}

