        if (lp[10] == 0) {
            sieve(M);
        }
    }

    int minOperations(vector<int>& n) {
        int r = 0, s = n.size();
        int p = n[s - 1];

        for (int i = s - 2; i >= 0; --i) {
            if (n[i] <= p) {
                p = n[i];
                continue;
            }

            while (lp[n[i]] > 1 && n[i] / lp[n[i]] > 1) {
                n[i] /= (n[i] / lp[n[i]]);
                r++;
                if (n[i] <= p) {
                    break;
                }
            }

            if (n[i] > p) {
                return -1;
            }

            p = n[i];
        }
        return r;
    }
};

