from collections import Counter
class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        end = 0
        c = Counter()
        c[s[0]] += 1
        ref = 0
        ans = 0
        if k == 1:
            ref += 1
        for start in range(len(s)):
            while end < len(s) and ref == 0:
                end += 1
                if end == len(s):
                    return ans
                c[s[end]] += 1
                if c[s[end]] == k:
                    ref += 1
            c[s[start]] -= 1
            if c[s[start]] == k-1:
                ref -= 1
            ans += len(s) - end
        return ans

class Solution:
    def stringSequence(self, target: str) -> List[str]:
        def trans(cur):
            if cur == target:
                return cur, True
            if target.startswith(cur):
                return cur + 'a', False
            if cur[-1] == 'z':
                return cur[:len(cur)-1] + 'a', False
            return cur[:(len(cur)-1)] + chr(ord(cur[-1])+1), False
        c, ok = '', False
        res = []
        while not ok:
            c, ok = trans(c)
            res.append(c)
        return res[:-1]

