class Solution:
    def findAnswer(self, parent: List[int], s: str) -> List[bool]:
        children = defaultdict(list)
        for i, j in enumerate(parent):
            if j == -1:
                continue
            children[j].append(i)
        for k in children.keys():
            children[k].sort()
        ans = [False] * len(s)
        if len(set(s)) == 1:
            return [True] * len(s)
        def dfs(node):
            nonlocal ans
            my_s = ''.join(dfs(c) for c in children[node])
            my_s += s[node]
            if my_s == my_s[::-1]:
                ans [node] = True
            return my_s
        dfs(0)
        return ans

