class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.length();

        ll total_str = ((ll)n * (n + 1)) / 2;

        int left = 0;
        ll tdi = 0;
        int counts[26] = {0};
        int least_k = 0;

        fr(right, n){
            char c = s[right];
            counts[c - 'a']++;

            if(counts[c - 'a'] == k){
                least_k++;
            }

            while(least_k > 0){
                char c_left = s[left];
                counts[c_left - 'a']--;

                if(counts[c_left - 'a'] == k - 1){
                    least_k--;
                }
                left++;
            }

            tdi += (right - left + 1);
        }

        ll ans = total_str - tdi;

        return ans;
    }
};

