class Solution {
public:
    int get_gpd(int x) {
        if (x == 1)
            return 1;
        for (int i = 2; i * i <= x; i++) {
            if (x % i == 0) {
                return x / i;
            }
        }
        return 1;
    }
    int minOperations(vector<int>& nums) {
        int ans = 0;
        for (int i = nums.size() - 2; i >= 0; i--) {
            while (nums[i] > nums[i + 1]) {
                int gpd = get_gpd(nums[i]);
                if (gpd == 1)
                    return -1;
                nums[i] /= gpd;
                ans++;
            }
            if (nums[i] > nums[i + 1])
                return -1;
        }
        return ans;
    }
};

