#define ll long long
#define all(x) x.begin(), x.end()
constexpr uint64_t mod = (1ULL << 61) - 1;
const int MAXLEN = 1e6 + 5;
const uint64_t seed = chrono::system_clock::now().time_since_epoch().count();
const uint64_t base = mt19937_64(seed)() % (mod / 3) + (mod / 3);

uint64_t base_pow[MAXLEN];

int64_t modmul(uint64_t a, uint64_t b){
    uint64_t l1 = (uint32_t)a, h1 = a >> 32, l2 = (uint32_t)b, h2 = b >> 32;
    uint64_t l = l1 * l2, m = l1 * h2 + l2 * h1, h = h1 * h2;
    uint64_t ret = (l & mod) + (l >> 61) + (h << 3) + (m >> 29) + (m << 35 >> 3) + 1;
    ret = (ret & mod) + (ret >> 61);
    ret = (ret & mod) + (ret >> 61);
    return ret - 1;
}

void init(){
    base_pow[0] = 1;
    for (int i = 1; i < MAXLEN; i++){
        base_pow[i] = modmul(base_pow[i - 1], base);
    }
}

uint64_t nxt_hash(uint64_t cur, char c){
	return (modmul(cur, base) + c + 997) % mod;
}
uint64_t total_hash(string& s){
	uint64_t cur = 0;
	for(int i = 0; i < s.length(); i++) cur = nxt_hash(cur, s[i]);
	return cur;
}
struct PolyHash{
    vector<int64_t> pref;
    int n;

    PolyHash(string& ar){
        if (!base_pow[0]) init();

        n = ar.size();
        assert(n < MAXLEN);
        pref.resize(n + 1, 0);

        for (int i = 1; i <= n; i++){
            pref[i] = modmul(pref[i - 1], base) + ar[i - 1] + 997;
            while (pref[i] >= mod) pref[i] -= mod;
        }
    }

    uint64_t get_hash(int l, int r){
        //cout<<l<<" "<<r<<" "<<n<<endl;
        int64_t h = pref[r + 1] - modmul(base_pow[r - l + 1], pref[l]);
        return h < 0 ? h + mod : h;
    }

    void extend(char c){
		pref.push_back(nxt_hash(pref.back(), c));
		n++;
	}
};
class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<bool> res(n);
        vector<vector<int>> nodeMap(n);
        for (int i = 1; i < n; i++){
            nodeMap[parent[i]].emplace_back(i);
        }
        string st;
        vector<ll> sz(n), index(n);
        auto dfs = [&] (auto&& self, int node) -> void{
            sz[node] = 1;
            for (int neighbor: nodeMap[node]){
                self(self,neighbor);
                sz[node]+=sz[neighbor];
            }
            st.push_back(s[node]);
            index[node] = st.size() - 1;
        };
        dfs(dfs,0);
        //cout<<st<<endl;
        PolyHash h1 (st);
        reverse(all(st));
        PolyHash h2(st);
        for (int i = 0; i < n; i++){
            int bef = index[i] - sz[i] + 1;
            uint64_t h = h1.get_hash(bef, index[i]);
            uint64_t hs = h2.get_hash(st.size() - 1 - index[i], st.size() - 1 - index[i] + sz[i] - 1);
            res[i] = h==hs;
        }
        return res;
    }
};

