func findAnswer(parent []int, s string) []bool {
    n := len(parent)
    t := make([][]int, n)
    for a := 0; a < n; a++ {
        t[a] = []int{}
    }
    for a := 1; a < n; a++ {
        p := parent[a]
        t[p] = append(t[p], a)
    }

    f := s
    d := make([]byte, 0, n)
    l := make([]int, n)
    r := make([]int, n)
    idx := 0

    var dfs func(int)
    dfs = func(a int) {
        l[a] = idx
        for _, b := range t[a] {
            dfs(b)
        }
        d = append(d, f[a])
        idx++
        r[a] = idx - 1
    }
    dfs(0)

    const mod = 1000000007
    const base = 911
    n = len(d)
    ph := make([]int64, n)
    rph := make([]int64, n)
    pb := make([]int64, n+1)
    pb[0] = 1
    for a := 1; a <= n; a++ {
        pb[a] = (pb[a-1] * base) % mod
    }
    for a := 0; a < n; a++ {
        c := int64(d[a])
        if a == 0 {
            ph[a] = c
        } else {
            ph[a] = (ph[a-1]*base + c) % mod
        }
    }

    dr := make([]byte, n)
    for a := 0; a < n; a++ {
        dr[a] = d[n-1-a]
    }
    for a := 0; a < n; a++ {
        c := int64(dr[a])
        if a == 0 {
            rph[a] = c
        } else {
            rph[a] = (rph[a-1]*base + c) % mod
        }
    }

    ans := make([]bool, n)
    for a := 0; a < n; a++ {
        la := l[a]
        ra := r[a]
        lth := ra - la + 1

        var h int64
        if la == 0 {
            h = ph[ra]
        } else {
            h = (ph[ra] - ph[la-1]*pb[lth]%mod + mod) % mod
        }

        revL := n - 1 - ra
        revR := n - 1 - la
        var rh int64
        if revL == 0 {
            rh = rph[revR]
        } else {
            rh = (rph[revR] - rph[revL-1]*pb[lth]%mod + mod) % mod
        }

        if h == rh {
            ans[a] = true
        } else {
            ans[a] = false
        }
    }
    return ans
}

func minOperations(nums []int) int {
    s := make(map[int]bool)
    for _, a := range nums {
        s[a] = true
    }

    p := getPrimesUpTo(1000)
    u := make([]int, 0, len(s))
    for a := range s {
        u = append(u, a)
    }
    spf := computeSPF(u, p)

    f := make([]int, len(nums))
    copy(f, nums)

    n := len(nums)
    t := 0
    nxt := nums[n-1]

    for a := n - 1; a >= 0; a-- {
        x := nums[a]
        o := []struct {
            v   int
            op int
        }{
            {x, 0},
        }

        if spf[x] != x {
            o = append(o, struct {
                v   int
                op int
            }{spf[x], 1})
        }

        found := false
        for _, opt := range o {
            if opt.v <= nxt {
                nxt = opt.v
                t += opt.op
                found = true
                break
            }
        }
        if !found {
            return -1
        }
    }
    return t
}

func getPrimesUpTo(a int) []int {
    p := make([]bool, a+1)
    for b := 2; b <= a; b++ {
        p[b] = true
    }
    for b := 2; b*b <= a; b++ {
        if p[b] {
            for c := b * b; c <= a; c += b {
                p[c] = false
            }
        }
    }
    pr := []int{}
    for b := 2; b <= a; b++ {
        if p[b] {
            pr = append(pr, b)
        }
    }
    return pr
}

func computeSPF(nums []int, p []int) map[int]int {
    spf := make(map[int]int)
    for _, a := range nums {
        if a <= 1 {
            spf[a] = a
            continue
        }
        for _, b := range p {
            if b*b > a {
                break
            }
            if a%b == 0 {
                spf[a] = b
                break
            }
        }
        if _, exists := spf[a]; !exists {
            spf[a] = a
        }
    }
    return spf
}

