class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        dic = defaultdict(int)
        k_count = 0
        left = 0
        res = 0
        n = len(s)
        for i in range(n):
            dic[s[i]] += 1
            if dic[s[i]] == k:
                k_count += 1
            if k_count > 0:
                while True:
                    if k_count == 1 and dic[s[left]] == k:
                        break
                    if dic[s[left]] == k:
                        k_count -= 1
                    dic[s[left]] -= 1
                    left += 1
                res += left + 1
        return res

