class Solution:
    def minOperations(self, nums: List[int]) -> int:
        res = 0
        last = float('inf')

        def get_max_divisor(x):
            for i in range(2, int(x ** 0.5) + 1):
                if x % i == 0:
                    return x // i

            return 1

        for num in nums[::-1]:        
            if num > last:
                while num > last:
                    v = get_max_divisor(num)
                    if v == 1:
                        return -1
                    num //= v
                    res += 1
                last = num
            else:
                last = num


        return res

