class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        vector<vector<int>> mp(n + 1, vector<int>(26, 0));
        for (int i = 1; i <= n; i++) {
            mp[i] = mp[i - 1];
            mp[i][s[i - 1] - 'a']++;
        }
        int ans = 0;
        for (int i = 0; i <= n - k; i++) {
            for (int j = i + k; j <= n; j++) {
                bool valid = false;
                for (int t = 0; t < 26; t++) {
                    if (mp[j][t] - mp[i][t] >= k) {
                        valid = true;
                        break;
                    }
                }
                if (valid)
                    ans++;
            }
        }
        return ans;
    }
};

