    int greatestDiv(int n) {
        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0)
                return i;
        }
        return 1;
    }
    int minOperations(vector<int>& a) {
        int n = a.size();
        int ans = 0;
        for (int i = n - 2; i >= 0; i--) {
            while (a[i] > a[i + 1]) {
                a[i] = greatestDiv(a[i]);
                if (a[i] == 1)
                    return -1;
                ans++;
            }
        }
        return ans;
    }
};

