const int MX = 1000000;
int gpd[MX + 1];
bool pre = false;

void calcGPD() {
    if (pre) return;
    fill(gpd, gpd + MX + 1, 1);
    for (int i = 2; i <= MX; ++i)
        for (int j = 2 * i; j <= MX; j += i)
            gpd[j] = i;
    pre = true;
}

class Solution {
public:
    int minOperations(vector<int>& nums) {
        calcGPD();
        int ops = 0, n = nums.size();
        for (int i = n - 2; i >= 0; --i) {
            while (nums[i] > nums[i + 1]) {
                int d = gpd[nums[i]];
                if (d == 1) return -1;
                nums[i] /= d;
                ops++;
                if (nums[i] <= 0) return -1;
            }
        }
        return ops;
    }
};

