class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        N = len(s)
        MAX = 26
        prefix = [[0] * MAX]
        for i in range(N):
            c = ord(s[i]) - ord('a')
            counts = prefix[-1][:]
            counts[c] += 1
            prefix.append(counts)

        def count_diff(a, b):
            return [prefix[b][i] - prefix[a][i] for i in range(MAX)]

        ret = 0
        for i in range(N):
            hi_diff = count_diff(i, N)
            if max(hi_diff) < k:
                break
            lo, hi = i, N
            while hi - lo > 1:
                mid = (lo + hi) // 2
                if max(count_diff(i, mid)) >= k:
                    hi = mid
                else:
                    lo = mid
            ret += N + 1 - hi

        return ret

