vector<vector<int>> G;
void go(int x) {

    for (int y : G[x]) go(y);
    int h1 = 0;
    int n = 0;
    for (int y : G[x]) {
        h1 = ((long long)h1 + (1ll*H1[y]*P[n]))%MODULE;
        n += L[y];
    }
    // add last: 
    h1 = ((long long)h1 + (1ll*(S[x]-'a'+1)*P[n]))%MODULE;

    // add first:
    int h2 = (S[x]-'a'+1);
    n = 1;
    for (int i = (int)G[x].size()-1; i>=0; --i) {
        int y = G[x][i];
        h2 = ((long long)h2 + (1ll*H2[y]*P[n]))%MODULE;
        n += L[y];
    }

    H1[x]=h1;
    H2[x]=h2;
    L[x]=n;
}

