        int M = MAX(nums) + 1;
        vi div(M);
        for(int i = 2; i < M; i++) {
            if(div[i]) continue;
            div[i] = i;
            for(int j = i; j < M; j += i) {
                if(div[j] == 0) div[j] = i;
            }
        } 
        int res = 0, n = nums.size();
        for(int i = n - 1, target = 1e9; i >= 0; i--) {
            int x = nums[i];
            while(x > target) {
                if(div[x] == x) return -1;
                x = div[x];
                res++;
            }
            target = x;
        }
        return res;

    }
};

