                        properDivisor = max(properDivisor, num//i )

            return properDivisor

        n = len(nums)
        operations = 0
        for i in range(n - 2, -1, -1):
            divisor = findDivisor(nums[i])
            if divisor == -1 and nums[i] > nums[i + 1]:
                return -1

            while nums[i] > nums[i + 1]:
                nums[i]//= divisor
                operations += 1
                divisor = findDivisor(nums[i])
                if divisor == -1:
                    break

            if nums[i] > nums[i + 1]:
                return -1

        return operations

