//             cout<<it<<' ';
//         } 
//         cout<<'\n'; 
//         cout<<"sz: ";
//         for(auto it:sz){
//             cout<<it<<' ';
//         } 
//         cout<<'\n';


        return {fhash, bhash};
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        pw[0] = 1;
        for(int i=1;i<=parent.size();++i){
            pw[i]  = (pw[i-1]*1LL*base)%mod;
        }
        for(int i=1;i<parent.size();++i){
            v[parent[i]].push_back(i); 
        }
        for(int i=0;i<parent.size();++i){
            sort(v[i].begin(),v[i].end());  
        } 
