class Solution {
public: 
    int p(int n){
        for(int i=2;i*i<=n;++i){
            if(n%i==0){
                return i; 
            }
        } 
        return n;
    }
    int find(vector<int>&nums){
        int ans = 0; 
        int n = nums.size();
        for(int i=n-2;i>=0;--i){
            if(nums[i]<=nums[i+1]){
                continue;
            }
            int x = p(nums[i]); 
            if(x>nums[i+1]){
                return INT_MAX;
            } 
            nums[i] = x; 
            ++ans;
        } 
        return ans;
    }
    int minOperations(vector<int>& nums) {
        int ans = INT_MAX;  
        vector<int>diff = nums; 
        int x = p(diff.back()); 
        diff[diff.size()-1] = x; 

        int z = find(nums);
        int y = find(diff); 

        if(z!=INT_MAX){
            ans = z;
        } 
        if(y!=INT_MAX){
            ans = min(ans,y);
        } 
        if(ans==INT_MAX)ans=-1; 
        return ans;


    }
};

