class Solution {
public:
    long long base = 31;
    long long mod = 1e9+7;
    void fun(long long node, vector<vector<long long>>&adj, vector<long long>&v1, vector<vector<long long>> &v2, string& s, vector<bool> &ans)
    {
        for(auto it:adj[node])
        {
            fun(it,adj,v1,v2,s,ans);
        }
        long long hash1 = s[node]-'a'+1;

        int siz = 1;
        for(int i = adj[node].size()-1; i>=0; i--)
        {
            vector<long long> temp = v2[adj[node][i]];
            siz += temp[2];
            hash1 *= v1[temp[2]];
            hash1 %= mod;
            hash1 += temp[0];
            hash1 %= mod;
        }  

        long long hash2 = 0;
        for(int i = 0; i<adj[node].size(); i++)
        {
            vector<long long> temp = v2[adj[node][i]];
            hash2 *= v1[temp[2]];
            hash2 %= mod;
            hash2 += temp[1];
            hash2 %= mod;
        }
        hash2 *= base;
        hash2 %= mod;
        hash2 += s[node]-'a'+1;
        hash2 %= mod;

        if(hash1 == hash2)
        {
            ans[node] = true;
        }
        v2[node] = {hash1,hash2,siz};
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {

        int n = parent.size();
        vector<long long> v1(n+1);
        v1[0] = 1;
        for(int i = 1; i<=n; i++)
        {
            v1[i] = v1[i-1];
            v1[i] *= base;
            v1[i] %= mod;
        }

        vector<bool> ans(n);

        vector<vector<long long>> adj(n);
        for(int i = 1; i<n; i++)
        {
            adj[parent[i]].push_back(i);
        }
        for(int i = 0; i<n; i++)
        {
            sort(adj[i].begin(),adj[i].end());
        }

        vector<vector<long long>> v2(n);
        fun(0,adj,v1,v2,s,ans);

        // cout<<v2[1][0]<<" "<<v2[1][1]<<endl;
        return ans;
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        int maxi = -1e9;
        for(auto it:nums)
        {
            maxi = max(maxi,it);
        }
        const int MAX = maxi + 1;

        int isPrime[MAX];
        int lp[MAX];

        for(int i = 0; i < MAX; i++) {
            isPrime[i] = 1;
        }
        isPrime[0] = 0;
        isPrime[1] = 0;

        for(int i = 0; i < MAX; i++) {
            lp[i] = i;
        }

        for(int i = 2; i * i <= maxi; i++) {
            if(isPrime[i] == 1) {
                for(int j = i * i; j <= maxi; j += i) {
                    isPrime[j] = 0;
                    if(lp[j] == j) {
                        lp[j] = i;
                    }
                }
            }
        }

        int n = nums.size();
        int ans = 0;
        int last = nums[n - 1];

        for(int i = n - 2; i >= 0; i--) {
            if(nums[i] <= last) {
                last = nums[i];
            } else {
                if(lp[nums[i]] <= last) {
                    ans++;
                    last = lp[nums[i]];
                } else {
                    return -1;
                }
            }
        }

        return ans;
    }
};

class Solution {
public:
    int numberOfSubstrings(string str, int k) {
        vector<int> f(26);
        int ans = 0;
        const int size = str.size();
        int l = 0;
        int r = 0;
        while (r < size) {
            while (r < size) {
                char ch = str[r];
                int c = ch - 'a';
                ++r;
                if (++f[c] == k) {
                    break;
                }
            }
            while (l < r) {
                char ch = str[l];
                int c = ch - 'a';
                if (f[str[r - 1] - 'a'] == k) {
                    ans += size - r + 1;
                }
                ++l;
                if (--f[c] == k - 1) {
                    break;
                }
            }
        }
        return ans;
    }
};

