using ll = long long;

vector<int> gpd;
vector<int> is_prime;

int sieve(int N) {

    is_prime.assign(N + 1, true);
    gpd.assign(N + 1, 1);
    is_prime[0] = is_prime[1] = false;

    for (ll p = 2; p <= N; p++) {
        if (is_prime[p]) {
            for (ll j = p * p; j <= N; j += p) {
                is_prime[j] = false;
                gpd[j] = max<ll>(gpd[j], j / p);
            }
        }
    }

    return 0;

}

