    int minOperations(vector<int>& nums) {
        const int size = nums.size();
        int ans = 0;
        for (int i = size - 2; i >= 0; --i) {
            int nxt = nums[i + 1];
            int num = nums[i];
            if (nxt >= num)
                continue;
            while (num > nxt) {
                int g = gpd[num];
                if (g == 1)
                    return -1;
                num /= g;
                ++ans;
            }
            nums[i] = num;
        }
        return ans;
    }
};

