def factorize(n):
    """ Wheel factorization with {2, 3, 5} basis
    :return: collections.Counter[prime factor, exponent]
    """
    f = collections.Counter()

    def compute_exponent(p):
        nonlocal n
        while (n % p) == 0:
            f[p] += 1
            n //= p

    compute_exponent(2)
    compute_exponent(3)
    compute_exponent(5)

    p = 7
    inc = [4, 2, 4, 2, 4, 6, 2, 6]
    inc_len = len(inc)
    i = 0
    while p ** 2 <= n:
        if n % p == 0:
            f[p] += 1
            n //= p
        else:
            p += inc[i]
            i = (i + 1) % inc_len
    if n != 1:
        f[n] += 1
    return f


class Solution:
    def minOperations(self, nums: List[int]) -> int:
        n = len(nums)
        sol = 0
        for i in range(n - 2, -1, -1):
            x = nums[i]
            if x == 1 or x <= nums[i + 1]:
                continue
            factors = factorize(x)
            mi = min(factors.keys())
            if mi <= nums[i + 1]:
                sol += 1
                nums[i] = mi
            else:
                return -1
        return sol

