        }
        vector<int> dfsorder;

        int gonsofar = 0;
        vector<int> start(s.size());
        vector<int> end(s.size());
        string t = "";
        auto dfs = [&](auto&& dfs, int cur) -> void {
            // int cnt =
            start[cur] = gonsofar;
            for (int i:al[cur]) {
                dfs(dfs, i);
            }
            gonsofar++;
            t.push_back(s[cur]);
            //not inc
            end[cur] = gonsofar;
        };
        dfs(dfs,0);
        auto [a,b] = manachers(t);
        vector<bool> res(s.size());
        //cout << t << endl;
        for (int i = 0; i < s.size(); ++i) {
            int len = end[i]-start[i];
            int mid = (end[i]+start[i])/2;
            //cout << i << ' ' << mid << ' ' << len << endl;
            if (len%2) {
                res[i] = a[mid] >= len/2+1;
            } else {
                res[i] = b[mid] >= len/2;
            }
        }
        return res;
    }
};

