typedef long long int ll;


constexpr uint64_t mod = (1ULL << 61) - 1;

const uint64_t seed = chrono::system_clock::now().time_since_epoch().count();
const uint64_t base = mt19937_64(seed)() % (mod / 3) + (mod / 3);

uint64_t base_pow[N];

int64_t modmul(uint64_t a, uint64_t b){
    uint64_t l1 = (uint32_t)a, h1 = a >> 32, l2 = (uint32_t)b, h2 = b >> 32;
    uint64_t l = l1 * l2, m = l1 * h2 + l2 * h1, h = h1 * h2;
    uint64_t ret = (l & mod) + (l >> 61) + (h << 3) + (m >> 29) + (m << 35 >> 3) + 1;
    ret = (ret & mod) + (ret >> 61);
    ret = (ret & mod) + (ret >> 61);
    return ret - 1;
}

void init(){
    base_pow[0] = 1;
    for (int i = 1; i < N; i++){
        base_pow[i] = modmul(base_pow[i - 1], base);
    }
}

struct PolyHash{
    /// Remove suff vector and usage if reverse hash is not required for more speed
    vector<int64_t> pref, suff;

    PolyHash() {}

    template <typename T>
    PolyHash(const vector<T>& ar){
        if (!base_pow[0]) init();

        int n = ar.size();
        assert(n < N);
        pref.resize(n + 3, 0), suff.resize(n + 3, 0);

        for (int i = 1; i <= n; i++){
            pref[i] = modmul(pref[i - 1], base) + ar[i - 1] + 997;
            if (pref[i] >= mod) pref[i] -= mod;
        }

        for (int i = n; i >= 1; i--){
            suff[i] = modmul(suff[i + 1], base) + ar[i - 1] + 997;
            if (suff[i] >= mod) suff[i] -= mod;
        }
    }

    PolyHash(const char* str)
            : PolyHash(vector<char> (str, str + strlen(str))) {}

    uint64_t get_hash(int l, int r){
        int64_t h = pref[r + 1] - modmul(base_pow[r - l + 1], pref[l]);
        return h < 0 ? h + mod : h;
    }

    uint64_t rev_hash(int l, int r){
        int64_t h = suff[l + 1] - modmul(base_pow[r - l + 1], suff[r + 2]);
        return h < 0 ? h + mod : h;
    }
};

class Solution {
public:


    void dfs(int curr)
    {
        for(auto it: adj[curr]){
            dfs(it); sz[curr] += sz[it];
        }
        sz[curr]++;
        int sz = ans.size();
        idx[curr] = sz;
        ans += str[curr];
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size(); str = s; ans = "";
        for(int i = 1; i < n; i++){
            int cp = parent[i];
            adj[cp].push_back(i);
        }

        dfs(0);

        PolyHash p(vector<char>(ans.begin(), ans.end()));

        vector<bool> vb(n);

        for(int i = 0; i < n; i++){
            int end = idx[i];
            int start = end - sz[i] + 1;
            auto it = p.get_hash(start, end);
            auto it2 = p.rev_hash(start, end);
            vb[i] = (it == it2);
        }

        for(int i = 0; i < n + 1; i++){
            adj[i].clear(); sz[i] = 0;
        }
        return vb;

    }
};

typedef long long int ll;
#define N 1000009
ll smallestPrime[N+1];
bool prime[N+1];
bool done = false;

class Solution {
public:



    void seive()
    {
        memset(prime, true, sizeof(prime));
        fill(smallestPrime, smallestPrime + N + 1, INT_MAX);

        for(int i = 0; i < N + 1; i++){
            smallestPrime[i] = i;
        }

        for (ll p = 2; p * p <= N; p++) {
            if (prime[p]) {
                smallestPrime[p] = p;
                for (ll i = p * p; i <= N; i += p){
                    prime[i] = false;
                    smallestPrime[i] = min(smallestPrime[i], p);
                } 
            }
        }


        prime[0] = false; prime[1] = false;
        smallestPrime[0] = 0; smallestPrime[1] = 1;

    }

    int minOperations(vector<int>& nums) {
        if(!done){
            seive();
            done = true;
        }

        int n = nums.size(); int a[n];
        for(int i = 0; i < n; i++){
            a[i] = smallestPrime[nums[i]];

        }


        ll dp[2][n];
        dp[0][0] = 0; dp[1][0] = 1;

        for(int i = 1; i < n; i++){
            int prev = nums[i-1];
            int primePrev = a[i-1];

            dp[0][i] = INT_MAX;
            dp[1][i] = INT_MAX;

            if(nums[i] >= nums[i-1]){
                dp[0][i] = min(dp[0][i], dp[0][i-1]);
            }
            if(nums[i] >= a[i - 1]){
                dp[0][i] = min(dp[0][i], dp[1][i-1]);
            }

            if(a[i] >= nums[i-1]){
                dp[1][i] = min(dp[1][i], dp[0][i-1] + 1);
            }
            if(a[i] >= a[i -1]){
                dp[1][i] = min(dp[1][i], dp[1][i-1] + 1);
            }
        }


        ll ans = min(dp[0][n-1], dp[1][n-1]);
        return (ans <= n) ? ans : -1;

    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        total_count = 0

        for start in range(n):
            freq_map = defaultdict(int)

            for end in range(start, n):
                char = s[end]
                freq_map[char] += 1

                if freq_map[char] >= k:
                    total_count += n - end
                    break

        return total_count

