class Solution:
    def findAnswer(self, parents: List[int], s: str) -> List[bool]:
        graph = defaultdict(list)
        for child, parent in enumerate(parents):
            if parent != -1:
                graph[parent].append(child)

        dfs_string = ""
        def dfs1(node):
            nonlocal dfs_string

            for child in graph[node]:
                dfs1(child)

            dfs_string += s[node]

        dfs1(0)
        # print(dfs_string)

        def manacher(s):
            t = '#' + '#'.join(s) + '#'
            n = len(t)
            p = [0] * n
            center = 0
            right = 0

            for i in range(n):
                mirror = 2 * center - i

                if i < right:
                    p[i] = min(right - i, p[mirror])

                while i + p[i] + 1 < n and i - p[i] - 1 >= 0 and t[i + p[i] + 1] == t[i - p[i] - 1]:
                    p[i] += 1

                if i + p[i] > right:
                    center = i
                    right = i + p[i]

            return p

        p = manacher(dfs_string)

        def is_palindrome_query(l, r):
            l = 2 * l + 1
            r = 2 * r + 1
            center = (l + r) // 2
            length = r - l + 1

            return p[center] >= length // 2

        res = [False] * len(s)
        def dfs2(node, start):
            nonlocal res

            end= start
            for child in graph[node]:
                end = dfs2(child, end)

            # print(node, start, end)
            res[node] = is_palindrome_query(start, end)
            return end + 1

        dfs2(0, 0)
        return res

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        def sieve_of_eratosthenes(limit):
            is_prime = [True] * limit
            is_prime[0], is_prime[1] = False, False  # 0 v 1 khng phi l s nguyn t

            for p in range(2, int(limit**0.5) + 1):
                if is_prime[p]:
                    for multiple in range(p * p, limit, p):
                        is_prime[multiple] = False

            primes = [num for num, prime in enumerate(is_prime) if prime]
            return primes

        primes = sieve_of_eratosthenes(1001)

        @cache
        def get_next_num(num):
            for prime in primes:
                if num % prime == 0:
                    return prime

            return num

        count = 0
        for i in range(len(nums) - 2, -1, -1):
            if nums[i] > nums[i + 1]:
                nums[i] = get_next_num(nums[i])
                count += 1

            if nums[i] > nums[i + 1]:
                return -1

        return count

