class Solution {
    using pii = pair<int, int>;
    void dfs(int cur, vector<vector<int>>& children, string& s, vector<pii>& lr,string& s0){
        lr[cur].first = s0.size();
        for(auto c : children[cur]){
            dfs(c, children, s, lr, s0);
        }
        lr[cur].second = s0.size();
        s0.push_back(s[cur]);
    }

    vector<int> manacher_odd(string s) {
        int n = s.size();
        s = "$" + s + "^";
        vector<int> p(n + 2);
        int l = 1, r = 1;
        for(int i = 1; i <= n; i++) {
            p[i] = max(0, min(r - i, p[l + (r - i)]));
            while(s[i - p[i]] == s[i + p[i]]) {
                p[i]++;
            }
            if(i + p[i] > r) {
                l = i - p[i], r = i + p[i];
            }
        }
        return vector<int>(begin(p) + 1, end(p) - 1);
    }

    vector<pair<int, int>> manacher(string s) {
        string t;
        for(auto c: s) {
            t += string("#") + c;
        }
        auto t_res = manacher_odd(t + "#");
        vector<pair<int, int>> s_res;
        for(int i = 0; i < s.size(); i++){
            int odd = t_res[2*i + 1] / 2;
            int even = (t_res[2*i] - 1) / 2;
            s_res.push_back({odd, even});
        }
        return s_res;
    }
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<vector<int>> children(n);
        for(int i = 0; i < n; i++){
            int p = parent[i];
            if(p < 0) continue;
            children[p].push_back(i);
        }
        for(int i = 0; i < n; i++){
            sort(children[i].begin(), children[i].end());
        }

        vector<pii> lr(n);
        string ord;
        dfs(0, children, s, lr, ord);
        //cout << ord << endl;

        auto pal_len = manacher(ord);
        vector<bool> res(n, false);
        for(int i = 0; i < n; i++){
            auto [l, r] = lr[i];

            if((r + l) % 2 == 0){
                int mid = (l + r) / 2;
                auto [odd, even] = pal_len[mid];
                int odd_start = mid - odd + 1;
                if(2*odd - 1 >= r - l + 1){
                    res[i] = true;
                }
            }
            else{
                int mid = (l + r + 1) / 2;
                auto [odd, even] = pal_len[mid];
                int even_start = mid - even;
                if( 2*even >= r - l + 1){
                    res[i] = true;
                }
            }
        }
        return res;
    }
};

class Solution {
    using ll = long long;
    vector<ll> LinearSieve(ll n){
        //  minimum prime factor
        vector<ll> lp(n+1);
        vector<ll> pr;
        for (ll i = 2; i <= n; ++i) {
            if (lp[i] == 0) {
                lp[i] = i;
                pr.push_back(i);
            }
            for (ll j = 0; i * pr[j] <= n; ++j) {
                lp[i * pr[j]] = pr[j];
                if (pr[j] == lp[i]) {
                    break;
                }
            }
        }
        return lp;
    }
public:
    int minOperations(vector<int>& nums) {
        auto max_val = *max_element(nums.begin(), nums.end());
        vector<int> fx(max_val + 1, -1);
        auto lp = LinearSieve(max_val);

        int cnt = 0;
        int n = nums.size();
        int mx = nums.back();
        for(int i = n - 2; i >= 0; i--){
            auto x = nums[i];
            if(x > mx){
                x = lp[x];
                cnt++;
            }
            if(x == -1 || x > mx) return -1;
            mx = x;
        }
        return cnt;
    }
};

