class Solution {
    int n;
    List<Integer>[] lists;
    char[] chars;
    boolean[] ans;
    int[] index;
    int curIndex;
    StringBuilder sb = new StringBuilder();
    StringHash2 sh;

    public boolean[] findAnswer(int[] parent, String s) {
        n = parent.length;
        chars = s.toCharArray();
        lists = new List[n];
        for (int i = 0; i < n; i++) {
            lists[i] = new ArrayList<>();
        }
        for (int i = 1; i < n; i++) {
            lists[parent[i]].add(i);
        }
        for (int i = 0; i < n; i++) {
            lists[i].sort(Comparator.comparingInt(o -> o));
        }
        ans = new boolean[n];
        buildStr(0);
        index = new int[n];
        curIndex = n - 1;
        dfs(0);
        long mod = (long) (1e9) + new Random().nextInt((int) 7e7);
        String str = sb.toString() + sb.reverse();
        sh = new StringHash2(str);
        dfs2(0);
        return ans;
    }

    private int dfs2(int v) {
        int l = index[v];
        for (Integer w : lists[v]) {
            l = Math.min(l, dfs2(w));
        }
        check(l, index[v], v);
        return l;
    }

    private void check(int l, int r, int v) {
        ans[v] = sh.eq(l, r, 2 * n - 1 - r, 2 * n - 1 - l);
    }

    private void dfs(int v) {
        index[v] = curIndex;
        curIndex--;
        for (int i = lists[v].size() - 1; i >= 0; i--) {
            dfs(lists[v].get(i));
        }
    }

    private void buildStr(int v) {
        for (Integer w : lists[v]) {
            buildStr(w);
        }
        sb.append(chars[v]);
    }
}

class StringHash2 {
    StringHash1 sh1;

    StringHash1 sh2;

    public StringHash2(String s) {
        this.sh1 = new StringHash1(s, 131, (long) (1e9 + 7));
        this.sh2 = new StringHash1(s, 13331, (long) (1e9) + new Random().nextInt((int) 7e7));
    }

    /**
     * 0[l1, r1][l2, r2]
     */
    public boolean eq(int l1, int r1, int l2, int r2) {
        return sh1.eq(l1, r1, l2, r2) && sh2.eq(l1, r1, l2, r2);
    }
}

class StringHash1 {
    String s;
    long p;
    long[] pow;
    long mod;
    int n;
    long[] hash;

    public StringHash1(String s, long p0, long mod0) {
        p = p0;
        mod = mod0;
        this.s = s;
        char[] chars = s.toCharArray();
        n = chars.length;
        pow = new long[n + 1];
        pow[0] = 1;
        for (int j = 1; j <= n; j++) {
            pow[j] = pow[j - 1] * p % mod;
        }
        // jhash
        hash = new long[n + 1];
        for (int j = 1; j <= n; j++) {
            hash[j] = (hash[j - 1] * p + chars[j - 1]) % mod;
        }
    }

    /**
     * 0[l1, r1][l2, r2]
     */
    public boolean eq(int l1, int r1, int l2, int r2) {
        if (l1 < 0 || r1 >= n || l2 < 0 || r2 >= n || l1 > r1 || l2 > r2 || (r1 - l1 != r2 - l2)) {
            return false;
        }
        long h1 = hash(l1, r1);
        long h2 = hash(l2, r2);
        return h1 == h2;
    }

    public long hash(int l, int r) {
        long h;
        h = hash[r + 1] - hash[l] * pow[r - l + 1] % mod;
        h %= mod;
        h += mod;
        h %= mod;
        return h;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        int n = nums.length;
        if (n > 10000) {
            return minOperations1(nums);
        } else {
            return minOperations2(nums);
        }
    }

    public int minOperations1(int[] nums) {
        int n = nums.length;
        int max = Arrays.stream(nums).max().orElse(0);
        int[] arr = new int[max + 1];
        arr[1] = 1;
        for (int i = 2; i <= max; i++) {
            for (int j = i; j <= max; j += i) {
                if (arr[j] == 0) {
                    arr[j] = i;
                }
            }
        }
        int cnt = 0;
        for (int i = n - 2; i >= 0; i--) {
            while (nums[i] > nums[i + 1]) {
                if (nums[i] == arr[nums[i]]) {
                    return -1;
                }
                nums[i] = arr[nums[i]];
                cnt++;
            }
        }
        return cnt;
    }

    public int minOperations2(int[] nums) {
        int n = nums.length;
        int cnt = 0;
        for (int i = n - 2; i >= 0; i--) {
            if (nums[i] > nums[i + 1]) {
                for (int j = 2; j * j <= nums[i]; j++) {
                    if (nums[i] % j == 0) {
                        nums[i] = j;
                        break;
                    }
                }
                cnt++;
            }
            if (nums[i] > nums[i + 1]) {
                return -1;
            }
        }
        return cnt;
    }
}

