import java.math.BigInteger;
class Solution {
    int dfs(int index, int chIndex){
        start[index] = chIndex;
        for(int e: edges[index]){
            chIndex = dfs(e, chIndex);
        }
        dfsStr[chIndex] = s.charAt(index);
        end[index] = chIndex;
        return chIndex+1;
    }
    String s;
    ArrayList<Integer>[] edges;
    char[] dfsStr;
    int[] start, end;
    public boolean[] findAnswer(int[] parent, String s) {
        this.s = s;
        int n = s.length();
        start = new int[n];
        end = new int[n];
        this.edges = new ArrayList[n];
        for(int i =0; i < n; i++){
            edges[i] = new ArrayList<>();
        }
        for(int i =0; i < n; i++){
            int p  = parent[i];
            if(p != -1){
            edges[p].add(i);
            }
        }
        for(int i =0; i < n; i++){
            Collections.sort(edges[i]);
        }
        this.dfsStr = new char[n];
        dfs(0,0);
        long[] pows = new long[n];
        long mod = (long)Math.pow(10,9) + 7;
        long powInv =  BigInteger.valueOf(26).modInverse(BigInteger.valueOf(mod)).intValue();
        pows[0] = 1;
        long[] powInvs = new long[n];
        powInvs[0] = 1;
        for(int i =1; i < n; i++){
            pows[i] = pows[i-1] * 26;
            pows[i] %= mod;
            powInvs[i] = powInvs[i-1]*powInv;
            powInvs[i] %=  mod;
        }  
        long[] forwardVal = new long[n];
        long[] backwardVal = new long[n];
        for(int i =0; i < n; i++){
            forwardVal[i] = pows[i] * (dfsStr[i]-'a');
            forwardVal[i] %= mod;
            if(i > 0){
                forwardVal[i] += forwardVal[i-1];
                forwardVal[i] %= mod;
            }
        }
        for(int i =n-1; i >= 0; i--){
            backwardVal[i] = pows[n-1-i] * (dfsStr[i]-'a');
            backwardVal[i] %= mod;
            if( i <  n-1){
                backwardVal[i] +=  backwardVal[i+1];
                backwardVal[i] %= mod;
            }
        }
        boolean[] ans = new boolean[n];
        for(int i =0; i < n; i++){
            if(start[i] == end[i]){
                ans[i] = true;
                continue;
            }

            int s1 = start[i];
            int e2 = end[i];
            int s2,e1;
            int mid = (start[i]+end[i])/2;
            if(start[i] %2 == end[i] % 2){
                e1 = mid-1;
                s2 = mid+1;
            }
            else{
                e1 = mid;
                s2 = mid+1;
            }

            long half1Val = forwardVal[e1] - (s1> 0?forwardVal[s1-1] : 0);
            half1Val %= mod;
            if(half1Val < 0){
                half1Val += mod;
            }
            half1Val *= powInvs[start[i]];
            half1Val %= mod;

            long half2Val = backwardVal[s2] - (e2 < n-1?backwardVal[e2+1]:0);
            if(half2Val < 0){
                half2Val += mod;
            }
            half2Val *= powInvs[n-1-end[i]];
            half2Val %= mod;
            if(half1Val == half2Val){
                ans[i] = true;
            }

        }
        return ans;

    }
}

class Solution {
    Integer[] mem = new Integer[1000001];
    int getSmallestDiv(int x){
        if(mem[x] != null){
            return mem[x];
        }
        if(x == 1){
            return 1;
        }
        if(x%2 == 0){
            return 2;
        }
        for(int i = 3; i <= Math.sqrt(x); i += 2){
            if(x%i == 0){
                mem[x] = i;
                return i;
            }
        }
        mem[x] = 1;
        return 1;
    }
    public int minOperations(int[] nums) {
        int ans = 0;
        int n = nums.length;
        for(int i =1; i < n; i++){
            if(nums[i] < nums[i-1]){
                for(int j = i-1; j >=0; j--){
                    if(nums[j] <= nums[j+1]){
                        break;
                    }
                     int smallestDiv = getSmallestDiv(nums[j]);
                     if(smallestDiv == 1){
                        return -1;
                     }
                     if(smallestDiv > nums[j+1]){
                        return -1;
                     }
                     nums[j] = smallestDiv;
                     ans++;
                }
            }
        }
        return ans;
    }
}

