class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int psa[3005][26] = {{}};
		for (int i = 0; i < s.size(); i++) {
			for (int j = 0; j < 26; j++) {
				psa[i+1][j] = psa[i][j];
			}
			psa[i+1][s[i]-'a']++;
		}
		int ans = 0;
		for (int i = 0; i < s.size(); i++) {
			int l = i, r = s.size();
			while (l < r) {
				int m = (l+r)/2;
				bool ok = 0;
				for (int j = 0; j < 26; j++) {
					if (psa[m][j]-psa[i][j] >= k) {
						ok = 1;
						break;
					}
				}
				if (ok) {
					r = m;
				} else {
					l = m+1;
				}
			}
			bool ok = 0;
			for (int j = 0; j < 26; j++) {
				if (psa[l][j]-psa[i][j] >= k) {
					ok = 1;
					break;
				}
			}
