class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.length(), total = 0;

        for (int start = 0; start < n; ++start) {
            vector<int> freq(26, 0);
            for (int end = start; end < n; ++end) {
                freq[s[end] - 'a']++;
                if (checkFreq(freq, k)) {
                    total += (n - end);
                    break;
                }
            }
        }
        return total;
    }

private:
    bool checkFreq(const vector<int>& freq, int k) {
        for (int count : freq) {
            if (count >= k) return true;
        }
        return false;
    }
};

