        while (nums[i] > nums[i + 1]) {
            int d = gpd_arr[nums[i]];
            if (d == 1) return -1;
            nums[i] /= d;
            ops++;
            if (nums[i] <= 0) return -1;
        }
    }
    return ops;
};

