        for i in range(2, int(sqrt(num))+1):
            if num%i == 0:
                return num//i
        return -1

    def minOperations(self, nums: List[int]) -> int:
        ans = 0
        for i in range(len(nums)-1,0,-1):
            while nums[i] < nums[i-1]:
                divisor = self.findLargestProperDivisor(nums[i-1])
                if divisor == -1:
                    return -1
                nums[i-1] = nums[i-1]//divisor
                ans += 1
        return ans

