class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        ans = 0
        pref = [[0 for i in range(26)] for i in range(n)]
        for i in range(n):
            o = ord(s[i]) - 97
            pref[i][o] += 1
            if(i):
                for j in range(26):
                    pref[i][j] += pref[i - 1][j]
        for i in range(n):
            L = i
            U = n - 1
            take = -1
            while L <= U:
                m = (L + U) >> 1
                f = 0
                for j in range(26):
                    c = pref[m][j]
                    if(i):
                        c -= pref[i - 1][j]
                    if(c >= k):
                        f = 1
                        break
                if(f):
                    take = m
                    U = m - 1
                else:
                    L = m + 1
            if(take != -1):
                ans += n - take
        return ans

