            for(int j = 0; j < 26; j++) {
                pre[i][j] += pre[i-1][j];
            }
        }

        int ans = 0;
        for(int i = 0; i <= n; i++) {
            for(int j = i+1; j <= n; j++) {
                int val = -1;
                for(int k = 0; k < 26; k++) {
                    val = max(val, pre[j][k] - pre[i][k]);
                }

                if(val >= z) ans++;
            }
        }

        return ans;
    }
};

