        return fans;
    }
};

const int N = 1e6 + 5;
int spf[N];
class Solution {
public:
    void fun() {
        for(int i = 1; i < N; i++) spf[i] = i;

        for(int i = 2; i < N; i++) {
            if(spf[i] != i) continue;
            for(long long j = ((long long)i)*i; j < N; j += i) {
                spf[j] = min(spf[j], i);
            }
        }
    }
    int minOperations(vector<int>& v) {
        if(spf[10] != 2) fun();
        int n = v.size();

        int ans = 0;
        bool isPoss = true;
        for(int i = n-2; i >= 0; i--) {
            if(v[i] > v[i+1]) {
                if(spf[v[i]] > v[i+1]) {
                    isPoss = false;
                    break;
                }
                else {
                    v[i] = spf[v[i]];
                    ans++;
                }
            }
        }

        if(!isPoss) return -1;
        return ans;
    }
};

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int n = s.length(), res = 0;
        int[] cnt = new int[26];

        for (int i = 0, j = 0; i < n; i++) {
            cnt[s.charAt(i) - 'a']++;

            while (j <= i && cnt[s.charAt(i) - 'a'] >= k) {
                res += n - i;
                cnt[s.charAt(j++) - 'a']--;
            }
        }

        return res;
    }
}

