        int res = 0, n = nums.size();
        for(int i = n - 2; i >= 0; i--) {
            if(nums[i] > nums[i + 1]) {
                int x = findDivisor(nums[i]);
                int y = (nums[i] / x);
                cout<<nums[i]<<" "<<y<<endl;
                if(y != 1 && y <= nums[i + 1]) {
                    nums[i] = y;
                    res++;
                    continue;
                }
                return -1;
            }
        }

        return res;
    }
private:
    int findDivisor(int n) {
        for(int i = 2; i * i <= n; i++)
            if(n % i == 0) return (n / i);
        return n;
    }
};

