class Solution:
    def minOperations(self, nums: List[int]) -> int:
        minSoFar = nums[-1]
        ops = 0

        def greatestProperDivisor(n: int):
            for i in range(2, n):
                if n / i == n // i: return n // i
            return 1

            # for i in range(n // 2, 1, -1):
            #     if n % i == 0: return i
            # return 1

        for i in range(len(nums) - 2, -1, -1):
            if nums[i] <= minSoFar:
                minSoFar = nums[i]
                continue

            # We have to try and divide
            while nums[i] > minSoFar:
                gpd = greatestProperDivisor(nums[i])
                if gpd == 1: return -1
                nums[i] //= gpd
                ops += 1

            minSoFar = nums[i]

        return ops

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int[] f = new int[26];
        int l = 0;
        int n = s.length();
        int c = 0;
        for(int r = 0; r < n; r++) {
            f[s.charAt(r) - 'a']++;
            while(f[s.charAt(r) - 'a'] >= k) {
                f[s.charAt(l) - 'a']--;
                l++;
            }

            c += r - l + 1;
        }

        return n * (n + 1) / 2 - c;
    }
