class Solution {
public:
    int numberOfSubstrings(string s, int k) 
    {
        int ans = 0;
        vector<vector<int>> freq(s.size() + 1, vector<int>(26, 0));
        for (int i = 0; i <s.size(); i++)
        {
            freq[i + 1] = freq[i];
            freq[i + 1][s[i] - 'a']++; 
        }  
        for (int i = 0; i < s.size(); i++)
        {
            int curr = s.size();
            for (int start = i, end = s.size() - 1, mid; start <= end;)
            {
                mid = (start + end) / 2;
                int cnt = 0;
                for (int j = 0; j < 26; j++)
                {
                    cnt = max(cnt, freq[mid + 1][j] - freq[i][j]);
                }
                if (cnt >= k)
                {
                    curr = mid;
                    end = mid - 1;
                }
                else
                {
                    start = mid + 1;
                }
            }
            if (curr == s.size())
            {
                break;
            }
            else
            {
                ans += s.size() - curr;
            }
        }
        return ans;
    }
};

