class Solution {
    int helper(int num)
    {
        int ans = 1;
        for (int i = 2; i * i <= num; i++)
        {
            if (num % i == 0)
            {
                ans = max(ans, i);
                ans = max(ans, num / i);
            }
        }
        return ans;
    }
public:
    int minOperations(vector<int>& nums) 
    {
        int ans = 0;
        for (int i = (int)(nums.size()) - 2; i >= 0; i--)
        {
            if (nums[i] <= nums[i + 1])
            {
                continue;
            }
            int curr = helper(nums[i]);
            nums[i] /= curr;
            ans++;
            if (nums[i] > nums[i + 1])
            {
                return -1;
            }
        }    
        return ans;
    }
};

