class Solution:
    def minOperations(self, nums: List[int]) -> int:
        def getprimes(upper = 2000):
            isprime = [True]*(upper+1)
            for i in range(2, upper+1):
                if isprime[i]:
                    j = 2
                    while i * j <= upper:
                        isprime[i*j] = False
                        j += 1
            return [i for i in range(2, upper+1) if isprime[i]]
        primes = getprimes()
        isprimes = set(primes)

        @cache
        def nxt(num):
            if num in isprimes:
                return -1
            for p in primes:
                if num % p == 0:
                    return p
            return -1

        ans = 0
        last = nums[-1] + 10
        while nums:
            cur = nums.pop()
            while cur > last:
                cand = nxt(cur)
                if cand == -1:
                    return -1
                cur = cand
                ans += 1
            last = cur
        return ans

