class PalindromeChecker {
private:
    string S;         
    string T;         
    vector<int> P;

    void preprocess() {
        int N = S.size();
        T = "#";
        for (int i = 0; i < N; i++) {
            T += S[i];
            T += "#";
        }

        int M = T.size();
        P.resize(M);

        int center = 0, right = 0;
        for (int i = 0; i < M; i++) {
            int mirror = 2 * center - i; 

            if (i < right)
                P[i] = min(right - i, P[mirror]);
            else
                P[i] = 0;

            while (i - P[i] - 1 >= 0 && i + P[i] + 1 < M && T[i - P[i] - 1] == T[i + P[i] + 1])
                P[i]++;

            if (i + P[i] > right) {
                center = i;
                right = i + P[i];
            }
        }
    }

public:
    PalindromeChecker(const string& str) : S(str) {
        preprocess();
    }
    bool isPalindrome(int i, int j) {
        int left = 2 * i + 1;
        int right = 2 * j + 1;
        int c = (left + right) / 2;
        int r = (right - left) / 2;
        if (c < 0 || c >= T.size())
            return false;
        return P[c] >= r;
    }
};

