struct strhash{
    pair<ll, ll> hash;
    int sz;
    strhash(){
        hash = {0,0};
        sz = 0;
    }
    void add_char_end(char c){
        hashing::add_end(c, hash);
        sz ++;
    }
    void add_hash_end(const strhash& h2){
        hash = hashing::merge_hash(hash, sz, h2.hash, h2.sz);
        sz += h2.sz;
    }

    bool same(const strhash& h2){
        return h2.sz == sz && (h2.hash == hash);
    }
};


