class Solution {
    int timer = 0;
    vector<int> tout;
    string order;
    vector<int> siz;
public:
    inline void dfs(int i, const vector<vector<int>>& g, const string& s) {
        siz[i] = 1;

        for(auto it: g[i]) {
            dfs(it, g, s);
            siz[i] += siz[it];
        }

        order.push_back(s[i]);
        tout[i] = timer++;
    }

    inline vector<int> manacher(string& s) {
        int n = s.size();
        vector<int> span(n);
        int center = 0;
        for(int i=1; i<n; i++) {
            if (i <= center + span[center]) {
                span[i] = min((center + span[center]) - i, span[center - (i - center)]);
            }

            int l = i - span[i], r = i + span[i];
            while (l-1 >= 0 && r+1 < n && s[l-1] == s[r+1]) {
                span[i]++;
                l--;
                r++;
            }

            if (center + span[center] < i + span[i]) {
                center = i;
            }
        }

        return span;
    }

    inline bool isPal(int l, int r, const vector<int>& span) {
        l = l * 2 + 1;
        r = r * 2 + 1;
        int mid = (l + r) >> 1;
        return span[mid] >= r - mid;
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        timer = 0;
        tout.clear();
        siz.clear();
        tout = vector<int>(n);
        siz = vector<int>(n);
        order = "";

        vector<vector<int>> g(n);
        for(int i=1; i<n; i++) {
            g[parent[i]].push_back(i);
        } 

        dfs(0, g, s);
        string order1 = "#";
        for(auto it: order) {
            order1.push_back(it);
            order1.push_back('#');
        }

        vector<int> span = manacher(order1);
        vector<bool> ans(n);
        for(int i=0; i<n; i++) {
            int l = tout[i] - siz[i] + 1;
            int r = tout[i];
            ans[i] = isPal(l, r, span);
        }

        return ans;
    }
};

const int MAXN = 1e6 + 5;
int spf[MAXN+1];
class Solution {
public:
    void init() {
        spf[1] = 1;
        for(int i=2; i<=MAXN-3; i++) {
            if (!spf[i]) {
                spf[i] = i;
                for(int j=2*i; j<=MAXN-3; j+=i) {
                    if (!spf[j]) {
                        spf[j] = i;
                    }
                }
            }
        }
    }

    int minOperations(vector<int>& nums) {
        if (spf[1] != 1) {
            init();
        }

        int n = nums.size();
        int INF = 2 * n + 5;
        vector<vector<int>> dp(n, vector<int>(2, INF));
        dp[0][0] = 0, dp[0][1] = 1;

        for(int i=1; i<n; i++) {
            for(int j=0; j<2; j++) {
                int cur = (j == 0 ? nums[i]: spf[nums[i]]);
                if (cur >= nums[i-1]) {
                    dp[i][j] = min(dp[i][j], dp[i-1][0] + j);
                }

                if (cur >= spf[nums[i-1]]) {
                    dp[i][j] = min(dp[i][j], dp[i-1][1] + j);
                }
            }
        }

        if (dp[n-1][0] == INF && dp[n-1][1] == INF) {
            return -1;
        }

        return min(dp[n-1][0], dp[n-1][1]);
    }
};

