func manacherOdd(s string) []int {
	n := len(s)
	s = "$" + s + "^"
	p := make([]int, n+2)
	l, r := 1, 1
	for i := 1; i <= n; i++ {
		p[i] = max(0, min(r-i, p[l+(r-i)]))
		for s[i-p[i]] == s[i+p[i]] {
			p[i]++
		}
		if i+p[i] > r {
			l, r = i-p[i], i+p[i]
		}
	}
	return p[1 : len(p)-1]
}

func manacher(s string) []int {
	var t strings.Builder
	for _, c := range s {
		t.WriteRune('#')
		t.WriteRune(c)
	}
	t.WriteRune('#')
	res := manacherOdd(t.String())
	return res[1 : len(res)-1]
}

func dfs(s string, i int, start int, res *strings.Builder) string {
	st[i] = start
	for _, c := range child[i] {
		dfs(s, c, res.Len(), res)
	}
	res.WriteByte(s[i])
	ed[i] = res.Len() - 1
	return res.String()
}

func findAnswer(parent []int, s string) []bool {
	n := len(parent)
	st = make([]int, n)
	ed = make([]int, n)
	child = make([][]int, n)
	for i := 1; i < n; i++ {
		child[parent[i]] = append(child[parent[i]], i)
	}

	var res []bool
	var xxx strings.Builder
	dfs(s, 0, 0, &xxx)
	mana := manacher(xxx.String())

	for i := 0; i < n; i++ {
		ks := st[i] * 2
		ke := ed[i] * 2
		mid := (ks + ke) / 2
		if mana[mid]-1 >= ed[i]-st[i]+1 {
			res = append(res, true)
		} else {
			res = append(res, false)
		}
	}
	return res
}

