int cnt = 0;
const int N = 1e6 + 2;
int spf[N];
int gpd[N];
class Solution {
public:
    int minOperations(vector<int>& nums) {

        if (!cnt) {
            memset(spf, 0, sizeof(spf));
            spf[1] = 1;
            for (int i = 2; i < N; i++) {
                for (int j = 2 * i; j < N && !spf[i]; j += i) {
                    if (!spf[j]) {
                        spf[j] = i;
                    }
                }
                if (!spf[i]) {
                    spf[i] = i;
                }
            }

            gpd[1] = 1;
            for (int i = 2; i < N; i++) {
                gpd[i] = i / spf[i];
            }
            cnt++;
        }

        int prev = 0;
        int n = nums.size();
        int ans = 0;
        for (int i = n - 2; i >= 0; i--) {
            int temp = nums[i];
            while (temp > nums[i + 1] && gpd[temp] != 1) {
                temp /= gpd[temp];
                ans++;
            }
            if (temp > nums[i + 1]) {
                return -1;
            }
            nums[i] = temp;
        }
        return ans;
    }
};

func numberOfSubstrings(s string, k int) int {
    n := len(s)
    prefix := buildPrefix(s)
    counter := 0

    // fmt.Println(prefix)

    for i := 0; i < n; i++ {
        for j := i; j < n; j++ {
            match := false
            for c := 0; c < 26; c++ {
                numChar := getNumChar(prefix, i, j, c)
                if numChar >= k {
                    match = true
                    break
                }
            }
            if match {
                counter += 1
            }
        }
    }

    return counter
}

func buildPrefix(s string) [][]int {
    p := make([][]int, len(s))

    for i := range s {
        p[i] = make([]int, 26)
        cIdx := int(s[i] - 'a')

        p[i][cIdx] = 1
        if i == 0 { 
            continue
        }

        for c := 0; c < 26; c++ {
            p[i][c] += p[i-1][c]
        }
    }
    return p
}

func getNumChar(p [][]int, from, to, cIdx int) int {
    if from == 0 {
        return p[to][cIdx]
    }
    return p[to][cIdx] - p[from-1][cIdx]
}

func stringSequence(target string) []string {
    w := []byte{'a'}
    out := []string{string(w)}

    for string(w) != target {
        idx := len(w) - 1
        if w[idx] == target[idx] {
            w = append(w, byte('a'))
            out = append(out, string(w))
        } else {
            cIdx := (int(w[idx] - 'a') + 1) % 26
            w[idx] = byte(cIdx + 'a')
            out = append(out, string(w))
        }
    }

    return out
}

const (
    base = 29
    mod = 1000000007
)

func findAnswer(parent []int, s string) []bool {
    childrenOf := make([][]int, len(s))
    for c, p := range parent {
        if p != -1 {
            childrenOf[p] = append(childrenOf[p], c)
        }
    }

    for i := range childrenOf {
        sort.Ints(childrenOf[i])
    }

    answer := make([]bool, len(s))

    var dfs func(node int) (int, int, int)
    dfs = func(node int) (int, int, int) {
        forward, reverse, power := 0, 0, 1
        for _, child := range childrenOf[node] {
            cf, cr, cp := dfs(child)
            forward = (forward*cp + cf) % mod
            reverse = (reverse + cr*power) % mod
            power = (power*cp) % mod
        }

        cIdx := int(s[node] - 'a')
        forward = (forward*base + cIdx) % mod
        reverse = (reverse + cIdx*power) % mod
        power = (power*base) % mod

        if forward == reverse {
            answer[node] = true
        }

        return forward, reverse, power
    }

    dfs(0)
    return answer
}

func minOperations(nums []int) int {
    n := len(nums)
    counter := 0

    for i := n-1; i >= 0; i-- {
        if i == n-1 || nums[i] <= nums[i+1] {
            continue
        }

        divisor := findGreatestDivisor(nums[i])
        if divisor == nums[i] || nums[i] / divisor > nums[i+1] {
            return -1
        }

        nums[i] /= divisor 
        counter += 1
    }

    return counter
}

func findGreatestDivisor(num int) int {
    for i := 2; i <= num / 2; i++ {
        if num % i == 0 {
            return num / i
        }
    }
    return num
}

