using ll = long long;
const int MOD = 1e9 + 7;
const int BASE = 31;

class Solution {
    vector<ll> power;
    vector<ll> computeHash(const string& s) 
    {
        int n = s.size();
        vector<ll> hash(n + 1, 0);
        for (int i = 0; i < n; ++i) 
        {
            hash[i + 1] = (hash[i] * BASE + (s[i] - 'a' + 1)) % MOD;
        }
        return hash;
    }

    ll getHash(const vector<ll>& hash, int l, int r) 
    {
        ll h = (hash[r + 1] - hash[l] * power[r - l + 1] % MOD + MOD) % MOD;
        return h;
    }

    void dfs(int cur, vector<vector<int>>&next)
    {
        for (int nxt: next[cur])
            dfs(nxt, next);
        nums.push_back(cur);
    }
    int dfs2(int cur, vector<vector<int>>&next)
    {
        int sum = 1;
        for (int nxt: next[cur])
            sum += dfs2(nxt, next);
        count[cur] = sum;
        return sum;
    }

public:
    vector<int>nums;
    vector<int>count;

    vector<bool> findAnswer(vector<int>& parent, string t) 
    {
        int n = parent.size();
        vector<vector<int>>next(n);
        for (int i=0; i<n; i++)
        {
            int p = parent[i];
            if (p!=-1)
                next[p].push_back(i);
        }
        for (int i=0; i<n; i++)
            sort(next[i].begin(), next[i].end());

        count.resize(n);
        dfs(0, next);
        dfs2(0, next);

        // for (int x: nums) cout<<x<<" "; cout<<endl;
        // for (int i=0; i<count.size(); i++)
        //     cout<<i<<" "<<nums[i]<<" "<<count[nums[i]]<<endl;

        string s;
        for (int i: nums)
            s.push_back(t[i]);

        power.resize(n + 1, 1);
        for (int i = 1; i <= n; ++i) 
        {
            power[i] = power[i - 1] * BASE % MOD;
        }        
        vector<ll> hashF = computeHash(s);
        reverse(s.begin(), s.end());
        vector<ll> hashR = computeHash(s);

        vector<int>pos(n);
        for (int i=0; i<n; i++)
            pos[nums[i]] = i;

        vector<bool>rets;
        for (int i=0; i<n; i++)
        {
            int r = pos[i], l = r-count[i]+1;
            // cout<<l<<" "<<r<<endl;
            ll hash1 = getHash(hashF, l, r);         
            ll hash2 = getHash(hashR, n - r - 1, n - l - 1); 
            rets.push_back(hash1==hash2);
        }
        return rets;        
    }
};

class Solution {
    vector<int>Eratosthenes(int n)
    {
        vector<int>q(n+1,0);
        vector<int>primes;
        for (int i=2; i<=sqrt(n); i++)
        {
            if (q[i]==1) continue;
            int j=i*2;
            while (j<=n)
            {
                q[j]=1;
                j+=i;
            }
        }        
        for (int i=2; i<=n; i++)
        {
            if (q[i]==0)
                primes.push_back(i);                
        }
        return primes;
    }
