class Solution
{
public:
    vector<bool> findAnswer(vector<int> &parent, string s)
    {
        int n = parent.size();
        vector<bool> ans(n);
        vector<int> arr = parent;
        vector<vector<int>> c(n);
        for (int i = 1; i < n; i++)
            c[parent[i]].push_back(i);
        long long P = 911;
        long long MOD = 1e9 + 7;
        vector<long long> pp(n + 2, 1);

        for (int i = 1; i <= n + 1; i++)
            pp[i] = (pp[i - 1] * P) % MOD;
        vector<int> po;
        stack<int> stack;
        vector<bool> vis(n, false);
        stack.push(0);
        while (!stack.empty())
        {
            int node = stack.top();
            if (!vis[node])
            {
                vis[node] = true;
                for (int k = c[node].size() - 1; k >= 0; k--)
                    stack.push(c[node][k]);
            }
            else
            {
                stack.pop();
                po.push_back(node);
            }
        }
        vector<int> len(n);
        vector<long long> h1(n), h2(n);

        for (int node : po)
        {
            len[node] = 1;
            long long ch1 = 0;
            for (int child : c[node])
            {
                ch1 = (ch1 * pp[len[child]] + h1[child]) % MOD;
                len[node] += len[child];
            }
            ch1 = (ch1 * P + (s[node] - 'a' + 1)) % MOD;
            h1[node] = ch1;
            long long ch2 = (s[node] - 'a' + 1);
            for (int j = c[node].size() - 1; j >= 0; j--)
            {
                int child = c[node][j];
                ch2 = (ch2 * pp[len[child]] + h2[child]) % MOD;
            }
            h2[node] = ch2;
            ans[node] = (h1[node] == h2[node]);
        }

        return ans;
    }
};

