        vector<int> ans = nums;
        int ct = 0;
        int n = nums.size();
        for (int i = n - 2; i >= 0; --i) {
            while (nums[i] > nums[i + 1]) {
                int div = arr[nums[i]];
                if (div == 1)
                    return -1;
                nums[i] /= div;
                ct++;
                if (nums[i] <= 0)
                    return -1;
            }
        }
        return ct;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        vector<int> fq(26, 0);
        int n=s.length(), l=0, r=0, ans=0;
        while(l<n){
            bool found=false;
            for(int i=0; i<26; i++){
                if(fq[i]>=k) {ans+=(n-r+1); found=true; break;}
            }
            if(found || r==n){
                fq[s[l]-'a']--;
                l++;
            }else if(r<n){
                fq[s[r]-'a']++;
                r++;
            }
        }
        return ans;
    }
};

