class Solution {
    ArrayList<ArrayList<Integer>> adj;
    int MOD = 1000000007;
    int P = 31;
    public boolean[] findAnswer(int[] parent, String s) {
        adj = new ArrayList<>();
        int n = parent.length;
        boolean[] ans = new boolean[n];
        for(int i = 0; i < n; i++){
            adj.add(new ArrayList<>());
        }

        for(int i = 1; i < n; i++){
            adj.get(parent[i]).add(i);
        }
        long[] a = dfs(0, s, ans);
        if(a[0] == a[1]){
            ans[0] = true;
        }
        return ans;
    }

    public long modPow(long base, long exp, long mod) {
        long result = 1;
        while (exp > 0) {
            if ((exp & 1) == 1) {
                result = (result * base) % mod;
            }
            base = (base * base) % mod;
            exp >>= 1;
        }
        return result;
    }

    public long[] dfs(int i,  String s, boolean[] ans){
        long fh = 0;
        long bh = 0;
        long pf = 1;
        long pb = 1;
        long len = 0;

        for (int child : adj.get(i)) {
            long[] childHash = dfs(child, s, ans);

            fh = (fh * modPow(P, childHash[2], MOD) + childHash[0]) % MOD;

            bh = (bh + childHash[1] * pb) % MOD;

            pb = (pb * modPow(P, childHash[2], MOD)) % MOD;

            len += childHash[2];
        }

        char c = s.charAt(i);
        fh = (fh * P + (c - 'a' + 1)) % MOD;
        bh = ((c - 'a' + 1) * pb + bh) % MOD;

        len++;

        if (fh == bh) {
            ans[i] = true;
        }
        // System.out.println(i + " " +fh + " " + bh);
        return new long[]{fh, bh, len};
    }
}

class Solution {

    int[] spf;  

    void pre(int N){
        spf = new int[N + 1];

        for (int i = 1; i <= N; i++) {
            spf[i] = -1;
        }

        for (int i = 2; i <= N; i++) {
            if (spf[i] == -1) { 
                for (int j = i; j <= N; j += i) {
                    if (spf[j] == -1) {
                        spf[j] = i; 
                    }
                }
            }
        }
    }
    public int minOperations(int[] arr) {
        int max = 0;
        for(int i : arr){
            max = Math.max(i, max);
        }
        pre(max);
        int n = arr.length;
        int prev = arr[n-1];
        int count = 0;
        for(int i = n-2; i >= 0; i--){
            int curr = arr[i];
            if(curr <= prev){
                prev = curr;
            } else{
                boolean flag = true;
                while(curr > prev){
                    count++;
                    int small = spf[curr];
                    if(small == -1 || small == curr){
                        flag = false;
                        break;
                    }
                    curr = small;
                }
                if(!flag) return -1;
                prev = curr;
            }
        }
        return count;
    }
}

