class Solution {
public:

    int p = 31, m = 1e9 + 9, n;
    vector<long long> p_pow; 
    vector<int> dp1, dp2;
    pair<int, int> post(int node, string& s, vector<int> adj[])
    {
        long long cur = 0, cnt = 0;
        for(auto x : adj[node])
        {
            auto [y, c] = post(x, s, adj);
            cur = (cur + y * p_pow[cnt]) % m;
            cnt += c;
        }
        cur = (cur + (s[node] - 'a' + 1) * p_pow[cnt]) % m;
        dp1[node] = cur;
        return {cur, cnt + 1};
    }
    pair<int, int> pre(int node, string& s, vector<int> adj[])
    {
        long long cur = s[node] - 'a' + 1, cnt = 1;
        for(int i = adj[node].size() - 1; i >= 0; i--)
        {
            auto x = adj[node][i];
            auto [y, c] = pre(x, s, adj);
            cur = (cur + y * p_pow[cnt]) % m;
            cnt += c;
        }
        dp2[node] = cur;
        return {cur, cnt};
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        n = parent.size();
        vector<int> adj[n];
        p_pow.assign(1e5 + 5, 1);
        dp1.resize(n);
        dp2.resize(n);

        for(int i = 1; i <= 1e5; i++)
            p_pow[i] = (p_pow[i - 1] * p) % m;



        for(int i = 1; i < n; i++)
            adj[parent[i]].push_back(i);

        post(0, s, adj);
        pre(0, s, adj);
        vector<bool> res(n);
        for(int i = 0; i < n; i++)
            res[i] = dp1[i] == dp2[i];
        return res;
    }
};

class Solution {
public:
    int get(int x)
    {
        int mx = -1;
        for(int j = 1; j * j <= x; j++)
        {
            if(x % j == 0)
            {
                int a = j, b = x / j;
                mx = max(mx, a);
                if(b != x) mx = max(mx, b);
            }
        }
        return x / mx;
    }
    int minOperations(vector<int>& nums) {
        int n = nums.size(), res = 0, last = nums[n - 1];
        for(int i = n - 2; i >= 0; i--)
        {

            int x = nums[i];
            int prev = x;
            while(x > last)
            {
                res++;
                x = get(x);
                if(x == prev) break;
                prev = x;
            }
            if(x > last) return -1;
            last = x;
        }
        return res;
    }
};

