class Solution {
public:
    vector<int> post;
    vector<int> order;
    int dfs(int idx,vector<vector<int>> &adj, vector<bool> &ans,string &s, string &str){
        if(adj[idx].size()==0){
            str.push_back(s[idx]);
            post[idx] = 1;
            order.push_back(idx);
            return 1;
        }
        int temp = 0;
        for(auto i:adj[idx]){
            temp+=dfs(i,adj,ans,s,str);
        }
        temp++;
        order.push_back(idx);
        post[idx] = temp;
        str.push_back(s[idx]);
        return temp;
    }
    void pre(string &str, vector<int> &odd,vector<int> &even){
        int n = str.size();

        for (int i = 0, st = 0, end = -1; i < n; ++i) {
            int k = (i > end) ? 1 : min(odd[st + end - i], end - i + 1);
            while (i - k >= 0 && i + k < n && str[i - k] == str[i + k]) {
                ++k;
            }
            odd[i] = k - 1;
            if (i + k - 1 > end) {
                st = i - k + 1;
                end = i + k - 1;
            }
        }

        for (int i = 0, st = 0, end = -1; i < n; ++i) {
            int k = (i > end) ? 0 : min(even[st + end - i + 1], end - i + 1);
            while (i - k - 1 >= 0 && i + k < n && str[i - k - 1] == str[i + k]) {
                ++k;
            }
            even[i] = k;
            if (i + k - 1 > end) {
                st = i - k;
                end = i + k - 1;
            }
        }
    }
    bool adarsh(int l, int r, const vector<int> &odd, const vector<int> &even) {
        int length = r - l + 1;

        if (length % 2 == 1) { 
            int mid = (l + r) / 2;
            return odd[mid] >= (length / 2);
        } else { 
            int mid = (l + r) / 2;
            return even[mid + 1] >= (length / 2);
        }
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        vector<bool> ans(parent.size());
        post = vector<int>(parent.size());
        vector<vector<int>> adj(parent.size());
        int pr = -1;
        for(int i=0;i<parent.size();i++){
            if(parent[i]==-1){
                pr = i;
                continue;
            }
            adj[parent[i]].push_back(i);
        }
        for(auto &i:adj){
            sort(i.begin(),i.end());
        }
        string temp = "";
        dfs(pr,adj,ans,s,temp);
        vector<int> odd(temp.size()),even(temp.size());
        pre(temp, odd, even);
        for (int i = 0; i < order.size(); i++) {
            int nd = order[i];
            int sz = post[nd];

            if (adarsh(i - sz + 1, i,odd, even)) {
                ans[nd] = true;
            }
        }
        return ans;
    }
};

class Solution {
public:
    int findDiv(int n){
        for(int i=2;i <= sqrt(n);i++){
            if(n%i==0){
                return n/i;
            }
        }
        return -1;
    }
    int minOperations(vector<int>& a) {
        int n = a.size();
        int ans = 0;
        for(int i=n-2;i>=0;i--){
            if(a[i]<=a[i+1]) continue;
            int div = findDiv(a[i]);
            if(div==-1) return -1;
            if(a[i]/div <= a[i+1]){
                a[i]/=div;
                ans++;
            }else return -1;
        }
        return ans;
    }
};

class Solution {
