    int numberOfSubstrings(string s, int k) {
        int n=s.size();
        vector<vector<int>> pref(n+1,vector<int> (26,0));

        for(int i=0;i<n;i++){
            pref[i+1][s[i]-'a']++;
        }

        for(int i=1;i<=n;i++){
            for(int j=0;j<26;j++)pref[i][j]+=pref[i-1][j];
        }

        int ans=0;
        for(int i=1;i<=n;i++){
            for(int j=i;j<=n;j++){
                bool check=0;
                for(int l=0;l<26;l++){
                    if(pref[j][l]-pref[i-1][l]>=k){
                        check=1;
                        break;
                    }
                }
                if(check)ans++;
            }
        }

        return ans;
    }
};

