#define MOD 1000000007

class Solution {
public:
	vector<int> children[100000];
	long long prefix[100000];
	long long suffix[100000];
	int order[100000];
	int n;

	long long powMod(long long a, long long b) {
		long long res = 1;
		while (b) {
			if (b & 1)
				res = res * a % MOD;
			a = a * a % MOD;
			b >>= 1;
		}
		return res;
	}

	long long modInv(long long a) {
		return powMod(a, MOD - 2);
	}

	bool query(int l, int r) {
		long long lhash = prefix[r];
		if (l > 0)
			lhash = (lhash - prefix[l - 1] + MOD) % MOD;
		long long rhash = suffix[l];
		if (r < 100000 - 1)
			rhash = (rhash - suffix[r + 1] + MOD) % MOD;
		lhash = lhash * modInv(powMod(29, l)) % MOD;
		rhash = rhash * modInv(powMod(29, n - 1 - r)) % MOD;
		return lhash == rhash;
	}

	int rec(int x, string &s, vector<bool> &ans) {
		if (children[x].empty()) {
			ans[x] = true;
			return order[x];
		}
		int l = -1;
		for (auto y : children[x]) {
			int tmp = rec(y, s, ans);
			if (l == -1)
				l = tmp;
		}
		int r = order[x];
		ans[x] = query(l, r);
		return l;
	}

	void dfs(int x, string &s, string &full) {
		for (auto y : children[x])
			dfs(y, s, full);
		order[x] = s.size();
		s += full[x];
	}

	vector<bool> findAnswer(vector<int> &parent, string s) {
		n = parent.size();

		for (int i = 1; i < n; i++)
			children[parent[i]].push_back(i);
		for (int i = 0; i < n; i++)
			sort(children[i].begin(), children[i].end());

		string full;
		dfs(0, full, s);

		long long p = 1;
		for (int i = 0; i < n; i++) {
			prefix[i] = p * full[i] % MOD;
			p = p * 29 % MOD;
			if (i > 0)
				prefix[i] = (prefix[i] + prefix[i - 1]) % MOD;
		}

		p = 1;
		for (int i = n - 1; i >= 0; i--) {
			suffix[i] = p * full[i] % MOD;
			p = p * 29 % MOD;
			if (i < n - 1)
				suffix[i] = (suffix[i] + suffix[i + 1]) % MOD;
		}

		vector<bool> ans(n);
		rec(0, full, ans);
		return ans;
	}
};

