        helper();
        int ops = 0, n = nums.size();
        for (int i = n - 2; i >= 0; --i) {
            while (nums[i] > nums[i + 1]) {
                int div = divisors[nums[i]];
                if (div == 1 || (nums[i] /= div) <= 0) return -1;
                ops++;
            }
        }
        return ops;
    }
};

