class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int start = 0;
        int end = 0;
        int count = 0;
        map<int,int> freq;
        int num_above_k = 0;
        while (start < s.size()) {
            while (end < s.size() && num_above_k == 0) {
                freq[s[end]]++;
                if (freq[s[end]] == k)
                    ++num_above_k;
                ++end;
            }
            count += end == s.size() ? num_above_k > 0 : s.size() - end + 1;
            freq[s[start]]--;
            if (freq[s[start]] == k - 1)
                --num_above_k;
            ++start;
        }
        return count;
    }
};

