                if(freq[i] >= k)
                    return true;
            }

            return false;
        };

        int ans = 0;
        for(int l = 0, r = 0; l < n; l++) {
            while(r < n and !isOk()) {
                freq[s[r]-'a'] += 1;
                r += 1;
            }
            // cout << r << endl;
            // 0 1 2 3 4
            if(isOk()) {
                ans += n-r+1;
            }

            freq[s[l]-'a'] -= 1;
        }

        return ans;
    }
};

