        int n = (int)target.size();
        for(int i = 0; i < n; i++) {
            if(prev.size() < i+1) {
                prev.push_back('a');
                ans.push_back(prev);

                while(prev.back() != target[i]) {
                    char next = (prev.back() - 'a' + 1)%26 + 'a';
                    prev.back() = next;
                    ans.push_back(prev);
                }
            }
        }
        return ans;
    }
};

vector<int> manacher_odd(string s) {
    int n = s.size();
    s = "$" + s + "^";
    vector<int> p(n + 2);
    int l = 1, r = 1;
    for(int i = 1; i <= n; i++) {
        p[i] = max(0, min(r - i, p[l + (r - i)]));
        while(s[i - p[i]] == s[i + p[i]]) {
            p[i]++;
        }
        if(i + p[i] > r) {
            l = i - p[i], r = i + p[i];
        }
    }
    // return vector<int>(begin(p) + 1, end(p) - 1);
    return vector<int>(begin(p) , end(p));
}
vector<int> manacher(string s) {
    string t;
    for(auto c: s) {
        t += string("#") + c;
    }
    auto res = manacher_odd(t + "#");
    return vector<int>(begin(res) + 1, end(res) - 1);
}

// [l,r)  : Note that r is excluded
// It checks for substring [l,r-1]
bool is_palindrome (const vector<int> &maxPal, int l, int r) { 
    return maxPal[r+l] >= (r-l);
}

class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        // Construct the tree
        int n = (int)parent.size();
        vector<set<int>> B(n);

        for(int i = 0; i < n; i++) {
            int par = parent[i];
            if(par == -1)
                continue;

            B[par].insert(i);
        }

        vector<vector<int>> A(n);
        for(int i = 0; i < n; i++) {
            if(B[i].empty())
                continue;

            for(auto v: B[i]) {
                A[i].push_back(v);
                // A[v].push_back(i);
            }
        }

        vector<int> size(n);
        string t;
        auto rec = [&](const auto &self, int u, int par)->int {
            int sz = 0;
            for(auto v: A[u]) {
                if(v == par)
                    continue;

                sz += self(self,v,u);
            }

            t.push_back(s[u]);
            return size[u] = sz + 1;
        };

        rec(rec,0,-1);
        vector<int> maxPal = manacher(t);
        // cout << "string t: " << t << endl;
        // for(auto s: size) cout << s << " "; cout << endl;      
        vector<bool> ans(n);
        // [l,r) included
        auto isPal = [&](int l, int r)->bool {
            r -= 1;
            while(l <= r) {
                if(t[l] != t[r]) 
                    return false;

                l += 1;
                r -= 1;
            }

            return true;
        };
        // cout << "final string: " << t << endl;
        auto dfs = [&](const auto &self, int l, int r, int u, int par)->void {
            // check [l,r] is palindrome or not
            ans[u] = is_palindrome(maxPal, l, r);
            // cout << "node: " << u << " string: " << t.substr(l,r-l) << endl;
            // cout << "rang: " << l << " --> " << r-1 << endl;

            int prev = l;
            for(auto v: A[u]) {
                if(v == par)
                    continue;

                self(self,prev,prev+size[v],v,u);
                prev = prev + size[v];

            }
        };

        dfs(dfs,0,size[0],0,-1);

        return ans;
    }
};

using ll = long long ;
vector<ll> lpf;
bool isComputed = false;
void sieve_lpf(ll n) { 
    if(isComputed)
        return;
    isComputed = true;
    lpf.assign(n+1,0);

    lpf[0] = 0, lpf[1] = 1;
    ll i;
    // rep(i,2,n+1) { // starts from 2 since 0 and 1 are not primes
    for(ll i = 2; i < n+1; i++) {
        if(lpf[i] == 0) { // i is prime
            // mark all the multiples of prime i, i as lpf 
            lpf[i] = i;
            for(ll j = i*i; j <= n; j = j + i) {
                if(lpf[j] == 0)
                    lpf[j] = i;
            }
        }
        // otherwise i is not prime and already (marked) found the lpf
    }   
}

class Solution {
public:
    int minOperations(vector<int>& nums) {
        sieve_lpf(1e6+10);
        int n = (int)nums.size();

        auto get = [&](int x)->int {
            int l = lpf[x];
            return l; 
        };

        int op = 0;
        // cout << get(7) << endl;
        for(int i = n-2; i >= 0; i--) {
            while(nums[i]>nums[i+1]) {
                int d = get(nums[i]);
                if(d == nums[i]) {
                    return -1;
                }
                nums[i] = d;
                op += 1;
            }
        }
        return op;

    }
};

