class Solution {
public:


      vector< int > manachers(string S){

        int N = S.size() ;
        vector<int >A(2 * N + 10);
        // ...x character ... center ...x characters -> return x as A[center];      
    int r = 0, p = 0;
    for (int i = 0; i < N; i++)
    {
        if (i <= r)
            A[i] = min(A[2 * p - i], r - i);
        else
            A[i] = 0;

        while (i - A[i] - 1 >= 0 && i + A[i] + 1 < N && S[i - A[i] - 1] == S[i + A[i] + 1])
            A[i]++;

        if (r < i + A[i])
        {
            r = i + A[i];
            p = i;
        }
    }

    return A;
}
    vector<bool> findAnswer(vector<int>& parent, string s) {

