vector<int> manacher_odd(string s) {
    int n = s.size();
    s = "$" + s + "^";
    vector<int> p(n + 2);
    int l = 1, r = 1;
    for(int i = 1; i <= n; i++) {
        p[i] = max((int)0, min(r - i, p[l + (r - i)]));
        while(s[i - p[i]] == s[i + p[i]]) {
            p[i]++;
        }
        if(i + p[i] > r) {
            l = i - p[i], r = i + p[i];
        }
    }
    return vector<int>(begin(p) + 1, end(p) - 1);
}

vector<int> manacher(string s) {
    string t;
    for(auto c: s) {
        t += string("#") + c;
    }
    auto res = manacher_odd(t + "#");
    return vector<int>(begin(res) + 1, end(res) - 1);
}

class Solution {
public:
    vector<bool> findAnswer(vector<int>& par, string s) {
        int n = par.size();
        vector<vector<int>> g(n);
        for(int i = 1; i < n; i++){
            g[par[i]].push_back(i);
        }

        vector<int> tout(n), first(n, -1);
        string euler;
        int cnt = 0;
        function<void(int)> dfs = [&](int v){
            if(g[v].empty()) first[v] = v;
            for(auto u : g[v]){
                dfs(u);
                if(first[v] == -1) first[v] = first[u];
            }  

            tout[v] = cnt++;
            euler.push_back(s[v]);
        };
        dfs(0);


        auto d = manacher(euler);



        auto isPal = [&](int l, int r){
            l *= 2;
            r *= 2;
            if(2 * d[(l+r)/2] - 1 >= r - l + 1) return true;
            return false;
        };

        vector<bool> res(n, true);
        for(int i = 0; i < n; i++){
            if(g[i].empty()) continue;
            int l = tout[first[i]], r = tout[i];
            res[i] = isPal(l, r);
        }
        return res;
    }
};

const int N = 1e6+1;

bool f = false;
int seive[N];

void pre(){
    for(int i = 1; i < N; i++) seive[i] = i;
    for(int i = 2; i < N; i += 2) seive[i] = 2;
    for(int i = 3; i < N; i += 2){
        if(seive[i] != i) continue;
        for(int j = 2 * i; j < N; j += i){
            if(seive[j] == j) seive[j] = i;
        }
    }
}

class Solution {
public:
    int minOperations(vector<int>& a) {
        if(!f){
            pre();
            f = true;
        }
        int n = a.size();
        int mn = 1e6;
        int res = 0;
        for(int i = n - 1; i >= 0; i--){
            int x = a[i];
            while(x > mn){
                if(x == seive[x]){
                    return -1;
                }
                x = seive[x];
                res++;
            }
            mn = min(mn, x);
        }
        return res;
    }
};

class Solution {
