        int n = s.size();
        map<int, int> cnt;
        long long ans = (1 + n) * n / 2;
        for(int l = 0, r = 0;r < n;r++) {
            cnt[s[r]]++;
            while(cnt[s[r]] >= k) {
                --cnt[s[l++]];
            }
            ans -= r-l+1;
        }
