class Solution {
public:
    void z_value_pal(string &s,int len,vector<int>& z){
        len=(len<<1)+1;
        s.resize(s.size() * 2 + 1);
        for(int i=len-1;i>=0;i--)s[i]=i&1?s[i>>1]:'@';
        z.resize(s.size(), 0);
        z[0]=1;
        for(int i=1,l=0,r=0;i<len;i++){
            z[i]=i<r?min(z[l+l-i],r-i):1;
            while(i-z[i]>=0&&i+z[i]<len&&s[i-z[i]]==s[i+z[i]])++z[i];
            if(i+z[i]>r) l=i,r=i+z[i];
        } 
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        string tmp = s;
        vector<vector<int> > edge(n);
        for(int i=1;i<n;i++) {
            edge[parent[i]].push_back(i);
        }
        vector<int> children(n, 0), time(n);
        int cur_time = 0;
        for(int i=0;i<n;i++)sort(edge[i].begin(), edge[i].end());
        auto dfs = [&](auto &&dfs, int cur) -> void{
            if(edge[cur].empty()) {
                time[cur] = cur_time++;
                return;
            }
            for(int i=0;i<edge[cur].size();i++) {
                dfs(dfs, edge[cur][i]);
            }
            time[cur] = cur_time++;
        };
        dfs(dfs, 0);
        string r = "";
        vector<int> z;
        r.resize(n);
        for(int i=0;i<n;i++)r[time[i]] = tmp[i];
        z_value_pal(r, n, z);

        auto dfs1 = [&](auto &&dfs1, int cur) {
            if(edge[cur].empty()) {
                children[cur] = 1;
                return children[cur];
            }
            for(int i=0;i<edge[cur].size();i++) {
                children[cur] += dfs1(dfs1, edge[cur][i]);
            }
            children[cur]++;
            return children[cur];
        };
        dfs1(dfs1, 0);
        vector<bool> ans;
        for(int i=0;i<n;i++) {
            int left = time[i] - children[i] + 1;
            int right = time[i];
            left = left * 2 + 1;
            right = right * 2 + 1;
            int mid = (left + right) / 2;
            if(z[mid] * 2 - 1 >= right - left + 1)ans.push_back(true);
            else ans.push_back(false);
            // cout<<mid<<" ";
        }
        return ans;

    }
};
