class Solution {
public:

    void seive(int mx){
        primes.resize(mx, 0);
        p.resize(mx, -1);p[1] = 1;
        int sq = sqrt(mx);

        for(long long i=2;i<=sq;i++){
            if(!primes[i]){
                p[i] = i;
                for(long long k = i*i;k<mx;k+=i){
                    primes[k] = true;
                    if(p[k] == -1)p[k] = i;
                }
            }
        }
        if(sq&1)sq+=2;else sq++;
        for(int i=sq;i<mx;i++){
            if(!primes[i])p[i]=i;
        }
    }

    int minOperations(vector<int>& nums) {
        if(!s) {
            seive(1000000);
            s = true;

        }
        int n = nums.size();
        int prev = nums[n-1];
        int ans = 0;
        for(int i=n-2;i>=0;i--) {
            while(nums[i] > prev && p[nums[i]] != nums[i]) {
                nums[i] = p[nums[i]];
                ans++;
            }
            if(nums[i] > prev)return -1;
            prev = nums[i];
        }
        return ans;
    }
};

class Solution {
