        int res = 0;

        while (l < n) {
            int mx = *max_element(cnt.begin(), cnt.end());

            while (mx < k && r < n) {
                mx = max(mx, ++cnt[(int) s[r] - 'a']);
                r++;
            }

            if (mx < k) {
                break;
            }

            // cout << l << " " << r << " " << n << " " << k << "\n";

