class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = (int) nums.size();
        int mx = *max_element(nums.begin(), nums.end());
        vector<int> dp(mx + 1);
        iota(dp.begin(), dp.end(), 0);

        for (int i = 2; i * i <= mx; i++) {
            if (dp[i] != i) continue;

            for (int j = i * i; j <= mx; j += i) {
                if (dp[j] == j) {
                    dp[j] = i;
                }
            }
        }

        int res = 0;

        // for(int& i: dp) cout << i << " ";

        for (int i = n - 2; i >= 0; i--) {
            while (nums[i] > nums[i + 1]) {
                if (nums[i] == dp[nums[i]]) {
                    return -1;
                }

                nums[i] = dp[nums[i]];
                res++;
            }
        }

        return res;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
       int n = s.length();

        vector<int> s_num(n);
        for (int i = 0; i < n; ++i) {
            s_num[i] = s[i] - 'a';
        }

        vector<vector<int>> psas(26, vector<int>(n + 1, 0));
        for (int i = 0; i < 26; ++i) {
            for (int j = 0; j < n; ++j) {
                psas[i][j + 1] = psas[i][j] + (s_num[j] == i);
            }
        }

        int total = 0;

        for (int i = 0; i < n; ++i) {
            for (int j = i; j < n; ++j) {
                bool found = false;
                for (int c = 0; c < 26; ++c) {
                    if (psas[c][j + 1] - psas[c][i] >= k) {
                        found = true;
                        break;
                    }
                }
                if (found)
                    total++;
            }
        }

        return total; 
    }
};

