                current.back() = (current.back() == 'z') ? 'a' : current.back() + 1; 
                result.push_back(current); 
            }
        }

        return result;
    }
};

#define ll long long int
class RollingHash{
    public:
    int mod=1e9+7;
    int p=31,inv;
    vector<int> h,pw,invp;
    RollingHash(){
        inv = bin_pow(p,mod-2);
    }

    int hash(string &s) {
        ll ans = 0;
        int n = s.size();
        ll pw = 1;
        for (int i = 0; i < n; i++) {
            int val = (s[i] - 'a' + 1);
            ans = (ans + (pw * val) % mod) % mod;
            pw = (pw * p) % mod;
        }
        return ans;
    }

    void build(string &s){
        ll ans = 0;
        int n = s.size();
        h.resize(n);
        pw.resize(n);
        invp.resize(n);
        ll currPow = 1,currinv=1;
        for (int i = 0; i < n; i++){
            int val = (s[i] - 'a' + 1);
            ans = (ans + (currPow * val) % mod) % mod;
            pw[i]=currPow;
            invp[i]=currinv;
            currPow = (currPow * p) % mod;
            currinv = (currinv*inv)%mod;
            h[i] = ans;
        }
    }

    int qry(int l,int r){
        if (l == 0) return h[r];
        else {
            ll res = (h[r] - h[l-1] + mod) % mod; 
            return (1ll * res*invp[l])%mod;
        }
    }

    int bin_pow(int a, int b) {
        if (b == 0) return 1;
        int x = bin_pow(a, b / 2);
        x = (1ll * x * x) % mod; 
        if (b % 2 == 0) {
            return x;
        } else {
            return (1ll * x * a) % mod; 
        }
    }
};


class Solution {
public:
    vector<bool> findAnswer(vector<int>& par, string s) {
        int n = par.size();
        vector<vector<int>> adj(n);

        for(int i=0;i<n;i++){
            if(par[i]==-1)continue;
            adj[par[i]].push_back(i);
        }
        string res;

        for(int i=0;i<n;i++)sort(adj[i].begin(),adj[i].end());

        vector<int> size(n,1);
        function<void(int,string&)> dfs1 = [&](int node,string &res){
            for(auto ch:adj[node]){
                dfs1(ch,res);
                size[node]+=size[ch];
            }
            res.push_back(s[node]);
        };
        dfs1(0,res);

        RollingHash rh1,rh2;
        rh1.build(res);
        reverse(res.begin(),res.end());
        rh2.build(res);
        vector<bool> ans(n,false);
        function<void(int,int,int,int,int)> dfs2 = [&](int node,int l1,int r1,int l2,int r2){
            // cout<<node<<":"<<l1<<" "<<r1<<" "<<l2<<" "<<r2<<endl;
            int h1 = rh1.qry(l1,r1);
            int h2 = rh2.qry(l2,r2);
            ans[node]=(h1==h2);
            int crr = r2;
            int offset = 0;
            int off2 = 0;
            for(auto ch:adj[node]){
                int sz = size[ch];
                int cl1 = l1+offset,cr1=l1+sz+offset-1;
                int cr2 = r2-off2,cl2 = r2-off2-sz+1;  
                offset+=sz;
                off2+=sz;
                dfs2(ch,cl1,cr1,cl2,cr2);
            }
        };
        dfs2(0,0,n-1,0,n-1);
        return ans;
    }
};

class Solution {
public:


    int minOperations(vector<int>& nums) {
        int n = nums.size();
        int mx = *max_element(nums.begin(),nums.end());
        vector<int> sv(mx+1);
        for (int i = 1; i <= mx; ++i) sv[i] = 1; 
        for (int i = 2; i * i <= mx; ++i) {
            if (sv[i] == 1){ 
                for (int j = i+i;j<= mx; j += i){
                    if (sv[j] == 1){
                        sv[j] = i;
                    }
                }
            }
        }

        int ans = 0;
        for (int i = n - 2; i >= 0; --i){
            while (nums[i] > nums[i + 1]){
                int div = (nums[i]/sv[nums[i]]);
                if (div == nums[i]) return -1; 
                nums[i] /= div;
                ans++;
            }
        }

        return ans;
    }
};

class Solution {
public:
