        int res = 0;
        for (int i = 0; i < n; ++i) {
            int count[26] = {0};
            int validCount = 0;
            for (int j = i; j < n; ++j) {
                int idx = s[j] - 'a';
                count[idx]++;
                if (count[idx] == k) {
                    validCount++;
                }
                if (validCount >= 1) {
                    res++;
                }
            }
        }
        return res;
    }
};

