#define ll long long
const int prime = 887;
const int M = 1e9 + 7;

class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<bool> res(n, 0), vis(n, 0);
        vector<vector<int>> adj(n);
        for (int i = 1; i < n; i++) {
            adj[parent[i]].push_back(i);
        }

        vector<ll> pre(n + 2, 1);
        for (int i = 1; i <= n + 1; i++) {
            pre[i] = (pre[i - 1] * prime) % M;
        }
        vector<ll> vec, st;
        st.push_back(0);

        while (st.size()) {
            int u = st.back();
            if (vis[u]) {
                st.pop_back();
                vec.push_back(u);
            }
            else {
                vis[u] = 1;
                int m = adj[u].size();
                for (int i = m - 1; i >= 0; i--) {
                    st.push_back(adj[u][i]);
                }
            }
        }

        vector<ll> len(n, 0), hash1(n, 0), hash2(n, 0);
        for (auto& u : vec) {
            len[u] = 1;
            ll h1 = 0;
            for (auto& v : adj[u]) {
                h1 = (h1 * pre[len[v]] + hash1[v]) % M;
                len[u] += len[v];
            }
            h1 = (h1 * prime + (s[u] + 1 - 'a')) % M;
            hash1[u] = h1;

            ll h2 = (s[u] + 1 - 'a'), m = adj[u].size();
            for (int i = m - 1; i >= 0; i--) {
                h2 = (h2 * pre[len[adj[u][i]]] + hash2[adj[u][i]]) % M;
            }
            hash2[u] = h2;
            if(hash1[u] == hash2[u]) {
                res[u] = 1;
            }
        }
        return res;
    }
};

const int MAX_N = 1000010;

vector<bool> isp(MAX_N, 1);
vector<int> lp(MAX_N, 0);

void sieve_init(int n) {
    isp[0] = isp[1] = 0;
    for (int i = 2; i < n; i++) {
        if(isp[i]) {
            lp[i] = i;
            for (int j = 2 * i; j < n; j += i) {
                isp[j] = 0, lp[j] = (lp[j] == 0) ? i : lp[j];
            }
        }
    }
}

class Solution {
public:
    int minOperations(vector<int>& nums) {
        if(lp[25] == 0) {
            sieve_init(MAX_N);
        }
        int res = 0, n = nums.size();
        for (int i = n - 2; i >= 0; i--) {
            if(nums[i] <= nums[i + 1]) {
                nums[i + 1] = nums[i];
            }
            else {
                while(lp[nums[i]] > 1 && nums[i] / lp[nums[i]] > 1 && nums[i] > nums[i + 1]) {
                    res++, nums[i] /= (nums[i] / lp[nums[i]]);
                }
                if(nums[i] > nums[i + 1]) {
                    return -1;
                }
                else {
                    nums[i + 1] = nums[i];
                }
            }
        }
        return res;
    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        res, n = 0, len(s)
        for i in range(n):
            cnt = [0]*26
            flag = False
            for j in range(i, n):
                idx = ord(s[j])-97
                cnt[idx] +=1
                if not flag and cnt[idx] >=k:
                    flag = True
                if flag:
                    res +=1
        return res

impl Solution {
    pub fn min_operations(nums: Vec<i32>) -> i32 {
        if nums.is_empty() {
            return 0;
        }

        let n = *nums.iter().max().unwrap() as usize;
        let mut spf: Vec<usize> = (0..=n).collect();
        let sqrt_n = (n as f64).sqrt() as usize;
        for i in 2..=sqrt_n {
            if spf[i] == i {
                let mut j = i * 2;
                while j <= n {
                    if spf[j] == j {
                        spf[j] = i;
                    }
                    j += i;
                }
            }
        }

        let mut total = 0;
        let mut t = nums[nums.len() - 1] as usize;

        // Process array from right to left (excluding last element)
        for &num in nums.iter().rev().skip(1) {
            let num = num as usize;
            if num <= t {
                t = num;
                continue;
            }

            if num == spf[num] {
                return -1;
            }

            let dec = spf[num];
            if dec <= t {
                total += 1;
                t = dec;
            } else {
                return -1;
            }
        }

        total
    }
}

