typedef vector<int> vi;
typedef pair<int,int> pii;
typedef vector<pii> vpii;

class Solution {
public:
    int n;
    string s;
    string s2;
    vi ix;
    vector<vector<int>> child;
    vi lef;

    int dfs(int x) {
        lef[x] = -1;
        for (auto &y: child[x]) {
            int tmp = dfs(y);
            if (lef[x] == -1) lef[x] = tmp;
        }
        if (lef[x] == -1) lef[x] = n;
        ix[x] = n++;
        s += s2[x];
        return lef[x];
    }
    void z_function(string &s, vi &z) {
        int n = s.size();
        int l = 0, r = 0;
        z[0] = 0;
        for(int i = 1; i < n; i++) {
            if(i < r) {
                z[i] = min(r - i, z[i - l]);
            } else {
                z[i] = 0;
            }
            while(i + z[i] < n && s[z[i]] == s[i + z[i]]) {
                z[i]++;
            }
            if(i + z[i] > r) {
                l = i;
                r = i + z[i];
            }
        }
    }
    vector<bool> findAnswer(vector<int>& p, string sIn) {
        s2 = sIn;
        n = p.size();
        child.resize(n);
        ix.resize(n);
        lef.resize(n);

        for (int i = 0; i < n; i++) {
            if (p[i] >= 0) {
                child[p[i]].push_back(i);
            }
        }
        n = 0;
        dfs(0);
        /*
        cout << s << endl;
        for (int i = 0; i < n; i++) {
            printf("%d lef %d ix %d\n", i, lef[i], ix[i]);
        }
        */
        vector<bool> ret(n, true);
        vector<vpii> queries(n);
        vector<int> rb(n);
        for (int i = 0; i < n; i++) {
            int j = lef[i];
            int k = ix[i];
            if (k > j) {
                queries[j].push_back(pii(k-j+1, i));
                rb[j] = max(rb[j], k-j+1);
            }
        }
        vector<int> z(2*n);
        for (int i = 0; i < n; i++) {
            if (queries[i].size() > 0) {
                string s3 = s.substr(i, rb[i]);
                string s4 = s3;
                int len2 = s3.length();
                reverse(s4.begin(), s4.end());
                s3 += s4;
                z_function(s3, z);

                for (auto &p: queries[i]) {
                    int len = p.first;
                    int q = p.second;
                    if (z[2*len2-len] < len) ret[q] = false;
                }
            }
        }
        return ret;
    }
};

class Solution {
public:
    int minOperations(vector<int>& a) {
        int n = a.size();
        int prev = a.back();
        int ret = 0;
        for (int i = n-2; i >= 0; i--) {
            if (a[i] <= prev) {
                prev = a[i];
                continue;
            }

            int j;
            for (j = 2; j*j <= a[i]; j++) {
                if (a[i] % j == 0) break;
            }

            if (a[i] % j == 0) {
                a[i] = j;
                ret++;
            }

            if (a[i] > prev) return -1;
            prev = a[i];
        }
        return ret;
    }
};

