using ll = long long;
const int p1 = 31, p2 = 97, N = 100008;
const ll mod = 1e9+7;
ll _pow1[N], _pow2[N];
class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<vector<int>>adj(n);
        for(int i = 0; i < n; i++){
            if(parent[i] == -1)continue;
            adj[parent[i]].push_back(i);
            adj[i].push_back(parent[i]);
        }
        for(int i = 0; i < n; i++){
            vector<int>&v = adj[i];
            sort(v.begin(), v.end());
        }
        if(_pow1[0] == 0){
            _pow1[0] = _pow2[0] = 1;
            for(int i = 1; i < N; i++){
                _pow1[i] = (1LL*_pow1[i-1]*p1) % mod;
                _pow2[i] = (1LL*_pow2[i-1]*p2) % mod;
            }
        }
        vector<pair<ll, ll>>leftHash(n), rightHash(n);
        vector<int>siz(n, 0);
        auto siz_dfs = [&](int v, int fa, auto &&siz_dfs) -> int{
            for(auto u: adj[v]){
                if(u == fa)continue;
                siz[v] += siz_dfs(u, v, siz_dfs);
            }
            siz[v] += 1;
            return siz[v];
        };
        siz_dfs(0, -1, siz_dfs);
        // for(auto z: siz)cout<<z<<" ";cout<<'\n';
        auto dfs = [&](int v, int fa, vector<pair<ll, ll>>&hash, auto &&dfs) -> pair<ll, ll>{
            ll hash1 = 0, hash2 = 0;
            for(auto u: adj[v]){
                if(u == fa){
                    continue;
                }
                pair<ll, ll> chash = dfs(u, v, hash, dfs);
                hash1 = (hash1*_pow1[siz[u]])%mod + chash.first;
                hash2 = (hash2*_pow2[siz[u]])%mod + chash.second;
                hash1 %= mod; hash2 %= mod;
            }
            hash1 = hash1*p1 + (s[v]-'a');
            hash2 = hash2*p2 + (s[v]-'a');
            hash1 %= mod;
            hash2 %= mod;
            hash[v] = {hash1, hash2};
            return hash[v];
        };
        dfs(0, -1, leftHash, dfs);
        for(int i = 0; i < n; i++){
            reverse(adj[i].begin(), adj[i].end());
        }
        auto dfs2 = [&](int v, int fa, vector<pair<ll, ll>>&hash, auto &&dfs2) -> pair<ll, ll>{
            ll hash1 = ll(s[v]-'a'), hash2 = ll(s[v]-'a');
            for(auto u: adj[v]){
                if(u == fa){
                    continue;
                }
                pair<ll, ll> chash = dfs2(u, v, hash, dfs2);
                hash1 = (hash1*_pow1[siz[u]])%mod + chash.first;
                hash2 = (hash2*_pow2[siz[u]])%mod + chash.second;
                hash1 %= mod; hash2 %= mod;
            }
            hash[v] = {hash1, hash2};
            return hash[v];
        };
        dfs2(0, -1, rightHash, dfs2);
        vector<bool>ans(n, false);
        for(int i = 0; i < n; i++){
            if(leftHash[i].first == rightHash[i].first){
                if(leftHash[i].second == rightHash[i].second){
                    ans[i] = true;
                }
            }
        }
        return ans;
    }
};

const int N = 1000008;
int divi[N];
class Solution {
public:
    int minOperations(vector<int>& nums) {
        if(divi[4] == 0){
            for(int i = 2; i < N; i++){
                for(int j = 2*i; j < N; j+=i){
                    divi[j] = i;
                }
            }
        }
        int n = nums.size();
        int cost = 0, p = sqrt(N) + 1;
        for(int j = 0; j < p; j++){
            for(int i = n-2; i >= 0; i--){
                if(nums[i] > nums[i+1]){
                    if(divi[nums[i]] != 0){
                        cost++;
                        nums[i] = nums[i]/divi[nums[i]];
                    } else{
                        return -1;
                    }
                }
            }
        }
        // for(auto z: nums)cout<<z<<" ";cout<<'\n';
        for(int i = 1; i < n; i++){
            if(nums[i] < nums[i-1])return -1;
        }
        return cost;
    }
};

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int ans = 0;
        int n = s.length();
        int i = 0; 
        int j = 0;
        char[] ch = s.toCharArray();
        int[] a = new int[26];
        while(j < n) {
            a[ch[j] - 'a']++;
            while(i < n && isv(a, k)) {
                ans += n - j;
                a[ch[i] - 'a']--;
                i++;
            }
            j++;
        }
        return ans;
    }

    boolean isv(int[] a, int k) {
        for(int i : a) {
            if(i >= k) {
                return true;
            }
        }
        return false;
    }
}

