class Solution {
      List<List<Integer>> list;
      List<int[]> idx = new ArrayList<>();

      public boolean[] findAnswer(int[] parent, String s) {
        int n = parent.length;
        boolean[] ans = new boolean[n];
        char[] ch = s.toCharArray();

        idx = new ArrayList<>();
        for (int i = 0; i < n; i++) {
          idx.add(new int[2]);
        }

        list = buildUndirAdjListParent(n, parent);
        for (List<Integer> l : list) {
          Collections.sort(l);
        }

        // u.db(list);
        StringBuilder sb = new StringBuilder();
        dfs(0, -1, ch, sb);
        // u.db(sb);

        // for (int[] x : idx) {
        // u.pa(x);
        // }

        Arrays.fill(ans, true);
        build(ans, sb.toString(), 256, 1000_000_007);
        build(ans, sb.toString(), 257, 998244353);
        return ans;
      }

      void build(boolean[] ans, String s, long R, int MOD) {
        int n = s.length();
        String rev = new StringBuilder(s).reverse().toString();
        // u.prln(s + " " + rev);

        RangeHash r1 = new RangeHash(s, R, MOD);
        RangeHash r2 = new RangeHash(rev, R, MOD);

        for (int i = 0; i < n; i++) {
          int st = idx.get(i)[0];
          int ed = idx.get(i)[1] - 1;
        //   u.prln(st + " " + ed);

          int e2 = n - st - 1;
          int s2 = n - ed - 1;

        //   u.prln(s2 + " " + e2);

          long h1 = r1.rangehash(st, ed);
          long h2 = r2.rangehash(s2, e2);
          ans[i] = ans[i] && (h1 == h2);
        }
      }

      public class RangeHash {
        long R;
        int MOD;
        long[] base;
        long[] hash;
        String s;
        int n;

        public RangeHash(String s, long R, int MOD) {
          this.R = R;
          this.MOD = MOD;
          this.s = s;
          this.n = s.length();
          this.base = new long[n + 1];
          this.hash = new long[n + 1];
          build();
        }

        void build() {
          base[0] = 1;
          for (int i = 1; i <= n; i++) {
            base[i] = (base[i - 1] * R) % MOD;
            hash[i] = ((hash[i - 1] * R) % MOD + s.charAt(i - 1)) % MOD;
          }
        }

        long rangehash(int i, int j) {
          long ans = (hash[j + 1] - (hash[i] * base[j - i + 1]) % MOD + MOD) % MOD;
          ans = ans % MOD;
          return ans;
        }
      }

      void dfs(int c, int p, char[] ch, StringBuilder sb) {
        int st = sb.length();
        for (int e : list.get(c)) {
          if (e == p) {
            continue;
          }
          dfs(e, c, ch, sb);
        }

        // u.db(c);
        sb.append(ch[c]);
        int ed = sb.length();
        // u.db(c+" "+st+" "+ed);
        idx.set(c, new int[] { st, ed });
      }

      public List<List<Integer>> buildUndirAdjListParent(int n, int[] p) {
        List<List<Integer>> adjlist = new ArrayList<>();
        for (int i = 0; i < n; i++) {
          adjlist.add(new ArrayList<>());
        }

        for (int i = 1; i < n; i++) {
          int a = i;
          int b = p[i];

          adjlist.get(a).add(b);
          adjlist.get(b).add(a);
        }

        return adjlist;
      }
    }

class Solution {
    int MAX = 1000000;

    public int minOperations(int[] nums) {
        int n = nums.length;
        int[] spf = spf(MAX);

        int ans = 0;
        for (int i = n - 2; i >= 0; i--) {
            while (nums[i] > nums[i + 1] && spf[nums[i]] > 1 && spf[nums[i]] < nums[i]) {
                nums[i] = spf[nums[i]];
                ans++;
            }
            if (nums[i] > nums[i + 1]) {
                return -1;
            }
        }
        return ans;
    }

    int[] spf(int n) {
        int[] spf = new int[n + 1];
        Arrays.setAll(spf, i -> i);

        long i = 2;
        while (i * i <= n) {
          // then its prime
          // else its composite factor
          if (spf[(int) i] == i) {
            long j = i * i;
            while (j <= n) {
              if (spf[(int) j] == j) {
                spf[(int) j] = (int) i;
              }
              j += i;
            }
          }
          i = i + 1;
        }

        // for (int k = 2; k < n; k++) {
        //   u.prln(k + " " + spf[k]);
        // }
        return spf;
      }
}

