#define vi vector <ll>
#define vvi vector <vector <ll>>
#define pll pair<ll, ll>

using namespace std;

typedef long long ll;

class Solution {
    vector <bool> ans;
    vvi v;
    ll M = 1e9 + 7, p1 = 31;
    vector <pll> a, b;
    string s;
    vi used, pow;
    ll n;

    ll help(vector <pll> v){
        ll ans = 0, s = 0;

        for(auto & e : v){
            ans = (ans + pow[s] * e.first) % M;
            s += e.second;
        }
        return ans;
    }

    ll dfs(ll x){
        used[x] = 1;
        vector <pll> aa, bb;
        ll cnt = 1;
        ll x1 = 0, ss = 0;
        bb.pb({s[x] - 'a' + 1, 1});

        for(auto & e : v[x]){
            if(used[e] == 1)
                continue;

            cnt += dfs(e);
            x1  = (x1 + pow[ss] * a[e].first) % M;
            ss += a[e].second;
            bb.pb(b[e]);
        }

        x1 = (x1 + pow[ss] * (s[x] - 'a' + 1)) % M;
        reverse(bb.begin() + 1, bb.end());

        ll x2 = help(bb);

        if(x1 == x2)
            ans[x] = true;
        else
            ans[x] = false;

        a[x] = {x1, cnt};
        b[x] = {x2, cnt};

        return cnt;
    }
public:
    vector<bool> findAnswer(vector<int>& p, string ss) {
        ll n = p.size();
        s = ss;
        v = vvi (n);
        used = vi (n, 0);
        a = b = vector <pll> (n);
        ans = vector <bool> (n);
        pow.pb(1);

        for(ll i = 1; i < n; i++){
            pow.pb((pow.back() * p1) % M);
            v[i].pb(p[i]);
            v[p[i]].pb(i);
        }

        for(ll i = 0; i < n; i++)
            sort(all(v[i]));

        dfs(0);
        return ans;
    }
};

