using namespace std;

typedef int ll;

class Solution {

    ll help(ll x){
        for(ll i = 2; i * i <= x; i++){
            if(x % i == 0)
                return x / i;
        }
        return -1;
    }
public:
    int minOperations(vector<int>& v) {
        ll ans = 0;
        ll n = v.size();
        vi used(1e6 + 1, -1);
        ll last = v[n - 1];

        for(ll i = n - 2; i >= 0; i--){
            if(v[i] <= last){
                last = v[i];
                continue;
            }

            ll x = v[i];
            while(x > last){
                if(used[x] == -1)
                    used[x] = help(x);

                if(used[x] == -1)
                    return -1;

                x = x / used[x];

                ans++;
            }

            last = x;
        }

        return ans;
    }
};

