class Solution {
    void sol4(vector<int>& parent, vector<list<int>>& b) {
        for (int i = 1; i < parent.size(); i++) {
            b[parent[i]].push_back(i);
        }
    }
    vector<long> sol3(int n) {
        long p = 911;
        long mod = 1000000007;
        vector<long> a(n + 2);
        a[0] = 1;
        for (int i = 1; i <= n + 1; i++) {
            a[i] = (a[i - 1] * p) % mod;
        }
        return a;
    }
    vector<int> sol2(vector<list<int>>& b, int n) {
        vector<int> a;
        stack<int> c;
        vector<bool> d(n);
        c.push(0);
        while (!c.empty()) {
            int e = c.top();
            if (!d[e]) {
                d[e] = true;
                for (auto it = b[e].rbegin(); it != b[e].rend(); ++it) {
                    c.push(*it);
                }
            } else {
                c.pop();
                a.push_back(e);
            }
        }
        return a;
    }
    void sol(vector<int>& d, vector<list<int>>& b, string& s, vector<long>& c, vector<int>& e, vector<long>& f, vector<long>& g, vector<bool>& a) {
        long mod = 1000000007;
        for (int h : d) {
            e[h] = 1;
            long j = 0;
            for (int k : b[h]) {
                j = (j * c[e[k]] + f[k]) % mod;
                e[h] += e[k];
            }
            j = (j * 911 + (s[h] - 'a' + 1)) % mod;
            f[h] = j;
            long m = (s[h] - 'a' + 1);
            for (auto it = b[h].rbegin(); it != b[h].rend(); ++it) {
                int k = *it;
                m = (m * c[e[k]] + g[k]) % mod;
            }
            g[h] = m;

            a[h] = (f[h] == g[h]);
        }
    }
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<bool> a(n);
        vector<list<int>> b(n);
        sol4(parent, b);
        vector<long> c = sol3(n);
        vector<int> d = sol2(b, n);
        vector<int> e(n);
        vector<long> f(n);
        vector<long> g(n);
        sol(d, b, s, c, e, f, g, a);
        return a;
    }
};

