class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        int ans = 0;
        for (int i = 0; i < n; i++) {
            map<char, int> cnt;
            bool ok = false;
            for (int j = i; j < n; j++) {
                if (ok) {
                    ans++;
                    continue;
                }
                cnt[s[j]]++;
                if (cnt[s[j]] >= k) {
                    ans++;
                    ok = true;
                }
            }
        }
        return ans;
    }
};

