        int RR=0;vector<array<int,26>>C(1);
        for(auto c:s){C.push_back(C.back());++C.back()[c-'a'];}
        for(int l=0;l<=s.size();++l)for(int r=l;++r<=s.size();){
            for(int c=0;c<26;++c)if(C[r][c]-C[l][c]>=k){++RR;break;}
        }
        return RR;
    }
};

