class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans = 0;
        int n = s.length();
        for(int i = 0; i < n; i++) {
            int maxn = 0;
            vector <int> freq(26);
            for(int j = i; j < n; j++) {
                freq[s[j] - 'a'] += 1;
                maxn = max(maxn, freq[s[j] - 'a']);
                if (maxn >= k) {
                    ans += 1;
                }
            }
        }
        return ans;
    }
};

class Solution {
public:
