        string s;
        int idx = 0;
        vector <string> fin;
        while (s != target) {
            string cpy = s;
            for(char i = 'a'; i <= target[idx]; i++) {
                string temp = cpy;
                temp.push_back(i);
                fin.push_back(temp);
            }
            s.push_back(target[idx]);
            idx += 1;
        }
        return fin;
    }
};

