class Solution {
public:
    int minOperations(vector<int>& nums) {
      if (!flag) {
        compute();
        flag = true;
      }

      ll n = siz(nums);
      ll ans = INF;

      vector <vector <ll>> nums2;
      vector <vector <ll>> dp;

      for(ll i = 0; i < n; i++) {
        ll mem = nums[i];
        //print(mem, divi[mem]);
        vector <ll> temp, temp2;
        while (divi[mem] != -1) {
          temp.pb(mem);
          mem /= divi[mem];
        }

        temp.pb(mem);
        //print(temp);
        nums2.pb(temp);
        temp2.resize(siz(temp), INF);
        dp.pb(temp2);
      }

      for(ll i = 0; i < siz(dp[0]); i++) {
        dp[0][i] = i;
      }

      for(ll i = 0; i < n - 1; i++) {
        bool temp = false;
        for(ll j = 0; j < siz(dp[i]); j++) {
          for(ll k = 0; k < siz(dp[i + 1]); k++) {
            if (nums2[i][j] <= nums2[i + 1][k]) {
              temp = true;
              dp[i + 1][k] = min(dp[i + 1][k], dp[i][j] + k);
            }
          }
        }
        if (!temp) {
          return -1;
        }
      }

      for(ll i = 0; i < siz(dp[n - 1]); i++) {
        ans = min(ans, dp[n - 1][i]);
      }
      if (ans == INF) {
        ans = -1;
      }
      return (int)ans;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        vector<int> freq(26, 0);
        int ret = 0;
        for (int i=0;i<n;++i) {
            fill(freq.begin(), freq.end(), 0);
            bool ok = false;
            for (int j=i;j<n;++j) {
                freq[s[j]-'a'] += 1;
                ok |= freq[s[j]-'a'] >= k;
                ret += ok;
            }
        }
        return ret;
    }
};

