class Solution {
public:
    vector<int> manacher(string s) {
        int n = s.size();
        vector<int> go(2 * n + 1, 0);
        string t = "#";
        for (auto c : s) {
            t += c;
            t += '#';
        }
        go[0] = 0;
        n = t.size();
        int center = 0, r = 0;
        for (int i=1;i<n;++i) {
            int offset = (i - center);
            int ir = center - offset;
            int match = min(r - i, (ir >= 0 ? go[ir] : 0));
            while (i + match + 1 < n && i >= match + 1 && t[i + match + 1] == t[i - match - 1]) {
                ++match;
            }
            go[i] = match;
            if (r < i + match) {
                r = i + match;
                center = i;
            }
        }
        // cout << t << '\n';
        return go;
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = parent.size();
        vector<vector<int> > g(n);
        for (int i=1;i<n;++i) {
            int j = parent[i];
            g[j].push_back(i);
        }
        for (int i=0;i<n;++i) if (!g[i].empty()) {
            sort(g[i].begin(), g[i].end());
        }
        vector<bool> ret(n, false);
        string dfsStr = "";
        vector<int> sub(n, 0), dfs_in(n, 0);
        dfs_in[0] = 0;
        std::function<void(int)> dfs = [&](int u) {
            sub[u] += 1;
            int cur = 0;
            for (auto &v : g[u]) {
                dfs_in[v] = dfs_in[u] + cur;
                dfs(v);
                cur += sub[v];
            }
            sub[u] += cur;
            dfsStr += s[u];
        };
        dfs(0);

        auto go = manacher(dfsStr);
        auto isPalin = [&](int ell, int arr) {
            int sz = arr - ell + 1;
            if (sz & 1) {
                int mid = (ell + arr) >> 1;
                int ind = 2 * mid + 1, lim = 2 * arr + 1;
                return ind + go[ind] >= lim;
            } else {
                int ind = ell + arr + 1;
                int lim = 2 * arr + 1;
                return ind + go[ind] >= lim;
            }
        };
        // "abcba"

        for (int i=0;i<n;++i) {
            int ell = dfs_in[i], arr = dfs_in[i] + sub[i] - 1;
            // cout << ell << "," << arr << '\n';
            ret[i] = isPalin(ell, arr);
        }
        return ret;
    }
};

const int N = (int)1e6 + 5;
class Solution {
    int sp[N];
public:
    void computeSP(int M) {
        for (int i=1;i<M;++i) sp[i] = i;
        for (int i=2;i*1LL*i<M;++i) if (sp[i] == i) {
            for (long long j=i*1LL*i;j<N;j+=i) {
                sp[j] = min(sp[j], i);
            }
        }
    }
    int minOperations(vector<int>& v) {
        int n = v.size();
        int mx = 0;
        for (auto &x : v) mx = max(mx, x);
        computeSP(mx + 3);
        vector<vector<int> > dp(2, vector<int>(n, (int)1e9));
        dp[0][0] = 0;
        dp[1][0] = 1;
        for (int i=1;i<n;++i) {
            if (v[i-1] <= v[i]) {
                dp[0][i] = min(dp[0][i], dp[0][i-1]);
            }
            if (sp[v[i-1]] <= v[i]) {
                dp[0][i] = min(dp[0][i], dp[1][i-1]);
            }
            if (v[i-1] <= sp[v[i]]) {
                dp[1][i] = min(dp[1][i], dp[0][i-1] + 1);
            }
            if (sp[v[i-1]] <= sp[v[i]]) {
                dp[1][i] = min(dp[1][i], dp[1][i-1] + 1);
            }
        }
        int go = min(dp[0][n-1], dp[1][n-1]);
        if (go > n) go = -1;
        return go;
    }
};

