class Solution {
public:
    #define ll long long
    const ll m=1e9+7;
    void find(string temp,vector<ll> &h1,vector<ll> &h2){
        ll p=1;
        ll n=temp.size();
        for(int i=0;i<n;i++){
            if(i==0){
                h1[i]=temp[i]-'a'+1;
            }
            else{
                h1[i]=(h1[i-1]+(temp[i]-'a'+1)*p)%m;
            }
            p*=31;
            p%=m;
        }
        reverse(temp.begin(),temp.end());
        p=1;
        for(int i=0;i<n;i++){
            if(i==0){
                h2[i]=temp[i]-'a'+1;
            }
            else{
                h2[i]=(h2[i-1]+(temp[i]-'a'+1)*p)%m;
            }
            p*=31;
            p%=m;
        }
        reverse(h2.begin(),h2.end());
    }

    ll binexp(ll a,ll b){
        ll ans=1;
        while(b){
            if(b&1){
                ans*=a;
                ans%=m;
            }
            a*=a;
            a%=m;
            b>>=1;
        }
        return ans;
    }
    vector<bool> findAnswer(vector<int>& p, string s) {
        int n=p.size();
        vector<int> g[n];
        for(int i=1;i<n;i++){
            g[p[i]].push_back(i);
        }
        vector<int> sub(n,1);
        vector<int> path;
        string a;
        function<void(int)> dfs=[&](int i){
            for(auto &ch:g[i]){
                dfs(ch);
                sub[i]+=sub[ch];
            }
            path.push_back(i);
            a.push_back(s[i]);
        };
        dfs(0);
        reverse(path.begin(),path.end());
        reverse(a.begin(),a.end());
        vector<ll> h1(n),h2(n);
        find(a,h1,h2);
        vector<ll> inv(n);
        ll pow=1;
        for(int i=0;i<n;i++){
            inv[i]=binexp(pow,m-2);
            pow*=31;
            pow%=m;
        }
        vector<bool> q(n);
        for(int i=0;i<n;i++){
            ll x=((h1[i+sub[path[i]]-1]-h1[i]+m)%m)*inv[i];
            x%=m;
            ll y=((h2[i]-h2[i+sub[path[i]]-1]+m)%m)*inv[(n-i-sub[path[i]])];
            y%=m;
            q[path[i]]=(x==y);
        }
        return q;
    }
};

