class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size(), res = 0;
        vector<int> freq[26];
        for (int i = 0; i < 26; i++)
            freq[i].resize(n, 0);
        for (int i = 0; i < n; i++) {
            freq[s[i] - 'a'][i] = 1;
            if (i)
                for (int j = 0; j < 26; j++)
                    freq[j][i] += freq[j][i - 1];
        }
        for (int i = 0; i < n; i++) {
            int l = i, r = n - 1, opt = n;
            while (l <= r) {
                int mid = (l + r) / 2, currfreq[26] = {};
                for (int j = 0; j < 26; j++)
                    currfreq[j] = freq[j][mid] - (i ? freq[j][i - 1] : 0);
                if (*max_element(currfreq, currfreq + 26) >= k) {
                    opt = mid;
                    r = mid - 1;
                }
                else
                    l = mid + 1;
            }
            res += n - opt;
        }
        return res;
    }
};

