    //         gpd[i] = max(gpd[i], j);
    //       }
    //     }
    //   }
    // }
    // cout << gpd[1] << " " << gpd[57];
    map<int,int> mp;
    int cnt = 0, n = nums.size();
    for (int i = n - 1; i > 0; i--) {
      if(nums[i] >= nums[i-1]) continue;
      // cout << nums[i] << nums[i-1];
      while(nums[i] < nums[i-1]){
        int div = 1;
        if(mp[nums[i-1]] != 0){
          div = mp[nums[i-1]];
        }
        else{
          div = lpd(nums[i-1]);
          mp[nums[i-1]] = div;

        }
        if(div == 1)  return -1;
        nums[i-1] = nums[i-1] / div;
        cnt++;
      }
    }
    return cnt;
  }
};

