class Solution {
    private char[] str;
    private char[] ss;
    private int[] start;
    private List<Integer>[] graph;
    private int ind = 0;
    private int[] end;

    private long[] hash;
    private long[] power;
    private long[] hash1;
    private long[] power1;
    private char[] str1;
    private final static int MOD = (int)1e9+7;
    private final static int P = 31;

    public boolean[] findAnswer(int[] parent, String s) {
        int n = parent.length;
        if (n == 1) return new boolean[]{true};

        str = new char[n];
        start = new int[n];
        ss = s.toCharArray();
        end = new int[n];
        hash = new long[n+1];
        power = new long[n+1];

        hash1 = new long[n+1];
        power1 = new long[n+1];

        graph = graphBuilder(parent);
        dfs(0);

        // System.out.println(Arrays.toString(str));
        // System.out.println(Arrays.toString(start));
        // System.out.println(Arrays.toString(end));
        buildHash();

        str1 = new char[n];
        for (int i = 0; i < n ;i++) str1[i] = str[i];
        for (int i = 0; i < n/2; i++) {
            char temp = str1[i];
            str1[i] = str1[n-1-i];
            str1[n-1-i] = temp;
        }
        buildHash1();

        boolean[] res = new boolean[n];
        for (int i = 0; i < n; i++) {
            int sT = start[i], eN = end[i];
            res[i] = (getHash(sT, eN, hash, power) == getHash(n-1-eN, n-1-sT, hash1, power1)) ? true : false;
        }
        return res;
    }

    private void buildHash() {
        int n = str.length;
        power[0] = 1L;
        for (int i = 1; i < n+1; i++) {
            int ch = str[i-1] - 'a' + 1;
            hash[i] = (hash[i-1] * P + ch) % MOD;
            power[i] = (power[i-1] * P) % MOD;
        }
    }

    private void buildHash1() {
        int n = str.length;
        power1[0] = 1L;
        for (int i = 1; i < n+1; i++) {
            int ch = str1[i-1] - 'a' + 1;
            hash1[i] = (hash1[i-1] * P + ch) % MOD;
            power1[i] = (power1[i-1] * P) % MOD;
        }
    }

    private long getHash(int l, int r, long[] hash, long[] power) {
        return (hash[r+1] - (hash[l] * power[r-l+1]) % MOD + MOD) % MOD;
    }

    private void dfs(int node) {
        if (graph[node].size() == 0) {
            start[node] = ind;
            str[ind] = ss[node];
            end[node] = ind;
            ind++;
            return;
        }

        start[node] = Integer.MAX_VALUE;
        for (int nex : graph[node]) {
            dfs(nex);
            start[node] = Math.min(start[node], start[nex]);
        }
        str[ind] = ss[node];
        end[node] = ind;
        ind++;
    }

    private List<Integer>[] graphBuilder(int[] parent) {
        int n = parent.length;
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) graph[i] = new ArrayList<Integer>();

        for (int i = 1; i < n; i++) {
            int p = parent[i];
            graph[p].add(i);
        }
        for (int i = 0; i < n; i++) Collections.sort(graph[i]);
        return graph;
    }
}

class Solution {
    public int minOperations(int[] nums) {
        if (nums.length == 1) return 0;

        int res = 0;
        for (int i = nums.length - 2; i >= 0; i--) {
            if (nums[i] > nums[i+1]) {
                for (int j = 2; j * j <= nums[i]; j++) {
                    if (nums[i] % j == 0) {
                        nums[i] = j;
                        res++;
                        break;
                    }
                }
                if (nums[i] > nums[i+1]) return -1;
            }
        }

        return res;
    }
}

