class Solution:
    def max_proper_divisor(self, x: int) -> int:
        for i in range(2, int(x**0.5) + 1):
            if x % i == 0:
                return x // i
        return 1

    def minOperations(self, nums: List[int]) -> int:
        n = len(nums)
        operations = 0

        for i in range(n - 2, -1, -1):
            while nums[i] > nums[i + 1]:
                divisor = self.max_proper_divisor(nums[i])
                if divisor == 1:
                    return -1
                nums[i] //= divisor 
                operations += 1

        return operations

