        for(int i=0;i<n;i++)
        {
            while(j<n and maxCount<k)
            {
                int x=s[j]-'a';
                cnts[x]++;
                j++;
                maxCount=max(maxCount,cnts[x]);
            }

            if(maxCount==k)
            {
                ans+=n+1-j;
            }

            int x=s[i]-'a';
