        int n = nums.size();
        vector<int> p(1e6+1,1);
        for(int i=2;i<=1e3;i++){
            if(p[i]!=1) continue;
            for(int j =2;j*i<=1e6;j++){
                if(p[i*j]!=1) continue;
                p[i*j] = j;
            }
        }
        int ans  =0;
        for(int  i= n-2;i>-1;i--){
            while(nums[i]>nums[i+1]){
                if(p[nums[i]]==1) return -1;
                nums[i]/= p[nums[i]];
                ans++;
            }
        }
        return ans;
    }
};

