class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string_view s) {
        using mod = modarith::mod61;
        using type = mod::type;
        const unsigned n = parent.size();
        struct rec {
            type fh = 0;
            type rh = 0;
            unsigned nc = 0;
            unsigned sz = 1;
        };
        uniform_int_distribution<type> dist(31, mod::modulo - 2);
        random_device rng {};
        const type hpow = dist(rng) | 1;
        vector<type> pows(n + 1);
        {
            type pow = 1;
            for (unsigned i = 0; i <= n; ++i, pow = mod::mul(pow, hpow)) {
                pows[i] = pow;
            }
        }
        vector<rec> g(n);
        vector<vector<unsigned>> adj(n);
        for (unsigned i = 1; i < n; ++i) {
            g[parent[i]].nc++;
            adj[parent[i]].push_back(i);
        }
        deque<unsigned> q;
        for (unsigned i = 0; i < n; ++i) {
            if (g[i].nc == 0)
                q.emplace_back(i);
        }
        while(!q.empty()) {
            auto u = q.front();
            q.pop_front();
            type fh = 0;
            type rh = 0;
            unsigned p = 0;
            for (auto v: adj[u]) {
                fh = mod::add(fh, mod::mul(g[v].fh, pows[p]));
                p += g[v].sz;
            }
            fh = mod::add(fh, mod::mul(s[u] - 'a' + 1, pows[p++]));
            rh = s[u] - 'a' + 1;
            p = 1;
            for (unsigned j = adj[u].size(); j--; ) {
                auto v = adj[u][j];
                rh = mod::add(rh, mod::mul(g[v].rh, pows[p]));
                p += g[v].sz;
            }
            g[u].sz = p;
            g[u].rh = rh;
            g[u].fh = fh;
            auto v = parent[u];
            if (v == -1)
                break;
            g[v].sz += g[u].sz + 1;
            if (--g[v].nc == 0) {
                q.emplace_back(v);
            }
        }
        vector<bool> ret(n);
        for (unsigned i = 0; i < n; ++i) {
            ret[i] = g[i].fh == g[i].rh;
        }
        return ret;
    }
};

class Solution {
public:
    int minOperations(vector<int>& nums) {
        const unsigned n = nums.size();
        int next = INT_MAX;
        vector<int> cache;
        int ret = 0;
        for (unsigned i = n; i--; ) {
            auto cur = nums[i];
            while (cur > next) {
                if (cur >= cache.size())
                    cache.resize(cur + 1);
                if (!cache[cur]) {
                    //cout << cur << '>';
                    for (unsigned step = (cur & 1 ? 2 : 1), v = 1 + step; v*v <= cur; v += step) {
                        //cout << '?' << v << ' ';
                        if (cur % v == 0) {
                            cache[cur] = v;
                            break;
                        }
                    }
                    //cout << cache[cur] << endl;
                    if (!cache[cur])
                        return -1;
                }
                cur = cache[cur];
                ++ret;
            }
            next = cur;
        }
        return ret;
    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        psum = [[0]*(len(s)+1) for _ in range(26)]
        for i in range(26):
            c = chr(ord('a')+i)
            for j in range(len(s)):
                psum[i][j+1] = psum[i][j]+(1 if s[j]==c else 0)
        r = [0]*26
        ans = 0
        for l in range(len(s)):
            for i in range(26):
                while r[i] < len(s) and psum[i][r[i]]-psum[i][l] < k:
                    r[i] += 1
            if any(psum[i][r[i]]-psum[i][l] >= k for i in range(26)):
                ans += len(s)-min(r[i] for i in range(26) if psum[i][r[i]]-psum[i][l] >= k)+1
        return ans

