typedef long long ll;

class Solution {
public:
    const long long M = 1e9 + 7, P = 34927453;
    long long pow(long long x, long long y, long long p){
        int res = 1;
        while (y){
            if (y&1) res = (res*x)%p;
            y >>= 1; 
            x = (x * x)%p;
        }
        return res % p;
    }

    map<char, long long> hash;
    long long has(string a){
        long long re = 0;
        for(char i : a){
            re = ((re*P)%M + hash[i]) % M;
        }
        return re;
    }

    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n = s.size();
        set<long long> used;
        for(int i = 0; i < 26; i++){
            char c = 'a' + i;
            int num = rand() % P;
            while(used.find(num) != used.end()){
                num = rand() % P;
            }
            used.insert(num);
            hash[c] = num;
        }

        queue<int> q;
        vector<vector<int>> adj(n);
        vector<int> sz(n, 1), d(n, 0);
        for(int i = 0; i < n; i++){
            if(parent[i] == -1) continue;
            int p = parent[i];
            d[p]++;
            adj[p].push_back(i);
        }

        for(int i = 0 ; i < n; i++){
            if(d[i] == 0) q.push(i);
        }
        vector<bool> ans(n);
        vector<long long> v(n, 0), bv(n, 0);
        // cout << (ll) has("aba") << endl;
        // cout << (ll) has("ab") << endl;
        // cout << (ll) has("ba") << endl;
        // cout << (ll) has("abaaba") << endl;
        // cout << (ll) has("abaab") << endl;
        while(!q.empty()){
            int x = q.front();
            q.pop();

            int m = adj[x].size();
            long long fo = 0, re = hash[s[x]]; 
            for(int i = 0; i < m; i++){
                long long fr = adj[x][i];
                long long bk = adj[x][m - i - 1];
                // cout << x << ' ' << fr << ' ' << bk << endl;

                fo = ((fo * pow(P, sz[fr], M)) % M + v[fr]) % M;
                re = ((re * pow(P, sz[bk], M)) % M + bv[bk]) % M;
                // cout << (ll)fo << endl;
                sz[x] += sz[fr];
            }
            fo = ((fo * P) % M + hash[s[x]]) % M;

            v[x] = fo;
            bv[x] = re;
            // cout << x << ' ' << (ll) v[x] << ' ' << (ll) bv[x] << endl;
            ans[x] = fo == re;

            if(parent[x] != -1) {
                d[parent[x]]--;
                if(d[parent[x]] == 0) q.push(parent[x]);
            }
        }

        return ans;
    }
};

