class Solution {
public:
    int minOperations(vector<int>& nums) {
        int last = nums.back();
        int cnt =0;
        for(int i = nums.size() - 2; i >=0; --i) {
             int ch = nums[i];
             while(ch > last) {
                int lg = 1;
                for(int j = 2; j * 1LL * j <= ch && j != ch;++j) {
                    if(ch % j ==0) {
                        lg = max(j, lg);
                        lg = max(lg, ch /j);
                    }
                }
                if(lg == 1 || lg == ch) {
                    return -1;
                }
                ch /= lg;
                cnt++;
             }
             last = ch;   
        }

        return cnt;
    }
};

