class Solution {

    static long[] p;
    static int MOD = 1000_000_007;

    public boolean[] findAnswer(int[] parent, String s) {

        int n = parent.length;
        List<Integer>[] g = new ArrayList[n];
        p = new long[n+1];
        p[0] = 1L;
        for (int i = 1; i <= n; i++) {
            p[i] = (p[i-1] * 31) % MOD;
        }
        for (int i = 0; i < n; i++) {
            g[i] = new ArrayList<>();
        }
        for (int i = 1; i < n; i++) {
            g[parent[i]].add(i);
        }

        boolean[] res = new boolean[n];
        dfs(g, s.toCharArray(), res, 0);
        return res;
    }

    Hs[] dfs(List<Integer>[] g, char[] c, boolean[] res, int cur) {
        int num = 0;
        Hs l = new Hs(0, 0);
        Hs r = new Hs(0, 0);
        Collections.sort(g[cur]);
        for (var next : g[cur]) {
            var nh = dfs(g, c, res, next);
            l = l.plus(nh[0]);
            r = nh[1].plus(r);
        }
        var ch = new Hs(1, c[cur] - 'a' + 1);
        l = l.plus(ch);
        r = ch.plus(r);
        res[cur] = l.equals(r);
        return new Hs[]{l,r};
    }


    record Hs (int len, long h) {

        Hs plus(Hs o) {
            var nh = (o.h * p[len]) % MOD;
            nh = (nh + h) % MOD;
            return new Hs(len + o.len, nh);
        }

    }
}

