class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size(), ans = 0;
        vector<vector<int>> presum(26, vector<int>(n));
        for(char c = 'a'; c <= 'z'; c++) {
            for(int i = 0; i < n; i++) {
                presum[c - 'a'][i] = (i > 0? presum[c - 'a'][i - 1]: 0) + (s[i] == c? 1: 0);
            }
        }
        for(int l = 0; l < n; l++) {
            int left = l, right = n - 1, index = -1;
            while(left <= right) {
                int mid = left + right >> 1;
                bool ok = false;
                for(char c = 'a'; c <= 'z'; c++) {
                    if(presum[c - 'a'][mid] - (l > 0? presum[c - 'a'][l - 1]: 0) >= k) {
                        ok = true;
                        break;
                    }
                }
                if(ok) {
                    index = mid;
                    right = mid - 1;
                }else {
                    left = mid + 1;
                }
            }
            if(index != -1) {
                ans += n - index;
            }
        }
        return ans;
    }
};

