class Solution
{
public:
    vector<set<int>> son;
    vector<int> bt, et;
    string ans, base;
    void dfs(int u)
    {
        bt[u] = ans.size();
        for (auto v : son[u])
        {
            dfs(v);
        }
        et[u] = ans.size();
        ans.push_back(base[u]);
        ans.push_back('#');
    }
    vector<int> Manacher(string s)
    {
        vector<int> p(s.size(), 0);
        int mx = 0, id = 0;
        for (int i = 1; i < s.size(); ++i)
        {
            p[i] = mx > i ? min(p[2 * id - i], mx - i) : 1;
            while (s[i + p[i]] == s[i - p[i]])
                ++p[i];
            if (mx < i + p[i])
            {
                mx = i + p[i];
                id = i;
            }
        }
        return p;
    }
    vector<bool> findAnswer(vector<int> &parent, string s)
    {
        int n = parent.size();
        base = s;
        son.resize(n);
        bt.resize(n);
        et.resize(n);
        for (int i = 1; i < n; i++)
        {
            son[parent[i]].insert(i);
        }
        ans.push_back('$');
        ans.push_back('#');
        dfs(0);
        vector<int> p = Manacher(ans);
        vector<bool> ret;
        for (int i = 0; i < n; i++)
        {
            int mid = (bt[i] + et[i]) / 2;
            int len = 2* p[mid] - 1;
            int baselen = et[i] - bt[i] + 1;
            ret.push_back(len >= baselen);
        }
        return ret;
    }
};

public class Solution {
    static final int N = 100010, INF = 0x3f3f3f3f;
    static int[][] dp = new int[N][2];
    static int cnt;
    static int[] primes = new int[1000010];
    static int[] st = new int[1000010];
    static int[] minprime = new int[1000010];

    public Solution() {
        if(minprime[4] == 0) {
            cnt = 0;
            getPrimes(1000000);
        }
    }

    public int minOperations(int[] nums) {
        int n = nums.length;
        int[][] tup = new int[n][2];
        for (int i = 0; i < n; i++) {
            tup[i] = new int[]{minprime[nums[i]], nums[i]};
        }
        for (int i = 0; i < n; i++) {
            dp[i][0] = dp[i][1] = -1;
        }
        int ans = dfs(0, 0, nums, tup);
        return ans < INF? ans: -1;
    }

    private int dfs(int i, int pre, int[] nums, int[][] tup) {
        if (i == nums.length) return 0;
        if (dp[i][pre] != -1) return dp[i][pre];
        if (i == 0) {
            int res1 = dfs(i + 1, 0, nums, tup);
            int res2 = 1 + dfs(i + 1, 1, nums, tup);
            return dp[i][pre] = Math.min(res1, res2);
        } else {
            if (pre == 1) {
                int prenum = tup[i - 1][0];
                if (1 < prenum && prenum < nums[i - 1]) {
                    if (prenum > nums[i]) {
                        return dp[i][pre] = INF;
                    } else {
                        int cur = tup[i][0];
                        int res1 = dfs(i + 1, 0, nums, tup);
                        int res2 = INF;
                        if (prenum <= cur) {
                            res2 = 1 + dfs(i + 1, 1, nums, tup);
                        }
                        return dp[i][pre] = Math.min(res1, res2);
                    }
                } else {
                    return dp[i][pre] = INF;
                }
            } else {
                if (nums[i - 1] > nums[i]) return dp[i][pre] = INF;
                int res1 = dfs(i + 1, 0, nums, tup);
                int res2 = INF;
                if (nums[i - 1] <= tup[i][0]) {
                    res2 = 1 + dfs(i + 1, 1, nums, tup);
                }
                return dp[i][pre] = Math.min(res1, res2);
            }
        }
    }

    public int get(int x) {
        return minprime[x];
    }

    public void getPrimes(int n) {
        for (int i = 2; i <= n; i++) {
            if (st[i] == 0) {
                primes[cnt++] = i;
            }
            for (int j = 0; j <= n / i; j++) {
                if (i * primes[j] <= n) {
                    st[i * primes[j]] = 1;
                    minprime[i * primes[j]] = primes[j];
                }
                if (i % primes[j] == 0) break;
            }
        }
    }
}

