    vector<string> stringSequence(string target) {
        vector<string> ans;
        string s = "a";
        int len = 1;
        while(s != target){
            ans.push_back(s);
            if(target[len-1] == s[len-1]){
                s += 'a';
                len++;
            }
            else{
                s[len-1] = s[len-1] + 1;
            }
        }
        ans.push_back(target);
        return ans;
    }
};

