class Solution {
public:
    int minOperations(vector<int>& nums) {
        int maxi = 0;
        for(auto num : nums) maxi = max(maxi, num);
        vi div(maxi+1, 1);
        rep(i, 2, maxi){
            if(div[i] == 1){
                for(ll j = i*i; j <= maxi; j += i){
                    div[j] = (div[j] == 1 ? i : div[j]);
                }   
            }
        }

        ll op = 0;
        int n = nums.size();
        ren(i, n-2, 0){
            ll ahead = nums[i+1];
            while((nums[i] > ahead) and (div[nums[i]] != 1)){
                nums[i] = div[nums[i]];
                op++;
            }
            if(nums[i] > ahead) return -1;
        }
        return op;
    }
};

class Solution {
public:
    int maxf(vector<int>&f, int i=-1)
    {
        if(i!=-1) f[i]--;
        int maxi = 0;
        for(auto &it:f) maxi = max(maxi, it);
        if(i!=-1) f[i]++;
        return maxi;
    }
    int numberOfSubstrings(string s, int k) {
        int n = s.length();
        vector<int> f(26,0);
        int i = 0;
        int count = 0;
        for(int j=0;j<n;j++)
        {
            f[s[j]-'a']++;
            while(i+1<=j && maxf(f,s[i]-'a')>=k)
            {
                f[s[i]-'a']--;
                i++;
            }
            if(maxf(f)>=k) count += i+1;
        }
        return count;

    }
};

