class Solution {
public:
    static const int NN = 101010;

    int z[NN << 1];
    char s[NN << 1];

    void zpal(char *s, int n) {
        int i = 0, b = z[0] = 0;
        while(++i < n) {
            z[i] = b + z[b] < i ? 0 : min(z[b + b - i], b + z[b] - i);
            while(i + z[i] + 1 < n && i > z[i] && s[i + z[i] + 1] == s[i - z[i] - 1]) z[i]++;
            if(z[i] + i > z[b] + b) b = i;
        }
    }

    vector<int> adj[NN];
    char ss[NN];

    int L[NN], R[NN], nn = 1, nc;
    void dfs(int u) {
        L[u] = nn;
        for(int v : adj[u]) dfs(v);
        s[nc++] = ss[u], s[nc++] = '$';
        R[u] = nn++;
    }

    vector<bool> findAnswer(vector<int>& parent, string S) {
        int n = parent.size();
        for(int i = 0; i < n; i++) adj[i].clear(), ss[i] = S[i];
        for(int i = 1; i < n; i++) adj[parent[i]].push_back(i);

        nc = 0;
        s[nc++] = '$';
        nn = 1, dfs(0);

        zpal(s, nc);

        vector<bool> ans;
        for(int i = 0; i < n; i++) {
            int st = L[i] * 2 - 1;
            int ed = R[i] * 2 - 1;
            int md = st + ed >> 1;

            int len = R[i] - L[i] + 1;
            ans.push_back(z[md] >= len - 1);
        }
        return ans;
    }
};

class Solution {
public:
    static const int NN = 101010, MM = 1000001, inf = 1e8;

    int f[MM];
    int dp[NN][2];
    int minOperations(vector<int>& a) {
        for(int i = 2; i < 1000; i++) if(!f[i]) {
            for(int j = i + i; j < MM; j += i) if(!f[j]) f[j] = i;
        }

        if(f[a[0]]) dp[0][1] = 1;
        else dp[0][1] = inf;

        int n = a.size();
        for(int i = 1; i < n; i++) {
            if(a[i - 1] <= a[i]) dp[i][0] = dp[i - 1][0];
            else if(f[a[i - 1]] && f[a[i - 1]] <= a[i]) dp[i][0] = dp[i - 1][1];
            else dp[i][0] = inf;

            if(f[a[i]]) {
                if(a[i - 1] <= f[a[i]]) dp[i][1] = dp[i - 1][0] + 1;
                else if(f[a[i - 1]] && f[a[i - 1]] <= f[a[i]]) dp[i][1] = dp[i - 1][1] + 1;
                else dp[i][1] = inf;
            }
            else dp[i][1] = inf;

            if(dp[i][0] == inf && dp[i][1] == inf) return -1;
        }

        int ans = min(dp[n - 1][0], dp[n - 1][1]);
        if(ans == inf) return -1;
        return ans;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {

        if(k == 1){
            return (s.size() * (s.size() + 1))/2;
        }
        int left = 0;
        int right = 0;
        unordered_map<int, int> count;
        unordered_map<int, int> count2;
        int result = 0;
        while(right < s.size()){
            if(count[s[right]]==(k-1)){
                count2[s[right]]++;
            } else{
                count[s[right]]++;
            }
            while(left < right && count2.size()){
                if(count2.count(s[left])){
                    if(--count2[s[left]] == 0){
                        count2.erase(s[left]);
                    }
                } else{
                    if(--count[s[left]] == 0){
                        count.erase(s[left]);
                    }
                }
                left++;
            }
            // cout << left << " " << right << endl;
            // auto latestStartPoint = left-1;
            // cout << right << " " << left << endl;
            result += (left);
            right++;
        }
        return result;
    }
};

