class Solution:
    # prime (Sieve of Eratosthenes) + dp, time O(MloglogM+nlogM), space O(1), M = 10^6
    def minOperations(self, nums: List[int]) -> int:
        n = len(nums)

        def get_spf(x):
            if x == 1:
                return 1
            if x == spf[x]:
                return x
            return x // spf[x]

        @cache
        def perform_operation(x):
            res = []  # (value, operation count)
            ops = 0

            while True:
                res.append((x, ops))
                if gpd[x] in (1, x):
                    break
                x //= gpd[x]
                ops += 1

            return res

        dp = [{} for _ in range(n)]  # dp[i] = {val -> ops} at index i

        for i, x in enumerate(nums):
            for v, ops in perform_operation(x):
                if i == 0:
                    dp[i][v] = ops
                else:
                    for pre_v in dp[i - 1]:
                        if v >= pre_v:
                            dp[i][v] = min(dp[i].get(v, inf), dp[i - 1][pre_v] + ops)
            if not dp[i]:
                return -1

        return min(dp[-1].values())

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        counts = [0] * 26
        left, right = 0, 0
        n = len(s)
        res = 0

        for left in range(n):
            while right < n and max(counts) < k:
                counts[ord(s[right]) - ord('a')] += 1
                right += 1

            if not max(counts) == k:
                return res

            res += n - right + 1
            counts[ord(s[left]) - ord('a')] -= 1

        return res

