class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        result = 0
        start = 0
        state = defaultdict(int)
        valid = False
        for end in range(len(s)):
            c = s[end]
            state[c] += 1
            if state[c] >= k:
                valid = True
            while max(state.values()) >= k:
                state[s[start]] -= 1
                start += 1
                if max(state.values()) < k:
                    start -= 1
                    state[s[start]] += 1
                    break
            if valid:
                result += start + 1
        return result

