class Solution:
    def findAnswer(self, parent: List[int], s: str) -> List[bool]:
        tree = defaultdict(list)
        for i in range(len(parent)):
            tree[parent[i]].append(i)
        for l in tree.values():
            l.sort()

        result = [False] * len(parent)
        dfsstr = "#"
        result_map = {}

        def dfs(node):
            nonlocal dfsstr
            start_i = len(dfsstr)
            for child in tree[node]:
                dfs(child)
            dfsstr += s[node] + "#"
            result_map[node] = (start_i, len(dfsstr) - 1)

        dfs(0)

        T = "$" + dfsstr + "^"
        nn = len(T) - 2
        L = [0] * len(T)
        ll = 1
        rr = 1
        for i in range(1, nn + 1):
            L[i] = min(L[ll + (rr - i)], rr - i)
            if L[i] < 0:
                L[i] = 0
            while T[i - L[i]] == T[i + L[i]]:
                L[i] += 1
            if i + L[i] > rr:
                ll = i - L[i]
                rr = i + L[i]
        L = L[1:-1]

        for node, (i, j) in result_map.items():
            center = (i + j) // 2
            if center + L[center] >= j and center - L[center] <= i:
                result[node] = True
        return result

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        @cache
        def f(x):
            for i in range(2, x):
                if x % i == 0:
                    return i
            return x

        nums = list(reversed(nums))
        prev = nums[0]
        result = 0
        for num in nums[1:]:
            if prev >= num:
                prev = num
                continue
            fnum = f(num)
            if prev < fnum:
                return -1
            result += 1
            prev = fnum
        return result

class Solution {
public:
    int numberOfSubstrings(string str, int k) {
        int n = str.length(), count = 0;

        for (int i = 0; i < n; ++i) {
            vector<int> freq(26, 0);
            auto hasKFreq = [&](const vector<int>& f, int k) {
                for (int x : f) {
                    if (x >= k) return true;
                }
                return false;
            };
            for (int j = i; j < n; ++j) {
                freq[str[j] - 'a']++;
                if (hasKFreq(freq, k)) {
                    count += (n - j);
                    break;
                }
            }
        }
        return count;
    }
};

