def linear_prime_sieve():
    M = 10**6
    primes = []
    is_prime = [True] * (M + 1)
    min_prime = list(range(M + 1))
    for i in range(2, M + 1):
        if is_prime[i]:
            primes.append(i)
        for p in primes:
            if i * p > M:
                break
            is_prime[i * p] = False
            min_prime[i * p] = p
            if i % p == 0:
                break
    return min_prime
