    while (!copy.empty()) {
        arr.pb(copy.top());
        copy.pop();
    }
    pr(arr);
    cout << nl;
}

inline int euclid(int a, int b, int &x, int &y) { // pass x and y by ref
    int xx = y = 0;
    int yy = x = 1;
    while (b) { // repeats until b == 0
        int q = a / b;
        int t = b;
        b = a % b;
        a = t;
        t = xx;
        xx = x - q * xx;
        x = t;
        t = yy;
        yy = y - q * yy;
        y = t;
    }
    return a; // returns gcd(a, b)
}

inline ll binpow(ll a, int p, int m) {
    ll res = 1;
    while (p) {
        if (p & 1)res = (res * a) % m;
        a = (a * a) % m;
        p >>= 1;
    }
    return res;
}
class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n=sz(s);
        int res=0;
        rep(0,n){
            vi cnts(26);
            for(int j=i;j<n;j++){
                char c=s[j]-'a';
                cnts[c]++;
                if(cnts[c]==k){
                    res+=n-j;
                    break;
                }
            }
        }
        return res;

    }
};
