class Solution {
public:
    int minOperations(vector<int>& nums) {
        const int N=1000;
        bitset<N+1>prime;
        prime.set();
        vi primes;
        for(int i=2;i<=N;i++){
            if(prime[i]){
                primes.pb(i);
                for(int j=i*i;j<=N;j+=i)prime[j]=0;
            }
        }
        int res=0,n=sz(nums);
        for(int i=n-2;i>=0;i--){
            if(nums[i]<=nums[i+1])continue;
            for(int&j:primes)if(nums[i]%j==0){
                nums[i]=j;
                break;
            }
            if(nums[i]>nums[i+1])return -1;
            res++;
        }
        return res;
    }
};
