class Solution {
public:
    ll pw = 31, mod = 1e9;
    vll dfs(ll node, vector<vll>& adj, vll& power, vector<bool>& ans, string& s){
        vll fwd, rev, sz;
        for(auto &it: adj[node]){
            vll val = dfs(it, adj, power, ans, s);
            fwd.push_back(val[0]);
            rev.push_back(val[1]);
            sz.push_back(val[2]);
        }
        fwd.push_back(s[node] - 'a' + 1);
        rev.push_back(s[node] - 'a' + 1);
        sz.push_back(1);
        ll fwdHash = 0;
        ll prev = 0;
        ll n = fwd.size();
        fr(0, n){
            fwdHash = (fwdHash + (power[prev] * fwd[i]) % mod) % mod;
            prev += sz[i];
        }
        ll revHash = 0;
        prev = 0;
        rf(n-1, 0){
            revHash =(revHash + ((power[prev] % mod) * (rev[i] % mod )) % mod) % mod;
            prev += sz[i];
        }
        if(fwdHash == revHash) ans[node] = true;
        return {fwdHash, revHash, prev};
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        ll n = s.size();
        vector<bool> ans(n, false);
        vll power(n+1, 1);
        vector<vll> adj(n);
        fr(1, n+1){
            power[i] = (pw * power[i-1]) % mod;
        }
        fr(0, n){
            if(parent[i] != -1)
                adj[parent[i]].push_back(i);
        }
        dfs(0, adj, power, ans, s);
        return ans;
    }
};

class Solution {
public:
    int a(int n){
        if(n  <= 1) return 1;
        if(n == 1)return -1;
        for(int i = 2;i*i <= n;i++){
            if(n % i == 0){
                return n/i;
            }
        }
        return 1;
    }
    int minOperations(vector<int>& nums) {
         int n = nums.size();
    int operations = 0;

    // Traverse from right to left
    for (int i = n - 2; i >= 0; --i) {
        // While nums[i] is greater than nums[i+1], keep reducing nums[i]
        while (nums[i] > nums[i + 1]) {
            int gpd = a(nums[i]);
            // If nums[i] can't be reduced further, return -1
            if (gpd == 1) {
                return -1;
            }
            nums[i] /= gpd;
            operations++;
            if(nums[i] <= nums[i+1]) break;
        }
        if(nums[i] > nums[i+1]){
            return -1;
        }
    }

    return operations;
    }
};

