class Solution {
    public int numberOfSubstrings(String s, int k) {
        int cnt = 0;
        int len = s.length();
        int th = k;
        char[] cs = s.toCharArray();
        while(k <= len) {
            int[] ocu = new int[123];
            int above = 0;
            for(int i = 0; i+1 < k; i++) {
                ocu[cs[i]] ++;
                if(ocu[cs[i]] == th)
                    above ++;
            }
            for(int i = k-1; i < len; i++) {
                ocu[cs[i]]++;
                if(ocu[cs[i]] == th)
                    above++;
                if(above > 0)
                    cnt++;
                ocu[cs[i-k+1]]--;
                if(ocu[cs[i-k+1]] == th-1)
                    above--;
            }
            k++;
        }
        return cnt;
    }
}

