class Solution {
    boolean[] res;
    int N;
    List<Integer>[] chs;
    char[] cs;
    long mul = 37, mod = (long)1e9 + 7;
    long[] pre, suf;
    int[] size;
    boolean[] vis;
    public boolean[] findAnswer(int[] parent, String s) {
        N = parent.length;
        res = new boolean[N];
        chs = new List[N];
        pre = new long[N];
        suf = new long[N];
        vis = new boolean[N];
        size = new int[N];
        cs = s.toCharArray();
        for(int i = 0; i < N; i++) {
            chs[i] = new ArrayList<> ();
        }
        for(int i = 1; i < N; i++) 
            chs[parent[i]].add(i);
        for(int i = 0; i < N; i++) {
            Collections.sort(chs[i]);
        }
        dfs(0);
        return res;
    }

    public void dfs(int ind) {
        if(vis[ind])
            return;
        suf[ind] = cs[ind];
        int sufSz = 0;
        int preSz = -1;
        for(int i = chs[ind].size()-1; i > -1; i--) {
            int ch = chs[ind].get(i);
            dfs(ch);
            sufSz += size[ch];
            suf[ind] *= fp(mul, size[ch]);
            suf[ind] %= mod;
            suf[ind] += suf[ch];
            suf[ind] %= mod;
        }
        for(int i = 0; i < chs[ind].size(); i++) {
            int ch = chs[ind].get(i);
            // preSz += size[ch];
            pre[ind] *= fp(mul, size[ch]);
            pre[ind] %= mod;
            pre[ind] += pre[ch];
            pre[ind] %= mod;
        }
        pre[ind] *= mul;
        pre[ind] += cs[ind];
        pre[ind] %= mod;
        // System.out.println(ind+" "+pre[ind]+" "+suf[ind]);
        res[ind] = (pre[ind] == suf[ind]);
        size[ind] = sufSz+1;
        vis[ind] = true;
    }

    public long fp(long base, long exp) {
        long res = 1;
        while(exp > 0) {
            if((exp & 1) == 1)
                res = (res * base) % mod;
            base = (base * base) % mod;
            exp >>= 1;
        }
        return res;
    }
}

class Solution {
    int cnt = 0;
    public int minOperations(int[] nums) {
        List<Integer> ps = new ArrayList<> ();
        boolean[] table = new boolean[1000];
        for(int i = 2; i < 1000; i++) {
            if(!table[i]) {
                ps.add(i);
                for(int j = i*i; j < 1000; j += i)
                    table[j] = true;
            }
        }
        int len = nums.length;
        int curMax = 0;
        for(int i = 0; i < len; i++) {
            if(nums[i] < curMax) {
                curMax = nums[i];
                int curMin = curMax;
                for(int j = i-1; j > -1; j--) {
                    if(nums[j] <= curMin)
                        break;
                    while(nums[j] > curMin) {
                        boolean f = true;
                        for(int p: ps) {
                // System.out.println(p);
                            if(nums[j] <= p)
                                break;
                            if(nums[j] % p == 0) {
                                nums[j] = p;
                                cnt++;
                                f = false;
                                break;
                            }
                        }
                        if(f)
                            return -1;
                    }
                    curMin = nums[j];
                }
            }
            curMax = nums[i];
        }
        return cnt;
    }
}

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int n = s.length();
        int[] a = new int[n];
        for(int i=0; i<n; ++i){
            a[i] = s.charAt(i) - 'a';
        }
        int other = atmost(a, k-1);
        int all = n*(n+1)/2;
        return all - other;
    }


    private int atmost(int[] a, int k){
        if(k==0){
            return 0;
        }
        int n = a.length;
        int start = 0;
        Map<Integer,Integer> m = new HashMap<>();
        int res = 0;
        for(int i=0; i<n; i++){
            m.put(a[i], m.getOrDefault(a[i], 0)+1);
            while(bad(m, k)){
                m.put(a[start], m.get(a[start])-1);
                if(m.get(a[start])==0){
                    m.remove(a[start]);
                }
                start++;
            }
            // start...i good, have at most k chars
            res += i-start+1;
        }
        return res;
    }

    private boolean bad(Map<Integer,Integer> m, int k){
        for(int key: m.keySet()){
            if(m.get(key) > k){
                return true;
            }
        }
        return false;
    }
}

