                if (nums[i] > nums[i+1]) {
                    if (divisors[nums[i]] == 0) {
                        return -1;
                    }
                    nums[i] = divisors[nums[i]];
                    if (nums[i] > nums[i+1]) {
                        return -1;
                    }
                    res++;
                }
            }
            return res;
        }
        int res = 0;
        for (int i = n-2; i >= 0; i--) {
            if (nums[i] > nums[i+1]) {
