        iota(div, div+N, 0);
        for(int i = 2; i*i < N; i++){
            if(div[i] != i)
                continue;
            for(int j = i*i; j < N; j += i)
                div[j] = min(div[j], i);
        }
        int n = nums.size(), ans = 0;
        for(int i = n-2; i >= 0; i--){
            while(nums[i] > nums[i+1]){
                if(div[nums[i]] == nums[i])
                    return -1;
                nums[i] = div[nums[i]];
                ans++;
            }
        }
        return ans;
    }
};

