class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        int totalSubstrings = 0;

        // Sliding window approach
        for (int i = 0; i < n; ++i) {
            unordered_map<char, int> freqMap;
            for (int j = i; j < n; ++j) {
                // Update frequency of the current character
                freqMap[s[j]]++;

                // Check if any character in the current substring appears at least k times
                bool valid = false;
                for (auto &entry : freqMap) {
                    if (entry.second >= k) {
                        valid = true;
                        break;
                    }
                }

                if (valid) {
                    totalSubstrings++;
                }
            }
        }

        return totalSubstrings;
    }
};

class Solution {
public:
    vector<string> stringSequence(string target) {
        vector<string> result;
        string current = "";

        for (char ch : target) {
            if (current.empty()) {
                current += 'a';
                result.push_back(current);
            }

            // Ensure current matches ch, adding key presses
            while (current.back() != ch) {
                if (current.back() < ch) {
                    current.back()++; // Increment last character using Key 2
                } else {
                    current.back() = 'a'; // Wrap around if necessary
                }
                result.push_back(current);
            }

            // If more characters are needed, use Key 1
            if (current.size() < target.size()) {
                current += 'a';
                result.push_back(current);
            }
        }

        return result;
    }
};

