class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();
        int ops = 0;

        for (int i = n - 2; i >= 0; --i) {
            if (nums[i] > nums[i + 1]) {
                int current = nums[i];

                while (current > nums[i + 1]) {
                    int divisor = findLargestProperDivisor(current);
                    if (divisor == 1) {
                        return -1;
                    }
                    current /= divisor;
                    ops++;
                }
                nums[i] = current;
            }
        }

        return ops;
    }

    int findLargestProperDivisor(int x) {
    for (int i = 2; i <= sqrt(x); ++i) {
        if (x % i == 0) {
            return x / i;
        }
    }
    return 1;
}

