        for i, x in enumerate(parent):
            if x > -1:
                children[x].append(i)
                basement[x] += 1

        dfs = [""] * n
        rev = list(s)
        out = [False] * n

        stack = []
        for i, x in enumerate(basement):
            if x == 0:
                stack.append(i)

        while stack:
            i = stack.pop()
            for child in children[i]:
                dfs[i] += dfs[child]
                dfs[child] = ""
            for child in children[i][::-1]:
                rev[i] += rev[child]
                rev[child] = ""
            dfs[i] += s[i]
            out[i] = dfs[i] == rev[i]

            if parent[i] > -1:
                basement[parent[i]] -= 1
                if basement[parent[i]] == 0:
                    stack.append(parent[i])

        return out

