class Solution:
    def minOperations(self, nums: List[int]) -> int:
        if len(nums) == 1:
            return 0

        N = int(sqrt(max(nums) + 1) + 1)
        primes = []
        st = [False for _ in range(N)]
        for i in range(2, N, 1):
            if not st[i]:
                primes.append(i)
            j = i + i
            while j < N:
                st[j] = True
                j += i

        n = len(nums)
        ret = 0
        for i in range(n - 2, -1, -1):
