using ll = long long;
class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string& s) {
        int n = (int)s.length();
        vector<vector<int>> g(n);
        for (int i = 1; i<n; ++i) {
            g[parent[i]].push_back(i);
        }
        const int MOD = 1e9+7;
        vector<int> sz(n);
        // auto getsz = [&](auto self, int v) -> void {
        //     sz[v] = 1;
        //     for (int u: g[v]) {
        //         self(self, u);

        //     }
        // };
        // getsz(getsz, 0);

        vector<long long> dp2(100005);
        dp2[0] = 1;
        for (int i = 1; i<=100004; ++i)
            dp2[i] = (dp2[i-1]*27)%MOD;
        vector<int> left(n);

        auto norm = [&](auto self, int v) -> void {
            sz[v] = 1;
            ll x= s[v]-'a'+1;
            int mult = 0;
            ll result = 0;
            for (int& u: g[v]) {
                self(self, u);
                sz[v] += sz[u];
                ll y = left[u];
                result = (result * dp2[sz[u]])%MOD;
                result = (result + y);
                if (result >= MOD) result -= MOD;
            }
            result = (result * 27 + x)%MOD;
            left[v] = result;
        };
        norm(norm, 0);
        vector<bool> result(n);
        auto alt = [&](auto self, int v) -> void {
            ll x= s[v]-'a'+1;
            for (int i = (int)g[v].size()-1; i>=0; --i) {
                int u = g[v][i];
                x = (x*dp2[sz[u]])%MOD;
                self(self, u);
                ll y = left[u];
                x = (x+y);
                if (x >= MOD) x-= MOD;
            }
            if (x == left[v]) result[v] = true;
            left[v] = x;
        };
        alt(alt, 0);
        return result;
    }
};

