class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        const int n = (int)s.size();
        vector<vector<int64_t>> p(n, vector<int64_t>(26, 0));
        for (int i = 0; i < n; i++) {
            int d = s[i] - 'a';
            p[i][d]++;
            if (i - 1 >= 0) {
                for (int j = 0; j < 26; j++) {
                    p[i][j] += p[i - 1][j];
                }
            }
        }
        auto query = [&](int l, int r, int d) -> int64_t {
            return p[r][d] - (l - 1 >= 0? p[l - 1][d]: 0);
        };


        auto ok = [&](int l, int r) -> bool {
            for (int i = 0; i < 26; i++) {
                if (query(l, r, i) >= k)
                    return true;
            }
            return false;
        };

        int64_t ans = 0;
        for (int i = 0; i < n; i++) {
            int l = i - 1, r = n;
            while (r - l > 1) {
                int m = l + (r - l) / 2;
                if (ok(i, m))
                    r = m;
                else 
                    l = m;
            }
            if (r != n) {
                ans += n - r;
            }
        }
        return ans;
    }
};

