class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        int cnt = 0;
        for(int i = 0 ; i < s.size() ; i++){
            vector<int> fre(26,0);
            for(int j = i ; j < s.size() ; j++){
                fre[s[j] - 'a']++;
                if(fre[s[j] - 'a'] >= k){
                    cnt += (n - j);
                    break;
                }
            }
        }
        return cnt;
    }
};

class Solution {
public:
    vector<string> stringSequence(string target) {
        vector<string> ans;
        string s = "";
        for(int i = 0 ; i < target.size() ; i++){
            s.push_back('a');
            int sz = s.size();
            while(s[sz-1] <= target[sz-1]){
                ans.push_back(s);
                s.back()+=1;                
            }
            s.back() = target[sz-1];
        }
        return ans;
    }
};

