using i64 = long long;

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
        array<int, 26> freq {};

        const auto check = [&]() {
            int mx = 0;
            for (int a = 0; a < 26; a++) {
                mx = max(mx, freq[a]);
            }
            return mx >= k;
        };

        int ans = 0;
        for (int L = 0, R = 0; L < n; L++) {
            while (R < n && !check()) {
                freq[s[R] - 'a']++;
                R++;
            }
            if (check()) {
                ans += n - R + 1;
            } else {
                break;
            }
            freq[s[L] - 'a']--;
        }

        return ans;
    }
};

