class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        res=len(s)*(len(s)+1)//2
        left=0
        d=Counter()
        for i,x in enumerate(s):
            d[x]+=1
            while d[x]>=k:
                res-=i-left
                d[s[left]]-=1
                left+=1
        return res-(len(s)-left)*(len(s)-left+1)//2

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int r=0;
        int a[26]={0};
        int i=0,j=0;
        int u=0;
        while(i<s.size()){
            while(j<s.size() && u==0){
                a[s[j]-'a']++;
                if(a[s[j]-'a']==k){
                    u++;
                }
                j++;
            }
            if(u){
                r+=s.size()-j+1;
            }
            a[s[i]-'a']--;
            if(a[s[i]-'a']==k-1){
                u--;
            }
            i++;
            if(i>j){
                i=j;
                memset(a,0,sizeof(a));u=0;
            }
        }
        return r;
    }
};

class Solution {
public:
