        int prefix = 0;
        int64_t res =  0;
        vector<int> cnts(26, 0);
        for (int i = 0; i < n; ++i)
        {
            cnts[ s[i] - 'a' ]++;

            while (true)
            {
                cnts[s[prefix] - 'a']--;
                if (greaterK(cnts, k))
                {
                    ++prefix;
                    continue;
                }
                cnts[s[prefix] - 'a']++;
                break;                
            }
           // cout << i << "," << prefix << "," << cnts[0] << endl;

            if (greaterK(cnts, k))
            {
                res += prefix - start + 1;
            }
        }

        return res;
    }

    bool greaterK(vector<int>& vec, int k)
    {         
            for (auto& item : vec)
            {
                if (item >= k)
                {
                    return true;
                }
            }
        return false;
    }
};

