class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        dp = [[0 for _ in range(26)] for _ in range(n+1)]
        for i in range(n):
            c = ord(s[i])-ord('a')
            for j in range(26):
                dp[i+1][j] = dp[i][j] + (1 if j==c else 0)
        i = 0
        j = 0
        ans = 0
        while i<n:
            flag = False
            while j<=n and flag==False:
                for l in range(26):
                    if dp[j][l]-dp[i][l]>=k:
                        flag = True
                        break
                if flag:
                    break
                j+=1
            if flag:
                ans += n-j+1
            i+=1
        return ans

