            count, h1 = 1, ord(s[i])

            for t in reversed(tmp):
                h1 = (h1 + p[count] * t[2]) % MOD
                count += t[0]

            if h0 == h1:
                nonlocal ret
                ret[i] = True

            return count, h0, h1

        dfs(0)
        return ret

