        for(int i = 0; i < n; i++)
            adj.add(new ArrayList<>());
        for(int i = 1; i < n; i++){
            adj.get(par[i]).add(i);
        }

        for(int i = 0; i < n; i++)
            Collections.sort(adj.get(i));
        this.s = s.toCharArray();
        // System.out.println(adj);
        LL head = dfs(0)[0];
        sz = new int[n];
        findSz(0);
        // print(head);
        manS = getNew(head);
        man = getMan(manS);
        ans = new boolean[n];
        findAns(0, 0, n - 1);
        return ans;

    }
    void findAns(int node, int low, int high){
        int mid = (low + high) >> 1;
        mid = mid * 2 + 2;

        if ((high - low + 1) % 2 == 0)
            mid++;
        // System.out.print(low+" "+high+" "+mid+" ");
        // System.out.println(man[mid]);
        if(man[mid] - 1 >= (high - low + 1)){
            ans[node] = true;
        }
        for(int ngr : adj.get(node)){
            findAns(ngr, low, low + sz[ngr] - 1);
            low += sz[ngr];
        }
    }
    String manS;
    int man[];
    boolean ans[];
    int[] getMan(String S){
        int n = S.length();

        S = "$" + S + "^";
        s = S.toCharArray();
        // System.out.println(S);
        int p[] = new int[n + 2];
        int l = 1, r = 1;
        for(int i = 1; i <= n; i++) {
            p[i] = Math.max(0, Math.min(r - i, p[l + (r - i)]));
            while(s[i - p[i]] == s[i + p[i]]) {
                p[i]++;
            }
            if(i + p[i] > r) {
                l = i - p[i]; r = i + p[i];
            }
        }
        // System.out.println(Arrays.toString(p));
        return p;
    }
    int findSz(int node){
        sz[node] = 1;
        for(int ngr : adj.get(node))
            sz[node] += findSz(ngr);
        return sz[node];
    }
    String getNew(LL head){
        StringBuilder s = new StringBuilder("#");
        while(head != null){
            s.append(head.c);
            head = head.next;
            s.append('#');
        }
        return s.toString();
    }
    void print(LL head){
        while(head != null){
            System.out.print(head.c);
            head = head.next;
        }
        System.out.println();
    }
    LL[] dfs(int node){
        LL head = null, tail = null;
        for(int ngr : adj.get(node)){
            LL res[] = dfs(ngr);
            if (head == null)
                head = res[0];
            else
                tail.next = res[0];
            tail = res[1];
        }
        if (head == null){
            head = new LL(s[node]);
            tail = head;
        } else{
            tail.next = new LL(s[node]);
            tail = tail.next;
        }
        return new LL[]{head, tail};
    }
    int sz[];
    char s[];
    int n;
    List<List<Integer>> adj;
}
