    int numberOfSubstrings(string s, int k) {
        const int n = s.size();
        for(int i = 0; i < n; i++)
            nums[i] = s[i] - 'a';

        int ans = 0;
        for(int i = 0; i < n; i++){
            fill(vfreq, vfreq + 26, 0);
            int best = 0;
            for(int j = i; j < n; j++){
                vfreq[nums[j]]++;
                best = max(best, vfreq[nums[j]]);
                ans += best >= k;
            }
        }

        return ans;
    }
};

