    const string sign = (want_sign) ? (val < 0 ? "-" : "+") : "";
    if(!val) return sign + "0";
    val = abs(val);
    string ans;
    while(val){
        ans.push_back('0' + (val & 1));
        val >>= 1;
    }
    return sign + string(allr(ans));
}

class Solution {
public:
    vector<string> stringSequence(string target) {

        vector<string> ans;
        string now;
        for(auto& ch : target){
            for(char cur = 'a'; cur <= ch; cur++){
                ans.push_back(now);
                ans.back().push_back(cur);
            }
            now.push_back(ch);
        }

        return ans;
    }
};

