#define ll long long 
const long long int M=(int)1e9+9;
const int p=31;
class Solution {
public:
    void dfs(int node,int par,string& fin,int& ind,vector<int>& index,vector<int>& siz,vector<int> adj[],string& s){
        for(auto &nei:adj[node]){
            if(nei==par)continue;
            dfs(nei,node,fin,ind,index,siz,adj,s);
            siz[node]+=siz[nei];
        }
        siz[node]++;
        fin.push_back(s[node]); 
        index[node]=ind;
        ++ind;
    }
    ll power(ll a,ll b){
        ll ret=1;
        ll pro=a;
        while(b){
            if(b&1){
                ret*=pro;
                ret%=M;
            }
            b>>=1;
            pro*=pro;   pro%=M;
        }
        return ret;
    }
    void pre(vector<ll>& po,vector<ll>& inv){
        po[0]=inv[0]=1;
        int n=po.size();
        for(int i=1;i<n;++i){
            po[i]=(po[i-1]*p);
            po[i]%=M;
            inv[i]=power(po[i],M-2);
        }
    }
    ll calHash(int l,int r,vector<ll>& pref,vector<ll>& inv){
        ll ret=pref[r];
        if(l){
            ret-=(pref[l-1]);
            ret%=M;
            ret+=M; ret%=M;
        }
        ret*=inv[l];     ret%=M;
        return ret;
    }
    vector<bool> findAnswer(vector<int>& parent, string s) {
        int n=parent.size();
        vector<int> index(n),siz(n);
        string fin="";
        int ind=0;
        vector<int> adj[n];
        for(int i=0;i<n;++i){
            if(parent[i]!=-1){
                adj[parent[i]].push_back(i);
                adj[i].push_back(parent[i]);
            }
        }
        dfs(0,-1,fin,ind,index,siz,adj,s);
        // cout<<fin<<endl;
        // for(int i=0;i<n;++i){
        //     cout<<siz[i]<<" ";
        // }
        string fin2=fin;
        reverse(fin2.begin(),fin2.end());
        // cout<<fin2<<endl;
        vector<ll> po(n),inv(n);
        pre(po,inv);
        vector<ll> pref1(n),pref2(n);
        for(int i=0;i<n;++i){
            pref1[i]=po[i]*(fin[i]-'a'+1);
            pref1[i]%=M;       
            pref2[i]=po[i]*(fin2[i]-'a'+1);
            pref2[i]%=M;
            if(i){
                pref1[i]+=pref1[i-1];
                pref1[i]%=M;
                pref2[i]+=pref2[i-1];
                pref2[i]%=M;
            }
        }
        vector<bool> res;
        for(int i=0;i<n;++i){
            int ind1=index[i];
            int ind2=n-1-ind1;
            int si=siz[i];
            int l1=ind1-si+1,r1=ind1;
            int l2=ind2,r2=ind2+si-1;
            // cout<<i<<" "<<l1<<" "<<r1<<" "<<l2<<" "<<r2<<endl;
            if(calHash(l1,r1,pref1,inv)==calHash(l2,r2,pref2,inv)){
                res.push_back(true);
            }else{
                res.push_back(false);
            }
        }
        return res;
    }
};

