class Solution {
public:
    vector<string> stringSequence(string target) {

        int n = len(target);

        vector<str> ret{"a"};

        while (len(ret.back()) != n or ret.back().back() != target.back()){
            if (target[len(ret.back()) - 1] == ret.back().back()){
                ret.push_back(ret.back());
                ret.back() += 'a';
            } else{
                ret.push_back(ret.back());
                if (ret.back().back() == 'z'){
                    ret.back().back() = 'a';
                    continue;
                }
                ret.back().back() += 1;

            }
        }
        return ret;
    }
};

