namespace mitsuha{
struct RollingHash {
    using mint = modint61;
    static constexpr unsigned long long mod = mint::get_mod();
    const mint base;
    vector<mint> power;

    static inline mint generate_base() { return RNG(mod); }

    inline void expand(size_t sz) {
        if (power.size() < sz + 1) {
            int pre_sz = (int)power.size();
            power.resize(sz + 1);
            for(int i = pre_sz - 1; i < sz; ++i) power[i + 1] = power[i] * base;
        }
    }

    explicit RollingHash(mint base = generate_base()) : base(base), power{1} {}

    template <typename STRING>
    vector<mint> build(const STRING& s) const {
        int sz = s.size();
        vector<mint> hashed(sz + 1, mint(0));
        for (int i = 0; i < sz; i++) { hashed[i + 1] = hashed[i] * base + s[i]; }
        return hashed;
    }

    template <typename STRING>
    mint eval(STRING& s) {
        mint x = 0;
        for (auto& ch: s) x = base * x + ch;
        return x;
    }

    mint query(const vector<mint>& s, int l, int r) {
        Assert(r < s.size() and l >= 0 and l <= r);
        expand(r - l);
        return (s[r] - s[l] * power[r - l]);
    }

    mint combine(mint h1, mint h2, int h2len) {
        expand(h2len);
        return h1 * power[h2len] + h2;
    }

    mint add_char(mint h, int x) { return h * base + mint(x); }

    int lcp(const vector<mint>& a, int l1, int r1, const vector<mint>& b, int l2, int r2) {
        int len = min(r1 - l1, r2 - l2);
        int low = 0, high = len + 1;
        while (high - low > 1) {
            int mid = (low + high) / 2;
            if (query(a, l1, l1 + mid) == query(b, l2, l2 + mid))
                low = mid;
            else
                high = mid;
        }
        return low;
    }
};
} // namespace mitsuha

namespace mitsuha{
template <typename T>
struct Edge {
    int frm, to;
    T cost;
    int id;
};

template <typename T = int, bool directed = false>
struct Graph {
    static constexpr bool is_directed = directed;
    int N, M;
    using cost_type = T;
    using edge_type = Edge<T>;
    vector<edge_type> edges;
    vector<int> indptr;
    vector<edge_type> csr_edges;
    vector<int> vc_deg, vc_indeg, vc_outdeg;
    bool prepared;

    class OutgoingEdges {
    public:
        OutgoingEdges(const Graph* G, int l, int r) : G(G), l(l), r(r) {}

        const edge_type* begin() const {
            if (l == r) { return 0; }
            return &G->csr_edges[l];
        }

        const edge_type* end() const {
            if (l == r) { return 0; }
            return &G->csr_edges[r];
        }

    private:
        const Graph* G;
        int l, r;
    };

    bool is_prepared() { return prepared; }

    Graph() : N(0), M(0), prepared(0) {}
    Graph(int N) : N(N), M(0), prepared(0) {}

    void build(int n) {
        N = n, M = 0;
        prepared = 0;
        edges.clear();
        indptr.clear();
        csr_edges.clear();
        vc_deg.clear();
        vc_indeg.clear();
        vc_outdeg.clear();
    }

    void add(int frm, int to, T cost = 1, int i = -1) {
        assert(!prepared);
        assert(0 <= frm && 0 <= to && to < N);
        if (i == -1) i = M;
        auto e = edge_type({frm, to, cost, i});
        edges.emplace_back(e);
        ++M;
    }

#ifdef FASTIO
    // wt, off
    void read_tree(bool wt = false, int off = 1) { read_graph(N - 1, wt, off); }

    void read_graph(int M, bool wt = false, int off = 1) {
        for (int m = 0; m < M; ++m) {
            int a, b;
            read(a, b);
            a -= off, b -= off;
            if (!wt) {
                add(a, b);
            } else {
                T c;
                read(c);
                add(a, b, c);
            }
        }
        build();
    }
#endif

    void build() {
        assert(!prepared);
        prepared = true;
        indptr.assign(N + 1, 0);
        for (auto&& e: edges) {
            indptr[e.frm + 1]++;
            if (!directed) indptr[e.to + 1]++;
        }
        for (int v = 0; v < N; ++v) { indptr[v + 1] += indptr[v]; }
        auto counter = indptr;
        csr_edges.resize(indptr.back() + 1);
        for (auto&& e: edges) {
            csr_edges[counter[e.frm]++] = e;
            if (!directed)
                csr_edges[counter[e.to]++] = edge_type({e.to, e.frm, e.cost, e.id});
        }
    }

    OutgoingEdges operator[](int v) const {
        assert(prepared);
        return {this, indptr[v], indptr[v + 1]};
    }

    vector<int> deg_array() {
        if (vc_deg.empty()) calc_deg();
        return vc_deg;
    }

    pair<vector<int>, vector<int>> deg_array_inout() {
        if (vc_indeg.empty()) calc_deg_inout();
        return {vc_indeg, vc_outdeg};
    }

    int deg(int v) {
        if (vc_deg.empty()) calc_deg();
        return vc_deg[v];
    }

    int in_deg(int v) {
        if (vc_indeg.empty()) calc_deg_inout();
        return vc_indeg[v];
    }

    int out_deg(int v) {
        if (vc_outdeg.empty()) calc_deg_inout();
        return vc_outdeg[v];
    }

    vector<int> new_idx;
    vector<bool> used_e;

    // vertex V[i] in G become i in the new graph
    // {G, es}
    // The amount of calculation is sum(deg(v)),
    // Be careful as it may be larger than n+m in the new graph
    Graph<T, directed> rearrange(vector<int> V, bool keep_eid = 0) {
        if (len(new_idx) != N) new_idx.assign(N, -1);
        int n = len(V);
        For(i, n) new_idx[V[i]] = i;
        Graph<T, directed> G(n);
        vector<int> history;
        For(i, n) {
            for (auto&& e: (*this)[V[i]]) {
                if (len(used_e) <= e.id) used_e.resize(e.id + 1);
                if (used_e[e.id]) continue;
                int a = e.frm, b = e.to;
                if (new_idx[a] != -1 && new_idx[b] != -1) {
                    history.emplace_back(e.id);
                    used_e[e.id] = 1;
                    int eid = (keep_eid ? e.id : -1);
                    G.add(new_idx[a], new_idx[b], e.cost, eid);
                }
            }
        }
        For(i, n) new_idx[V[i]] = -1;
        for (auto&& eid: history) used_e[eid] = 0;
        G.build();
        return G;
    }

    Graph<T, true> to_directed_tree(int root = -1, bool directed_away_from_root = true) {
        if (root == -1) root = 0;
        assert(!is_directed && prepared && M == N - 1);
        Graph<T, true> G1(N);
        vector<int> par(N, -1);
        auto dfs = [&](auto& dfs, int v) -> void {
            for (auto& e: (*this)[v]) {
                if (e.to == par[v]) continue;
                par[e.to] = v, dfs(dfs, e.to);
            }
        };
        dfs(dfs, root);
        for (auto& e: edges) {
            int a = e.frm, b = e.to;
            if (par[a] == b) swap(a, b);
            assert(par[b] == a);
            if (directed_away_from_root)
                G1.add(a, b, e.cost);
            else
                G1.add(b, a, e.cost);
        }
        G1.build();
        return G1;
    }

private:
    void calc_deg() {
        assert(vc_deg.empty());
        vc_deg.resize(N);
        for (auto&& e: edges) vc_deg[e.frm]++, vc_deg[e.to]++;
    }

    void calc_deg_inout() {
        assert(vc_indeg.empty());
        vc_indeg.resize(N);
        vc_outdeg.resize(N);
        for (auto&& e: edges) { vc_indeg[e.to]++, vc_outdeg[e.frm]++; }
    }
};

template<typename T, bool directed = false>
std::ostream &operator<<(std::ostream &out, const Graph<T, directed> &_G){
    auto G = _G;
    if (not G.prepared) {
        out << "frm to cost id";
        for (auto &&e: G.edges) 
            out << "\n" << e.frm << " " << e.to << " " << e.cost << " " << e.id;
    } else {
        out << "indptr ";
        for(const auto &value : G.indptr) {
            out << value << " ";
        }
        out << "\n";
        out << "frm to cost id";
        for(int v = 0; v < G.N; ++v) 
            for (auto &&e: G[v]) 
            out << "\n" << e.frm << " " << e.to << " " << e.cost << " " << e.id;
    }
    return out;
}
} // namespace mitsuha

namespace mitsuha{
template<typename GT>
struct Tree {
    using Graph_type = GT;
    GT &G;
    using WT = typename GT::cost_type;
    int N;
    vector<int> LID, RID, head, V, parent, VtoE;
    vector<int> depth;
    vector<WT> depth_weighted;

    Tree(GT &G, int r = 0, bool hld = 1) : G(G) { build(r, hld); }

    void build(int r = 0, bool hld = 1) {
        if (r == -1) return;
        N = G.N;
        LID.assign(N, -1), RID.assign(N, -1), head.assign(N, r);
        V.assign(N, -1), parent.assign(N, -1), VtoE.assign(N, -1);
        depth.assign(N, -1), depth_weighted.assign(N, 0);
        assert(G.is_prepared());
        int t1 = 0;
        dfs_sz(r, -1, hld);
        dfs_hld(r, t1);
    }

    void dfs_sz(int v, int p, bool hld) {
        auto &sz = RID;
        parent[v] = p;
        depth[v] = (p == -1 ? 0 : depth[p] + 1);
        sz[v] = 1;
        int l = G.indptr[v], r = G.indptr[v + 1];
        auto &csr = G.csr_edges;
        for (int i = r - 2; i >= l; --i) {
            if (hld && depth[csr[i + 1].to] == -1) swap(csr[i], csr[i + 1]);
        }
        int hld_sz = 0;
        for (int i = l; i < r; ++i) {
            auto e = csr[i];
            if (depth[e.to] != -1) continue;
            depth_weighted[e.to] = depth_weighted[v] + e.cost;
            VtoE[e.to] = e.id;
            dfs_sz(e.to, v, hld);
            sz[v] += sz[e.to];
            if (hld && chmax(hld_sz, sz[e.to]) && l < i) { swap(csr[l], csr[i]); }
        }
    }

    void dfs_hld(int v, int &times) {
        LID[v] = times++;
        RID[v] += LID[v];
        V[LID[v]] = v;
        bool heavy = true;
        for (auto &&e: G[v]) {
            if (depth[e.to] <= depth[v]) continue;
            head[e.to] = (heavy ? head[v] : e.to);
            heavy = false;
            dfs_hld(e.to, times);
        }
    }

    vector<int> heavy_path_at(int v) {
        vector<int> P = {v};
        while (1) {
            int a = P.back();
            for (auto &&e: G[a]) {
                if (e.to != parent[a] && head[e.to] == v) {
                    P.emplace_back(e.to);
                    break;
                }
            }
            if (P.back() == a) break;
        }
        return P;
    }

    int heavy_child(int v) {
        int k = LID[v] + 1;
        if (k == N) return -1;
        int w = V[k];
        return (parent[w] == v ? w : -1);
    }

    int e_to_v(int eid) {
        auto e = G.edges[eid];
        return (parent[e.frm] == e.to ? e.frm : e.to);
    }

    int v_to_e(int v) { return VtoE[v]; }
    int get_eid(int u, int v) {
        if (parent[u] != v) swap(u, v);
        assert(parent[u] == v);
        return VtoE[u];
    }
    int ELID(int v) { return 2 * LID[v] - depth[v]; }
    int ERID(int v) { return 2 * RID[v] - depth[v] - 1; }

    /* k: 0-indexed */
    int la(int v, int k) {
        assert(k <= depth[v]);
        while (1) {
            int u = head[v];
            if (LID[v] - k >= LID[u]) return V[LID[v] - k];
            k -= LID[v] - LID[u] + 1;
            v = parent[u];
        }
    }

    int lca(int u, int v) {
        for (;; v = parent[head[v]]) {
            if (LID[u] > LID[v]) swap(u, v);
            if (head[u] == head[v]) return u;
        }
    }

    int meet(int a, int b, int c) { return lca(a, b) ^ lca(a, c) ^ lca(b, c); }

    int lca_root(int u, int v, int root) {
        return lca(u, v) ^ lca(u, root) ^ lca(v, root);
    }

    int subtree_size(int v, int root = -1) {
        if (root == -1) return RID[v] - LID[v];
        if (v == root) return N;
        int x = jump(v, root, 1);
        if (in_subtree(v, x)) return RID[v] - LID[v];
        return N - RID[x] + LID[x];
    }

    int dist(int a, int b) {
        int c = lca(a, b);
        return depth[a] + depth[b] - 2 * depth[c];
    }

    WT dist_weighted(int a, int b) {
        int c = lca(a, b);
        return depth_weighted[a] + depth_weighted[b] - WT(2) * depth_weighted[c];
    }

    // a is in b
    bool in_subtree(int a, int b) { return LID[b] <= LID[a] && LID[a] < RID[b]; }

    int jump(int a, int b, long long k) {
        if (k == 1) {
            if (a == b) return -1;
            return (in_subtree(b, a) ? la(b, depth[b] - depth[a] - 1) : parent[a]);
        }
        int c = lca(a, b);
        int d_ac = depth[a] - depth[c];
        int d_bc = depth[b] - depth[c];
        if (k > d_ac + d_bc) return -1;
        if (k <= d_ac) return la(a, k);
        return la(b, d_ac + d_bc - k);
    }

    vector<int> collect_child(int v) {
        vector<int> res;
        for (auto &&e: G[v]) if (e.to != parent[v]) res.emplace_back(e.to);
        ranges::sort(res);
        return res;
    }

    vector<int> collect_light(int v) {
        vector<int> res;
        bool skip = true;
        for (auto &&e: G[v])
            if (e.to != parent[v]) {
                if (!skip) res.emplace_back(e.to);
                skip = false;
            }
        return res;
    }

    vector<pair<int, int>> get_path_decomposition(int u, int v, bool edge) {
        vector<pair<int, int>> up, down;
        while (1) {
            if (head[u] == head[v]) break;
            if (LID[u] < LID[v]) {
                down.emplace_back(LID[head[v]], LID[v]);
                v = parent[head[v]];
            } else {
                up.emplace_back(LID[u], LID[head[u]]);
                u = parent[head[u]];
            }
        }
        if (LID[u] < LID[v]) down.emplace_back(LID[u] + edge, LID[v]);
        else if (LID[v] + edge <= LID[u]) up.emplace_back(LID[u], LID[v] + edge);
        reverse(down.begin(), down.end());
        up.insert(up.end(), down.begin(), down.end());
        return up;
    }

    vector<int> restore_path(int u, int v) {
        vector<int> P;
        for (auto &&[a, b]: get_path_decomposition(u, v, 0)) {
            if (a <= b) for (int i = a; i <= b; i++) P.emplace_back(V[i]);
            else for (int i = a; i >= b; i--) P.emplace_back(V[i]);
        }
        return P;
    }

    // path intersection of [a, b] x [c, d]
    // {-1, -1} if there wasn't any intersection
    // https://codeforces.com/problemset/problem/500/G
    pair<int, int> path_intersection(int a, int b, int c, int d) {
        int ab = lca(a, b), ac = lca(a, c), ad = lca(a, d);
        int bc = lca(b, c), bd = lca(b, d), cd = lca(c, d);
        int x = ab ^ ac ^ bc, y = ab ^ ad ^ bd; // meet(a,b,c), meet(a,b,d)
        if (x != y) return {x, y};
        int z = ac ^ ad ^ cd;
        if (x != z) x = -1;
        return {x, x};
    }
};
} // namespace mitsuha

class Solution {
public:
    vector<bool> findAnswer(vector<int>& parent, string s) {

        vector<int> ord;

        int n = len(parent);
        ord.reserve(n);

        vector<vector<int>> adj(n);
        vector<int> sz(n, 1);
        For(x, 1, n) adj[parent[x]].push_back(x);

        auto dfs = [&](auto &&dfs, int v)-> int{
            for (auto &ch: adj[v]){
                sz[v] += dfs(dfs, ch);
            }
            ord.push_back(v);
            return sz[v];
        };

        dfs(dfs, 0);

        str t(n, 'a');

        For(x, n){
            t[x] = s[ord[x]];
        }

        str r = t;
        ranges::reverse(r);

        RollingHash Rh;

        auto Fh = Rh.build(t);
        auto Bh = Rh.build(r);

        vector<bool> ret(n);

        For(x, n){
            int v = ord[x];

            auto F = Rh.query(Fh, x + 1 - sz[v], x + 1);
            auto B = Rh.query(Bh, n - 1 - x, n - 1 - x + sz[v]);
            ret[ord[x]] = F == B;
        }
        return ret;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.length(), result = 0;

        for(int len = 1; len <= n; len++) {
            vector<int> freq(26, 0);

            for(int i = 0; i < len; i++) {
                freq[s[i] - 'a']++;
            }

            if(hasCharWithFreqK(freq, k)) result++;

            for(int i = len; i < n; i++) {
                freq[s[i] - 'a']++;
                freq[s[i-len] - 'a']--;
                if(hasCharWithFreqK(freq, k)) result++;
            }
        }
        return result;
    }

private:
    bool hasCharWithFreqK(vector<int>& freq, int k) {
        for(int f : freq) {
            if(f >= k) return true;
        }
        return false;
    }
};

class Solution {
