class Solution {
    vector<vector<int>> g;
    vector<int> sz;
    vector<bool> ans;
    vector<long long> v1;
    vector<long long> v2;
    vector<long long> rev1;
    vector<long long> rev2;

    int n;
    const long long mod1 = 998244353;
    const long long mod2 = 1e9 + 9;
    long long base = 31;
    string cur;

    int pow(long long num, int k, long long mod) {
        long long ret = 1;

        while (k > 0) {
            if (k & 1) {
                ret = (ret * num) % mod;
            }

            num = (num * num) % mod;

            k /= 2;
        }

        return ret;
    }

    void dfs(int u) {
        long long num = cur[u] - 'a' + 1;

        if (g[u].size() == 0) {
            v1[u] = num;
            v2[u] = num;
            rev1[u] = num;
            rev2[u] = num;
            ans[u] = true;
            return;
        }

        for (const auto& v : g[u]) {
            dfs(v);

            v1[u] *= pow(base, sz[v], mod1);
            v1[u] = (v1[u] + v1[v]) % mod1;

            v2[u] *= pow(base, sz[v], mod2);
            v2[u] = (v2[u] + v2[v]) % mod2;

            sz[u] += sz[v];
        }

        v1[u] *= base;
        v2[u] *= base;
        v1[u] = (v1[u] + num) % mod1;
        v2[u] = (v2[u] + num) % mod2;


        rev1[u] = num;
        rev2[u] = num;

        for (int i = g[u].size() - 1; i >= 0; i--) {
            int v = g[u][i];

            rev1[u] *= pow(base, sz[v], mod1);
            rev1[u] = (rev1[u] + rev1[v]) % mod1;

            rev2[u] *= pow(base, sz[v], mod2);
            rev2[u] = (rev2[u] + rev2[v]) % mod2;
        }

        if (v1[u] == rev1[u] && v2[u] == rev2[u]) {
            ans[u] = true;
        }
    }

public:
    vector<bool> findAnswer(vector<int>& parent, string s) {
        n = parent.size();
        g = vector<vector<int>>(n);
        sz = vector<int>(n, 1);

        for (int i = 1; i < n; i++) {
            g[parent[i]].push_back(i);
        }

        cur = s;
        ans = vector<bool>(n, false);
        v1 = vector<long long>(n, 0);
        v2 = vector<long long>(n, 0);
        rev1 = vector<long long>(n);
        rev2 = vector<long long>(n);

        dfs(0);

        return ans;
    }
};

