        vector<bool> b(a, false);
        vector<pqr> c =fun2(a);
        vector<vector<pqr>> d = fun1(p, a);
        fun(0, d, c, b, e);
        return b;
    }
};

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int ans=0,n = s.length();
        for(int i=0;i<n;i++) {
            int[] fre = new int[26];
            for(int j=i;j<n;j++) {
                fre[s.charAt(j)-'a']++;
                for(int f : fre) {
                    if(f>=k) {
                        ans++;
                        break;
                    }
                }
            }
        }
        return ans;
    }
}

