#define ll long long
class Solution {
public:
    vector<vector<int>>adj;
    vector<bool>res;
    vector<ll> power,val,val1;
    const ll p = 37;
    const ll mod = 1e9 + 7;
    void init(int n){
        power.resize(n+1,0);
        power[0] = 1;
        for(int i=1;i<=n;i++){
            power[i] = (power[i-1]*1LL*p)%mod; 
        }
    }
    ll f(ll x,ll y,ll sz){
        ll hash=x%mod;
        ll tmp=(y*(power[sz]%mod))%mod;
        ll res=(hash+tmp)%mod;
        return (res+mod)%mod;
    }

    pair<ll,ll> dfs(int u,string &s){
        ll res=0;ll sz1=0;
        for(auto v:adj[u]){
            pair<ll,ll>p=dfs(v,s);
            ll tmp=p.first;
            ll sz=p.second;
            res=f(res,tmp,sz1);
            sz1+=sz;
        }
        ll hx=power[sz1]*(s[u]-'a'+1);
        hx%=mod;
        res=(res+hx)%mod;
        val[u]=res;
        return {res,sz1+1};
    }
    pair<ll,ll> dfs1(int u,string &s){
        ll res=0;ll sz1=0;
        ll hx=power[sz1]*(s[u]-'a'+1);
        hx%=mod;
        res=(res+hx)%mod;
        sz1++;
        for(int i=adj[u].size()-1;i>=0;i--){
            int v=adj[u][i];
            pair<ll,ll>p=dfs1(v,s);
            ll tmp=p.first;
            ll sz=p.second;
            res=f(res,tmp,sz1);
            res%=mod;
            sz1+=sz;
        }
        val1[u]=res;
        return {res,sz1};
    }


    vector<bool> findAnswer(vector<int>& p, string s) {
        int n=p.size();
        adj.resize(n);
        for(int i=0;i<n;i++){
            if(p[i]!=-1) adj[p[i]].push_back(i);
        }
        init(n+1);
        res.resize(n,0);
        val.resize(n,0);
        val1.resize(n,0);
        dfs(0,s);
        dfs1(0,s);
        for(int i=0;i<n;i++){
            // cout<<val[i]<<" "<<val1[i]<<endl;
            if(val[i]==val1[i]) res[i]=1;
        }
        return res; 
    }
};

