class Solution:
    def minOperations(self, nums: List[int]) -> int:
        def greatest(num):
            if num <= 2:
                return 1

            for f in range(2, ceil(sqrt(num)) + 1):
                if num % f == 0:
                    return num // f

            return 1

        res = 0
        for i in reversed(range(len(nums) - 1)):
            while nums[i] > nums[i + 1]:
                f = greatest(nums[i])

                if f == 1:
                    return -1

                res += 1
                nums[i] //= f

        return res

class Solution {
