        int start = 0;
        unordered_map<char, int> mp;
        for(int i = 0; i<n; i++) {
            char tmp = s[i];            
            mp[tmp]++;
            while (isValid(mp, k)) {
                cnt += (n - i); 
                char ch = s[start];
                mp[ch]--;
                if (mp[ch] == 0) {
                    mp.erase(ch); 
                }
                start++;
            }
        }        
        return cnt;
    }

    bool isValid(unordered_map<char, int>& freqMap, int k) {
        for(auto& it : freqMap) {
            if (it.second >= k) return true;
        }
        return false;
    }
};

