        int n = nums.size();
        int op = 0;
        for(int i=n-2; i>=0; --i) {
            if (nums[i] > nums[i + 1]) {
                int cnt = 0;
                while(nums[i] > nums[i+1]) {
                    int tmp = div(nums[i]);
                    if(tmp == 1) return -1;
                    nums[i] /= tmp;
                    cnt++;
                    if(nums[i] <= nums[i+1]) break;
                }
                op += cnt;
            }
        }        
        return op;
    }

private:
    int div(int x) {
        for(int i=2; i<= x/2; ++i) {
            if(x % i == 0) return x/i;
        }
        return 1; 
    }
