class Solution {
public:


    int Divide(int num){

        int idx = 3;

        if(num%2 == 0){
            return 2;
        }
        while(idx * idx <= num){
            if(num%idx == 0){
                return idx;
            }
            idx += 2;
        }

        return -1;
    }

    int minOperations(std::vector<int>& nums) {

        int max_element = *std::max_element(nums.begin(), nums.end());
        std::vector<bool> is_prime(max_element+1, true);

        is_prime[0] = false;
        is_prime[1] = false;

        for(long long i = 2; i*i <= max_element; i++){

            if(!is_prime[i]) continue;

            for(long long j = i*i; j <= max_element; j += i){
                is_prime[j] = false;
            }
        }


        int result = 0;
        for(int i = (int)nums.size()-2; i >= 0; i--){

            if(nums[i] <= nums[i+1]) continue;

            while(nums[i] > nums[i+1]){

                if(is_prime[nums[i]]) return -1;

                int next = Divide(nums[i]);
                if(next == -1) return -1;
                result++;
                nums[i] = next;
            }
        }

        return result;
    }
};

