class Solution {
public:
    int helper(int num, vector<int>& primes){
        for(const int& prime : primes){
            if(num % prime == 0){
                return prime;
            }
        }
        return num;
    }

    int minOperations(vector<int>& nums) {
        vector<int> primes = {2};
        vector<bool> visited(sqrt(1e6), false);
        for(int i = 3; i <= sqrt(1e6); i += 2){
            if(!visited[i]){
                primes.push_back(i);
                for(int j = i * i ; j <= sqrt(1e6); j += 2 * i){
                    visited[j] = true;
                }
            }
        }

        int count = 0;
        int max_val = INT_MAX;
        for(int i = nums.size() - 1; i >= 0; --i){
            if(nums[i] > max_val){
                nums[i] = helper(nums[i], primes);
                count += 1;
            }
            if(nums[i] > max_val){
                return -1;
            }
            max_val = nums[i];
        }
        return count;
    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        subs = 0
        chars = {}
        earliest = n

        for i in range(len(s) - 1, -1, -1):
            c = s[i]
            if c not in chars:
                chars[c] = deque([])
            chars[c].appendleft(i)
            if len(chars[c]) > k: chars[c].pop()
