class Solution {
public:
    int minOperations(vector<int>& nums) {
        int last = INT_MAX;
        int result = 0;
        unordered_map<int, int> memo;
        const auto get = [&memo](int val) {
           auto it = memo.find(val);
            if (it == memo.end()) {
                int result = -1;
                for (int i = 2; 1LL * i * i <= val; ++i) {
                    if (val % i == 0) {
                        result = val / i;
                        break;
                    }
                }
                it = memo.emplace(val, result).first;
            }
            return it->second;
        };
        for (int i = nums.size() - 1; i >= 0; --i) {
            int num = nums[i];
            while (num > last) {
                int f = get(num);
                if (f < 0) {
                    return -1;
                }
                ++result;
                num /= f;
            }
            last = num;
        }
        return result;
    }
};

class Solution {
