        const int N = s.size();
        vector<vector<int>> psum(26, vector<int>{0});
        for (int i = 0; i < N; ++i) {
            for (int c = 0; c < 26; ++c) psum[c].push_back(psum[c].back() + (s[i] == 'a' + c ? 1 : 0));
        }
        // for (int c = 0; c < 26; ++c) { for (auto n: psum[c]) cout << n << " "; cout << endl; }
        int ans = 0;
        for (int i = 0; i < N; ++i) {
            for (int j = i; j < N; ++j) {
                for (int c = 0; c < 26; ++c) {
                    if (psum[c][j + 1] - psum[c][i] >= k) { ++ans; break; }
                }
            }
        }
        return ans;
    }
};

