class Solution {
public:
    int minOperations(vector<int>& nums) {
        const int N = nums.size();
        unordered_map<int, int> cache;
        auto gpd = [&](int n) {
            auto p = cache.find(n);
            if (p != cache.end()) return p->second;
            for (int i = 2; i * i <= n; ++i) if (n % i == 0) return cache[n] = max(i, n / i);
            return cache[n] = -1;
        };
        int ans = 0;
        for (int i = N - 2; i >= 0; --i) {
            while (nums[i] > nums[i + 1]) {
                auto d = gpd(nums[i]);
                if (d == -1) return -1;
                nums[i] /= d;
                ++ans;
            }
        }
        return ans;
    }
};

