class Solution {
    public int minOperations(int[] nums) {
        int n = nums.length;
        ArrayList<Integer> list= new ArrayList<>();
        for(int i = 0; i < n; i++){
            boolean div = false;
            for(int j = 2; j * j <= nums[i];j++){
                if(nums[i]%j == 0){
                    div = true;
                    list.add(j);
                    break;
                }
            }
            if(!div) list.add(nums[i]);
        }
        int operations = 0;
        boolean valid = true;
        int last = nums[n-1];
        for(int i = n-2;i>=0;i--){
            if(nums[i] <= last){
                last = nums[i];
            }else if(list.get(i) <= last) {
                last = list.get(i);
                operations++;
            }else {
                valid =false;
            }
        }

        return valid ? operations : -1;
    }
}

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int n = s.length();
        int b = -1;
        int[] cts = new int[26];
        int ans = 0;
        for (int a = 0; a < n; ++a) {
            while (true) {
                int mcat = 0;
                for (int x : cts)
                    mcat = Math.max(mcat,x);
                if (mcat>=k)
                    break;
                if (b==n)
                    break;
                ++b;
                if (b==n)
                    break;
                cts[s.charAt(b)-'a']++;
            }
            ans += n-b;
            cts[s.charAt(a)-'a']--;
        }
        return ans;
    }
}

