            ++ans;
            for (int p : primes) {
                if (p*p>val)
                    break;
                if (val%p==0)
                    val = p;
            }
            if (val<=curr) {
                curr = val;
                continue;
            } else {
                return -1;
            }
        }
        return ans;
    }
}

class Solution {
    public int numberOfSubstrings(String s, int k) {
        char[] arr = s.toCharArray();
        int n = arr.length;
        int[] cnt = new int[26];
        int j = 0, result = 0;
        for (int i = 0; i < n; i++) {
            cnt[arr[i] - 'a']++;
            while (hasK(cnt, k)) {
                result += n - i;
                cnt[arr[j] - 'a']--;
                j++;
            }
        }
        return result;

    }
    private boolean hasK(int[] cnt, int k) {
        for (int ct  : cnt) {
            if (ct >= k) {
                return true;
            }
        }
        return false;
    }
}

class Solution {
    public List<String> stringSequence(String target) {
        List<String> result = new ArrayList<>();
        StringBuilder current = new StringBuilder();

        // Start typing the target string
        for (int i = 0; i < target.length(); i++) {
            char targetChar = target.charAt(i);
            if (current.length() == 0) {
                // We begin by typing 'a' since the screen is initially empty
                current.append('a');
                result.add(current.toString());
            } else {
                current.append('a');  // Press Key 1 to append 'a'
                result.add(current.toString());
            }

            // Now adjust the last character using Key 2 until it matches targetChar
            while (current.charAt(current.length() - 1) != targetChar) {
                current.setCharAt(current.length() - 1, getNextChar(current.charAt(current.length() - 1)));
                result.add(current.toString());
            }
        }
        return result;
    }
    private char getNextChar(char c) {
        if (c == 'z') {
            return 'a';  // 'z' wraps around to 'a'
        } else {
            return (char) (c + 1);
        }
    }
}

class Solution {
    public int minOperations(int[] nums) {
        int n = nums.length, result = 0;
        for (int i = n - 2; i >= 0; i--) {
            if (nums[i] <= nums[i + 1]) {
                continue;
            }
            int cur = nums[i];
            while (cur > nums[i + 1]) {
                int d = findGreatest(cur);
                if (d == 1) {
                    return -1;
                }
                cur = cur / d;
                result++;
            }
            nums[i] = cur;
        }
        return result;

    }
    private int findGreatest(int x) {
        for (int i = 2; i * i < x + 1; i++) {
            if (x % i == 0) {
                return x / i;
            }
        }
        return 1;
    }
}

