		int n = sz(nums);
		int ans = 0;

		fo(i, 1, n - 1) {
			while (nums[i] > nums[i - 1]) {
				if (f[nums[i]] == nums[i]) break;
				nums[i] /= f[nums[i]];
				ans++;
			}
			if (nums[i] > nums[i - 1]) return -1;
		}
		return ans;
	}
};

