class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.length();
        map<char, int> count;
        int r = 0;
        while(r < n){
            if(++count[s[r++]]==k) break;
        }
        if(r == n && count[s[r-1]] < k) return 0;
        int ret = n-r+1;
        for(int l = 1; l < n; ++l){
            count[s[l-1]]--;
            if(count[s[l-1]]==k-1){
                while(r < n){
                    if(++count[s[r++]]==k) break;
                }
            }
            if(r == n && count[s[r-1]] < k) return ret;
            ret += n-r+1;
        }
        return ret;
    }
};

