class Solution {
    public int numberOfSubstrings(String s, int k) {
        char[] c = s.toCharArray();
        int result = 0;

        int[] times = new int[26];
        int maxTimes = 0;
        int start = 0;
        for (int end = 0; end < c.length; end++) {
            char x = c[end];
            times[x - 'a']++;
            if (times[x - 'a'] > maxTimes) {
                maxTimes = times[x - 'a'];
            }

            while (maxTimes >= k) {
                result += c.length - end;
                times[c[start] - 'a']--;
                start++;
                maxTimes = get(times);
            }
        }
        return result;
    }

    public int get(int[] times) {
        int result = 0;
        for (int x: times) {
            result = Math.max(result, x);
        }
        return result;
    }
}

