class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans=0;
        int n=s.size();
        for(int i=1;i<=n;i++) {
            for(int j=0;j<26;j++) {
                dp[i][j]=dp[i-1][j];
            }
            int cv=s[i-1]-'a';
            dp[i][cv]+=1;
        }
        for(int i=1;i<=n;i++) {
            int lo=i, hi=n, re=-1;
            while(lo<=hi) {
                int mi=(lo+hi)/2;
                int f=0;
                for(int j=0;j<26;j++) {
                    int cc=dp[mi][j]-dp[i-1][j];
                    if(cc>=k) {
                        f=1;
                        break;
                    }
                }
                if(f) re=mi, hi=mi-1;
                else lo=mi+1;
            }
            if(re!=-1) ans += (n-re+1);
        }
        return ans;
    }
};

