    public int smallestPrimeFactor(int n) {
        if (n <= 1) {
            return 1;
        }

        if (n % 2 == 0) {
            return 2;
        }

        for (int i = 3; i * i <= n; i += 2) {
            if (n % i == 0) {
                return i; 
            }
        }
        return n;
    }
}

