class Solution:
    def minOperations(self, nums: List[int]) -> int:
        ops = 0
        for i in range(len(nums)-1, 0, -1):
            curr = nums[i]
            while nums[i-1] > curr:
                d = self.findLargestDivisor(nums[i-1])
                if d == 1:
                    return -1
                nums[i-1] = nums[i-1]//d
                ops += 1

        return ops


    def findLargestDivisor(self, n):
        if n%2 == 0:
            return n//2

        d = 3
        while d*d <= n:
            if n%d == 0:
                return n//d
            d += 2
        return 1

