class Solution {
    public int minOperations(int[] nums) {
        // Primes wont change
        int n = nums.length;
        int ans = 0;
        int min = nums[n-1];
        for(int i = n-2; i >= 0; i--)
        {
            while(nums[i] > nums[i+1])
            {
                int newVal = nums[i] / func(nums[i]);
                if(newVal == nums[i])
                    break;
                nums[i] = newVal;
                ans++;
            }
        }
        // System.out.println(Arrays.toString(nums));
        for(int i = 1; i < n; i++)
        {
            if(nums[i] < nums[i-1])
                return -1;
        }
        return ans;
    }

    private int func(int N)
    {
        int max = 1;
        for(int i = 2; i*i <= N; i++)
        {
            if(N % i == 0)
                max = Math.max(max, N / i);
        }
        return max;
    }
}

