            int numb = nums[a];
            int lim = sqrt(numb);
            int div = 1;
            for(int b=2; b<=lim; b++){
                if(numb%b==0){
                    div = max(div, b);
                    div = max(div, (numb/b));
                }
            }

            if(div==1)
                return -1;
            ans += 1;
            nums[a]/=div;
            goto rep;
        }
        return ans;

    }
};

