function pre(n) {
    mind = Array(n)
    for (let i = 0; i < n; i++) {
        mind[i] = i
    }
    for (let p = 2; p < n; p++) {
        if (mind[p] !== p) continue
        for (let d = 2 * p; d < n; d += p) {
            mind[d] = Math.min(mind[d], p)
        }
    }
    for (let i = 0; i < n; i++) {
        mind[i] = mind[i] === i ? Infinity : mind[i]
    }
}
