var minOperations = function(nums) {
    const n = nums.length
    const dp0 = Array(n)
    const dp1 = Array(n)
    for (let i = 0; i < n; i++) {
        const x = nums[i]
        let a = Infinity, b = Infinity
        if (i) {
            if (x >= nums[i - 1]) {
                a = Math.min(a, dp0[i - 1])
            }
            if (x >= mind[nums[i - 1]]) {
                a = Math.min(a, dp1[i - 1])
            }
            if (mind[x] < x) {
                if (mind[x] >= nums[i - 1]) {
                    b = Math.min(b, dp0[i - 1] + 1)
                }
                if (mind[x] >= mind[nums[i - 1]]) {
                    b = Math.min(b, dp1[i - 1] + 1)
                }
            }
        } else {
            a = 0
            b = mind[x] >= x ? Infinity : 1
        }
        dp0[i] = a
        dp1[i] = b
    }
    // console.log(dp0, dp1)
    const x = Math.min(dp0[n - 1], dp1[n - 1])
    return x === Infinity ? -1 : x
};

from collections import defaultdict
class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        n = len(s)
        start = 0
        char_count = defaultdict(int)
        total_substrings = 0
        valid_count = 0

        for end in range(n):
            char_count[s[end]] += 1

            if char_count[s[end]] == k:
                valid_count += 1

            while valid_count > 0:  
                total_substrings += (n - end)
                char_count[s[start]] -= 1

                if char_count[s[start]] == k - 1:
                    valid_count -= 1
                start += 1

