        for (int i = n-2; i >= 0; i --)
        {
            while (nums[i] > curMin)
            {
                int gd = findGreatestDivisor(nums[i]);
                if (gd == 1) return -1;
                result++;
                nums[i] = nums[i]/gd;
            }

            curMin = min(nums[i], curMin);
        }

        return result;
    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        i = 0
        res = 0
        n = len(s)
        count = Counter()
        for j in range(n):
            count[s[j]] += 1
            if max(count.values()) >= k:
                res += n - j
            while max(count.values()) >= k:
                count[s[i]] -= 1
                i += 1
                if max(count.values()) >= k:
                    res += n - j
        return res

