    int findGreatestDivisor(int n) {
        for (int i=2; i<n; i++) {
            if (n % i == 0) {
                return n/i ;
            }
        }

        return -1 ;
    }
    int minOperations(vector<int>& nums) {
        int len = nums.size() ;
        int prev = nums[len-1] ;
        int ans = 0 ;

        for (int i=len-2; i>=0; i--) {
            while (nums[i] > prev) {
                int d = findGreatestDivisor(nums[i]) ;
                if (d == -1) {
                    return -1 ;
                }
                nums[i] = nums[i] / d ;
                ans++ ;
            }

            prev = nums[i] ;
        }

        return ans ;
    }
};

