        for(int i=2;i*i<=x;i++){
             if(x%i==0){
                st.insert(i);
                st.insert(x/i);
             }   
        }
        if(st.size()==0)return 1;
        return *st.rbegin();
   }
    int minOperations(vector<int>& nums) {
    int operations = 0;
    int n = nums.size();

    for (int i = n - 2; i >= 0; --i) {
        while (nums[i] > nums[i + 1]) {
            int gpd = greatestProperDivisor(nums[i]);
            if (gpd == 1) {  
                return -1;
            }
            nums[i] /= gpd;  
            operations++;  

            if (nums[i] <= nums[i + 1]) {
                break;
            }
        }
    }

    return operations;
    }
