class Solution {
public:
    static bool cmp(const pair<int,char> &p1,const pair<int,char> &p2) {
        return p1.first<p2.first;
    }
    int numberOfSubstrings(string s, int k) {
        int ans=0;
        int l=0,r=0;
        int n=s.size();
        set<pair<int,char>,decltype(&cmp)> s1(&cmp);
        map<char,int> m1;
        while(r<n) {
            s1.erase({m1[s[r]],s[r]});
            m1[s[r]]++;
            s1.insert({m1[s[r]],s[r]});
            auto it=s1.end();it--;
            int d=(*it).first;
            while(d>=k) {
                ans+=(n-r);
                s1.erase({m1[s[l]],s[l]});
                m1[s[l]]--;
                if(m1[s[l]]) s1.insert({m1[s[l]],s[l]});
                if(s1.size()) {
                    it=s1.end();it--;
                d=(*it).first;
                }
                else d=0;
                l++;
            }
            r++;
        }
        return ans;
    }
};

