class Solution {
public:
    int update(vector<int> &nums,int i) {
        int d=nums[i];
        int y=nums[i+1];
        while(d>y) {
            int m=0;
            for(int i=1;i*i<=d;i++) {
                if(d%i==0) {
                    int j=(d/i);
                    if(i<d) m=max(m,i);
                    if(j<d) m=max(m,j);
                }
            }
            if(m==1) return -1;
            else d/=m;
        }
        return d;
    }
    int minOperations(vector<int>& nums) {
        int ans=0;
        int n=nums.size();
        int p=nums[n-1];
        for(int i=n-2;i>=0;i--) {
            while(nums[i]>nums[i+1]) {
                ans++;
                int u=update(nums,i);
                if(u==-1) return -1;
                nums[i]=u;
            }
        }
        return ans;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int n = s.size();
    int totalCount = 0;

    // Iterate over all starting points of the sliding window
    for (int start = 0; start < n; ++start) {
        unordered_map<char, int> freq; // Frequency map to store character counts

        // Extend the window from `start` to `end`
        for (int end = start; end < n; ++end) {
            char currentChar = s[end];
            freq[currentChar]++;

            // If any character's frequency >= k, this substring is valid
            for (auto &[ch, count] : freq) {
                if (count >= k) {
                    totalCount++;
                    break; // No need to check further characters
                }
            }
        }
    }

    return totalCount;
    }
};

