class Solution {
public:
    static std::vector<int> gpd;

    static void calculateGPD(int n) {
        gpd.resize(n + 1);
        gpd[0] = 0;
        gpd[1] = 0;

        for (int i = 2; i <= n; ++i) {
            for (int j = i * 2; j <= n; j += i) {
                gpd[j] = i;
            }
        }
    }
    bool check(int mid,vector<int>v){
        int n=v.size();
        int cnt=0;
        for(int i=n-2;i>=0;i--){
            while(v[i]>v[i+1]){
                if(gpd[v[i]]==0)return false;
                v[i]/=gpd[v[i]];
                cnt++;
            }
        }
        return cnt<=mid;
    }
    int minOperations(vector<int>& nums) {
        if(gpd.size()==0){
            calculateGPD(1e6+5);
        }
        int l=0,r=1e9;
        while(l<=r){
            int mid=(l+r)>>1;
            if(check(mid,nums)){
                r=mid-1;
            }
            else{
                l=mid+1;
            }
        }
        if(l==1000000001)return -1;
        return l;
    }
};
