from collections import Counter
import string


class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        counter = Counter()
        n = len(s)

        def is_valid():
            for char in string.ascii_lowercase:
                if counter[char] >= k:
                    return True
            return False

        ans = 0

        j = 0
        for i in range(n):
            while j < n and not is_valid():
                counter[s[j]] += 1
                j += 1
            if is_valid():
                ans += n - j + 1
            counter[s[i]] -= 1
        return ans

