        int ans = 0;
        for (int i = n - 2; i >= 0; --i) {
            while (nums[i] > nums[i + 1]) {
                if (spf[nums[i]] == nums[i]) return -1;
                nums[i] = spf[nums[i]];
                ++ans;
            }
        }
        return ans;
    }
};

