class Solution {
    private boolean numberOfSubstringsCheck(int[] count, int k) {
        for (int i : count) {
            if (i >= k) {
                return true;
            }
        }
        return false;
    }
    public int numberOfSubstrings(String s, int k) {
        int ans = 0, n = s.length();
        int pl = 0, pr = 0;
        int[] count = new int[26];
        count[s.charAt(0) - 'a']++;
        while (pl < n) {
            while (numberOfSubstringsCheck(count, k)) {
                ans += n - pr;
                count[s.charAt(pl) - 'a']--;
                pl++;
            }
            if (pr >= n) {
                break;
            }
            pr++;
            if (pr < n) {
                count[s.charAt(pr) - 'a']++;
            }
        }
        return ans;
    }
}

