class Solution {

    private int minOperationsFindGPD(int num) {
        if (num <= 3) {
            return -1;
        }
        int sqrt = (int) Math.sqrt(num);
        for (int j = 2; j <= sqrt; j++) {
            if (num % j == 0) {
                return num / j;
            }
        }
        return -1;
    }

    public int minOperations(int[] nums) {
        int n = nums.length;
        int ans = 0;
        for (int i = n - 2; i >= 0; i--) {
            while (nums[i] > nums[i + 1]) {
                int gpd = minOperationsFindGPD(nums[i]);
                if (gpd == -1) {
                    return -1;
                }
                nums[i] /= gpd;
                ans++;
            }
        }
        return ans;
    }
}

