class Solution {
    class A{
        int num ; 
        int ct ; 
        A(int num, int ct){
            this.num = num ; 
            this.ct = ct ; 
        }
    }
    public int minOperations(int[] nums) {
        int n = nums.length ; 
        int ct = 0 ; 
        for(int i=n-2 ; i>=0 ; i--){
            if(nums[i]<=nums[i+1]) continue ; 
            A a = f(nums[i], nums[i+1]) ; 
            if(a.num<= nums[i+1]){
                nums[i] = a.num ; 
                ct += a.ct ; 
            }
            else return -1 ; 
        }
        return ct ; 
    }
    private A f(int a, int b){
        int ct = 0 ; 
        for(int i=2; i*i<=a ; i++){
            if(a%i==0){
                ct++ ; 
                a /= (a/i) ; 
                if(a<=b) break ; 
                else i=2 ; 
            }
        }
        ct = (a<=b)?ct : -1 ; 
        return new A(a, ct) ; 
    }
}

