class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();

        int cnt = 0;
        int prev = nums[n-1];

        for(int i = n-2; i>=0; i--){
            int ele = nums[i];
            if(ele <= prev){
                prev = nums[i];
                continue;
            }
            else{
                while(ele>prev){
                    for(int j = 2; j*j<=ele; j++){
                        if(ele%j == 0){
                            ele = j;
                            break;
                        }
                    }

                    if(ele > prev){
                        return -1;
                    }
                    else{
                        cnt++;
                    }
                }

                prev = ele;
            }
        }
        return cnt;
    }
};

