        int i=0,j=0,n=s.size();
        vector<int>count(26,0);
        int res=0;
        while(j<n){
            count[s[j]-'a']++;
            if(count[s[j]-'a']==k)break;
            j++;
        }
        if(j==n)return res;
        while(i<n){
            count[s[i]-'a']--;
            if(!test(count,k)){
                count[s[i]-'a']++;
                break;
            }
            else i++;;
        }
        res+=(i+1);
        j++;
        while(j<n){
            count[s[j]-'a']++;
            while(i<n){
                count[s[i]-'a']--;
                if(!test(count,k)){
                    count[s[i]-'a']++;
                    break;
                }
                else i++;
            }
            j++;
            res+=(i+1);
        }
        return res;
    }
};

