static vector<int>store;
static bool val=0;
int helper(int x){
    if(store[x]!=-2)return store[x];
    for(int i=2;i<=sqrt(x);i++){
        if(x%i==0){
            return store[x]=x/i;
        }
    }
    return store[x]=-1;
}
class Solution {
public:
    int minOperations(vector<int>& nums) {
        int res=0;
        if(!val){
            store.resize(1e7,-2);
            val=1;
        }
        for(int i=nums.size()-2;i>=0;i--){
            int ele=nums[i+1],val=nums[i];
            while(val>ele){
                if(store[val]==-1)return -1;
                if(store[val]!=-2)val/=store[val];
                else {
                    int x=helper(val);
                    if(x!=-1)val/=x;
                    else return -1;
                }
                res++;
            }
            nums[i]=val;
        }
        return res;
    }
};

