        val counts = IntArray(26){0}
        var res = 0
        var left = 0
        s.forEach{ c->
            counts[c.toInt()-97] += 1
            if(counts.max() >= k){
                while(counts.max() >= k){
                    counts[s[left].toInt()-97] -= 1
                    left++
                }
                res += left
                left--
                counts[s[left].toInt()-97] += 1
            }
        }
        return res
    }
