class Solution {
public:
    int numberOfSubstrings(string s, int p) {
        int n = s.length();
        vector<vector<int> > dp(n+1, vector<int>(26, 0));
        for(int i = 1; i<=n; i++) {
            for(int j = 0; j<26; j++) dp[i][j] = dp[i-1][j] + ((s[i-1] - 'a') == j);
        }
        int ans = 0;
        for(int i = 0; i<n; i++) {
            for(int j = i; j<n; j++) {
                bool flag = false;
                for(int k = 0; k<26 and !flag; k++) 
                    if(dp[j+1][k] - dp[i][k] >= p) {
                        ans++;
                        flag = true;
                    }
            }
        }
        return ans;
    }

};

