        N = len(nums)
        res = 0
        if N == 1:
            return 0
        l, r = N - 2, N - 1
        while l >= 0:
            if nums[l] <= nums[r]:
                l -= 1
                r -= 1
                continue
            smallest_divisor = primes[nums[l]]
