class Solution {
public:
    bool isPrime(int n) {
        int cnt = 0;

        if (n <= 1)
            return false;

        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0)
                return false;
        }

        return true;
    }

    int getGreatestProperDivisor(int n) {
        if(isPrime(n))
            return -1;

        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0)
                return n / i;
        }

        return -1;
    }

    int minOperations(vector<int>& nums) {
        int n = nums.size();
        int i = n-2, ans = 0;

        int prev = nums[n-1];
        while(i >= 0) {
            if(prev >= nums[i]) {
                prev = nums[i];
                i--;
                continue;
            }

            while(prev < nums[i]) {
                int div = getGreatestProperDivisor(nums[i]);
                if(div == -1)
                    return -1;

                ans++;
                nums[i] /= div;
            }
        }


        return ans;
    }
};

