class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans = 0, n = s.size();
        unordered_map<char, int> cnt;
        auto checkG = [&]() {
            for (auto [ch, c] : cnt)
                if (c >= k) return true;

            return false;
        };
        for (int i = 0, j = 0; j < n; ++j) {
            cnt[s[j]]++;
            while (checkG()) {
