class Solution:
    def minOperations(self, nums: List[int]) -> int:
        maximum = nums[-1]
        count = 0
        n = len(nums)
        @cache
        def helper(num):
            curr = -1
            for i in range(int(math.sqrt(num)), 1, -1):
                if num % i == 0:
                    curr = i
            return curr

        for i in range(n - 2, -1, -1):
            num = nums[i]
            while num > maximum:
                leftover = helper(num)
                if leftover == -1:
                    return -1
                num = leftover
                count += 1
            maximum = num

        return count

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        unordered_map<char, int> freq;
        int overk = 0;
        int j = 0;
        int ans = 0;

        for (int i = 0; i < s.size(); ++i) {
            freq[s[i]] += 1;

            if (freq[s[i]] == k) overk += 1;

            while (overk > 1) {
                if (freq[s[j]] == k) overk -= 1;
                freq[s[j]] -= 1;
                j += 1;
            }

            while (overk == 1 && freq[s[j]] != k) {
                freq[s[j]] -= 1;
                j += 1;
            }

            if (overk == 1) {
                ans += j + 1;
            }
        }

        return ans;
    }
};

