class Solution {
    func numberOfSubstrings(_ s: String, _ k: Int) -> Int {
        let s = Array(s)
        var left = 0
        var right = 0
        var dict = Dictionary<Character, Int>()
        var res = 0
        while right < s.count {
            dict[s[right], default: 0] += 1
            while dict[s[right], default: 0] >= k {
                res += s.count - right
                dict[s[left], default: 0] -= 1
                left += 1
            }
            right += 1
        }
        return res
    }
