class Solution {
    func minOperations(_ nums: [Int]) -> Int {
        var nums = nums
        var pred = nums[nums.count - 1]
        var count = 0
        for i in stride(from: nums.count - 2, through: 0, by: -1) {
            while nums[i] > pred {
                if nums[i] < 3 {
                    return -1
                }
                var div = true
                for j in 2..<nums[i] {
                    if nums[i] % j == 0 {
                        nums[i] = j
                        count += 1
                        div = false
                        break
                    }
                }
                if div {
                    return -1
                }
            }
            pred = nums[i]
        }
        return count
    }
}

