bool iscomputed = false;

vector<int> least_prime(1000001, 0);

void op()
{
    least_prime[1] = 1;

    for (long long i = 2; i <= 1000000; i++)
    {

        if (least_prime[i] == 0)
        {

            least_prime[i] = i;

            for (long long  j = i*i; j <= 1000000; j += i)
                if (least_prime[j] == 0)
                   least_prime[j] = i;
        }
    }
}

