        for(i=n-2;i>=0;i--){
            if(v[i]>v[i+1]){
                ans++;
                if(least_prime[v[i]] == v[i]){
                    return -1;
                }

                if(least_prime[v[i]] > v[i+1]){
                    return -1;
                }

                v[i] = least_prime[v[i]];
            }
        }

