class Solution {
    public int minOperations(int[] a) {
        int maxVal = 0;
        for (int num : a) {
            maxVal = Math.max(maxVal, num);
        }

        int[] gcd = new int[maxVal + 1];
        for (int i = 2; i <= maxVal; i++) {
            for (int j = 2 * i; j <= maxVal; j += i) {
                gcd[j] = i;
            }
        }

        int ops = 0;
        int n = a.length;

        for (int i = n - 2; i >= 0; i--) {
            while (a[i] > a[i + 1]) {
                int g = gcd[a[i]];
                if (g == 0) {
                    return -1;
                }
                a[i] /= g;
                ops++;
            }
        }
        return ops;
    }
}

class Solution {
