class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size(), count = 0;
        vector<int> arr = nums;

        for (int i = n - 2; i >= 0; --i) {
            while (arr[i] > arr[i + 1]) {
                int div = 1;

                for (int d = 2; d * d <= arr[i]; ++d) {
                    if (arr[i] % d == 0) {
                        div = max(div, d);
                        if (d * d != arr[i]) {
                            div = max(div, arr[i] / d);
                        }
                    }
                }

                if (div == 1) {
                    return -1;
                }

                arr[i] = arr[i] / div;
                count++;

                if (arr[i] <= arr[i + 1]) {
                    break;
                }
            }
        }

        return count;
    }
};

