        int res = 0;
        for (int i = 0; i < s.length(); i++) {
            res += helper(s, i, k);
        }
        return res;
    }

    public int helper(String s, int start, int k) {
        int[] arr = new int[26];
        for (int i = start; i < s.length(); i++) {
            char c = s.charAt(i);
            int n = (int)(c - 'a');
            arr[n]++;
            if (arr[n] >= k) {
                return s.length() - i;
            }
        }
        return 0;
    }
}

