class Solution {
    public int minOperations(int[] nums) {
        int res = 0;
        for (int i = nums.length - 1; i > 0; i--) {
            int pre = nums[i - 1];
            int cur = nums[i];
            while (pre > cur) {
                int fac = largestFactor(pre);
                if (fac == 1) {
                    return -1;
                }
                pre = pre / fac;
                nums[i - 1] = pre;
                res++;
            }
        }
        return res;
    }

    public int largestFactor(int n) {
        for (int i = 2; i <= Math.sqrt(n); i++) {
            if (n % i == 0) {
                return n / i;
            }
        }
        return 1;
    }
}

