class Solution {
    public int numberOfSubstrings(String s, int k) {
        int n = s.length();

        int[] arr = new int[26];
        int index = 0;
        int left = 0;

        int ans = 0;
        while(index < n) {
            int c = s.charAt(index) - 'a';
            arr[c]++;
            while(left<=index && check(arr, k)) {
                ans += (n - index);
                int ch = s.charAt(left) - 'a';
                left++;
                arr[ch]--;
            }
            index++;
        }

        return ans;
    }

    public boolean check(int[] arr, int k) {
        for(int i=0; i<26; i++) {
            if(arr[i] >= k) {
                return true;
            }
        }
        return false;
    }
