class Solution {
    public int minOperations(int[] nums) {
        int n = nums.length;
        int ans = 0;
        int[] arr = new int[n];

        for(int i=0; i<n; i++) {
            int d = findGreatestDivisor(nums[i]);
            arr[i] = nums[i] / d;
        }

        for(int i=n-1; i>=1; i--) {
