    int minOperations(vector<int>& nums) {

        int n = nums.size(), ans = 0;
        for(int i=n-2; i>=0; i--){
            while(nums[i] > nums[i+1]){
                int j = 2;
                for (; j*j<=nums[i]; j++)
                {
                    if (nums[i] % j == 0)
                    {
                        break;
                    }
                }
                if(j*j <= nums[i]){
                    nums[i] = j;
                    ans++;
                }
                else{
                    return -1;
                }
            }
        }

        return ans;
    }
};

class Solution {
