        for (int i = 0, valid = 0; i < n; i ++, valid = 0) {
            int[] count = new int[128];
            for (int j = i; j < n; j ++) {
                if (++ count[s.charAt(j)] == k) {
                    valid = 1;
                }
                ans += valid;
            }
        }
        return ans;
    }
}

