def get_primes(n):
    # get a list of all primes upto (inclusive) n 
    n = n + 1
    primes = [True] * n
    primes[0] = primes[1] = False
    for i in range(3, int(n ** 0.5) + 1):
        if primes[i]:
            primes[i * i: n: i] = [False] * len(primes[i * i: n: i])
    primelist = [2] + [i for i in range(3, n, 2) if primes[i]]
    return primelist

