    long long pow_m(long long base, long long exp, long long mod) {
        long long result = 1LL;
        base = (base % mod);

        while (exp > 0) {
            if ((exp & 1LL) == 1LL) result = (result * base) % mod;
            exp >>= 1LL;
            base = (base * base) % mod;
        }
        return result;

