    // fenwick tree/binary index tree
    template <typename T>
    class fenwick {
        public:
        vector<T> fenw;
        int n;

        // Constructor for initialization of size 
        fenwick(int _n) : n(_n + 1) {
            fenw.resize(n);
        }

        // to modify , add or replace value at index x
        void modify(int x, T v) {
            while (x <= n) {
            fenw[x] += v;
            x += (x & -x);
            }
        }

        // To get sum of prefix ending at x
        T get(int x) {
            T v{};
            while (x > 0) {
                v += fenw[x];
                x -= (x & -x);
            }
            return v;
        }
    };

    // Segment tree
    class SegmentTree{
        public:
        ll n;
        vector<ll> seg,lazy;

        SegmentTree(int _n,vector<int> a){
            n = _n;
            seg.resize(4*n+1);
            lazy.resize(4*n+1,0);
            build(0,0,n-1,a);
        }

        void build(int ind,int low,int high,vector<int> &a){
            if(low == high){
                seg[ind] = a[low];
                return;
            }
            ll mid = (low+high)/2;
            build(2*ind+1,low,mid,a);
            build(2*ind+2,mid+1,high,a);
            seg[ind] = seg[2*ind+1]+seg[2*ind+2];
        }

        void pointupdate(int ind,int low,int high,int i,int val){
            if(lazy[ind]!=0){
                seg[ind] += (high-low+1)*lazy[ind];
                if(low!=high){
                    lazy[2*ind+1] += lazy[ind];
                    lazy[2*ind+2] += lazy[ind];
                }
                lazy[ind] = 0;
            }
            if(low == high){
                seg[ind] = val;
                return ;
            }
            int mid = (low+high)/2;
            if(i<=mid){
                pointupdate(2*ind+1,low,mid,i,val);
            }
            else{
                pointupdate(2*ind+2,mid+1,high,i,val);
            }
            seg[ind] =seg[2*ind+1]+seg[2*ind+2];
        }

        void rangeupdate(int ind,int low,int high,int l,int h,int val){
            if(lazy[ind]!=0){
                seg[ind] += (high-low+1)*lazy[ind];
                if(low!=high){
                    lazy[2*ind+1] += lazy[ind];
                    lazy[2*ind+2] += lazy[ind];
                }
                lazy[ind] = 0;
            }
            if(h<low || high<l){
                return;
            }
            if(low>=l && high<=h){
                seg[ind] += (high-low+1)*val;
                if(low!=high){
                    lazy[2*ind+1] += val;
                    lazy[2*ind+2] += val;
                }
                return;
            }
            int mid = (low+high)/2;
            rangeupdate(2*ind+1,low,mid,l,h,val);
            rangeupdate(2*ind+2,mid+1,high,l,h,val);
            seg[ind] = seg[2*ind+1]+seg[2*ind+2];
        }

        ll rangequery(int ind,int low,int high,int l,int h){
            if(lazy[ind]!=0){
                seg[ind] += (high-low+1)*lazy[ind];
                if(low!=high){
                    lazy[2*ind+1] += lazy[ind];
                    lazy[2*ind+2] += lazy[ind];
                }
                lazy[ind] = 0;
            }
            if(h<low || high<l){
                return 0;
            }
            if(low>=l && high<=h){
                return seg[ind];
            }
            ll mid = (low+high)/2;
            ll left = rangequery(2*ind+1,low,mid,l,h);
            ll right = rangequery(2*ind+2,mid+1,high,l,h);
            return right+left;
        }

    };

