    // Trie implementation 
    class Node{
        public:

        Node* links[26];
        int t[26] = {0};
        bool flag = false;

        bool containskey(char ch){
            return links[ch-'a'] != nullptr;
        }

        Node* get(char ch){
            return links[ch-'a'];
        }

        void put(char ch,Node* node){
            links[ch-'a'] = node;

        }

        void setEnd(){
            flag = true;
        }

        bool isEnd(){
            return flag == true;
        }
    };

    class Trie {
    public:
        Node* root;
        Trie() {
            root = new Node();
        }

        void insert(string word) {
            Node* node = root;
            for(int i=0;i<word.size();i++){
                if(!node->containskey(word[i])){
                    node->put(word[i],new Node());
                }
                node = node->get(word[i]);
            }
            node->setEnd();
        }

        bool search(string word) {
            Node* node = root;
            for(int i=0;i<word.size();i++){
                if(!node->containskey(word[i])){
                    return false;
                }
                node = node->get(word[i]);
            }
            return node->isEnd();
        }

        bool startsWith(string prefix) {
            Node* node = root;
            for(int i=0;i<prefix.size();i++){
                if(!node->containskey(prefix[i])){
                    return false;
                }
                node = node->get(prefix[i]);
            }
            return true;
        }
    };

    // DSU 
    class DSU{
    public:
    vector<int> parent,rank,size;

    DSU(int n){
        for(int i=0;i<n;i++){
            parent.push_back(i);
            rank.push_back(0);
            size.push_back(1);
        }
    }
    int findpar(int x){
        if(x == parent[x]){
            return x;
        }
        return parent[x] = findpar(parent[x]);
    }
    bool union_(int x,int y){
        int parx = findpar(x);
        int pary = findpar(y);
        if(parx == pary){
            return true;
        }
        if(rank[parx]>rank[pary]){
            parent[pary] = parx;
        }
        else if(rank[parx]<rank[pary]){
            parent[pary] = parx;
        }
        else{
            rank[parx]++;
            parent[pary] = parx;
        }
        return false;
    }
    bool unionbysize(int x,int y){
        int parx = findpar(x);
        int pary = findpar(y);
        if(parx == pary){
            return true;
        }
        if(size[parx]>=size[pary]){
            parent[pary] = parx;
            size[parx] += size[pary];
        }
        else{
            parent[parx] = pary;
            size[pary] += size[parx];
        }
        return false;
    }
};


   class TreeAncestor {
        public:
        vector<vector<int>> vec;
        vector<int> depth;
        int h = 18;
        int n;
        TreeAncestor(int _n, vector<int>& parent) {
            n = _n;
            depth.resize(n,0);
            vec.resize(h,vector<int>(n+1,-1));
            vector<vector<int>> g(n+1);
            for(int i=1;i<n;i++){
                int p = parent[i];
                g[p].push_back(i);
                g[i].push_back(p);
            }
            dfs(0,-1,g);
            for(int i=0;i<n;i++){
                vec[0][i] = parent[i];
            }
            for(int i=1;i<h;i++){
                for(int j=0;j<n;j++){
                    if(vec[i-1][j] != -1)
                        vec[i][j] = vec[i-1][vec[i-1][j]];
                }
            }
        }

        int getKthAncestor(int node, int k) {
            for(int i=h-1;i>=0;i--){
                if(k&(1<<i)){
                    node = vec[i][node];
                    if(node == -1){
                        return -1;
                    }
                }
            }
            return node;
        }
        int lca(int a, int b)
        {
            // cout<<depth[a]<<" "<<depth[b]<<endl;
            if(depth[a] < depth[b])
                swap(a, b);
            // cout<<depth[a]<<" "<<depth[b]<<endl;
            int diff = depth[a] - depth[b];
            for(int i = 17; i >=0; i--)
                if(diff & (1 << i))
                    a = vec[i][a];

            if(a == b)
                return a;
            // cout<<a<<" "<<b<<endl;
            // cout<<depth[a]<<" "<<depth[b]<<endl;
            for(int i = 15; i >= 0; i--)
            {
                if(vec[i][a] != vec[i][b])
                {
                    a = vec[i][a];
                    b = vec[i][b];
                }
            }

            return vec[0][a];
        }
        void dfs(int src, int paren,vector<vector<int>> &g)
        {
            for(auto x : g[src])
            {
                if(x == paren)
                    continue;
                depth[x] = depth[src] + 1;
                dfs(x, src,g);
            }
        }
    };

