    int kmp(string txt, string pat) {
        int n = pat.size();
        vector<int> lps(n,0);
        int len = 0;
        lps[0] = 0;
        int i = 1;
        while(i<n){
            if(pat[i] == pat[len]){
                len++;
                lps[i] = len;
                i++;
            }
            else{
                if(len !=0){
                    len = lps[len-1];
                }
                else{
                    i = i+1;
                }
            }
        }
        int m = txt.size();
        int j=0;
        i = 0;
        while(i<m){
            if(txt[i] == pat[j]){
                i++;
                j++;
            }
            if(j == n){
                j = lps[j-1];
                // return j;
            }
            else if(i<m && txt[i] != pat[j]){
                if(j != 0){
                    j = lps[j-1];
                }
                else{
                    i++;
                }
            }
        }
        return -1;
    }

    vector<int> zfunction(string s){
        int n = s.size();
        vector<int> z(n,0);
        int l=0,r=0;
        for(int k=1;k<n;k++){
            if(k>r){
                l = k;
                r = k;
                while(r<n && s[r-l] == s[r]){
                    r++;
                }
                z[k] = r-l;
                r--;
            }
            else {
                int k1 = k-l;
                if(z[k1]<r-k+1){
                    z[k] = z[k1];
                }
                else{
                    l = k;
                    while(r<n && s[r-l] == s[r]){
                        r++;
                    }
                    z[k] = r-l;
                    r--;
                }
            }
        }
        return z;
    }
