class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();
        int ans = 0;

        for (int i = n - 2; i >= 0; i--) {
            if (nums[i] > nums[i + 1]) {
                while (nums[i] > nums[i + 1]) {
                    int divisor = 1;
                    for (int j = 2; j*j <= nums[i]; j++) {
                        if (nums[i] % j == 0) {
                            divisor = max({divisor, nums[i] / j,j});
                        }
                    }
                    if (divisor == 1) return -1;
                    nums[i] = nums[i]/divisor;
                    ans++;
                }
            }
        }
        return ans;
    }
};

