class Solution {
    public int minOperations(int[] nums) {
        int max = nums[nums.length - 1];
        int operations = 0;
        for (int i = nums.length - 2; i >= 0; i--) {
            int temp = nums[i];
            if (temp > max) {
                while (temp > max) {
                    int div = divisor(temp);
                    if (div == temp || div == 1) {
                        return -1;
                    }
                    temp = temp / div;
                    operations++;
                }
            }
            max = temp;
        }

        return operations;

    }

    private int divisor(int number) {
        int i;
        for (i = 2; i <= Math.sqrt(number); i++) {
            if (number % i == 0) {
                return number/i;
            }
        }
        return 1;
    }
}

class Solution {
public:
    int numberOfSubstrings(string s, int K) {
        int n=s.size();
        int freq[n][26];
        memset(freq,0,sizeof(freq));
        for(int i=0;i<n;i++){
            for(int j=0;j<26;j++){
                if(i) freq[i][j]=freq[i-1][j];
            }
            freq[i][s[i]-'a']+=1;
        }
        int ans=0;
        for(int i=1;i<=n;i++){
            for(int j=0;j<n;j++){
                if(j+i>n) break;
                bool flag=false;
                for(int k=0;k<26;k++){
                    int fks=freq[j+i-1][k];
                    if(j) fks-=freq[j-1][k];
                    if(fks>=K) flag=true;
                }
                ans+=flag;
            }
        }
        return ans;
    }
};

