const int N = 1000000;
vector<int> lp(N+1);
vector<int> pr;

class Solution {
public:


    void prime(){
        if(!pr.empty()) return;
        for (int i=2; i <= N; ++i) {
            if (lp[i] == 0) {
                lp[i] = i;
                pr.push_back(i);
            }
            for (int j = 0; i * pr[j] <= N; ++j) {
                lp[i * pr[j]] = pr[j];
                if (pr[j] == lp[i]) {
                    break;
                }
            }
        }
    }

    int cal(vector<int>& nums){
        int n=nums.size();
        int cntr=0;
        for(int i=n-2;i>=0;i--){
             while(nums[i]>nums[i+1]&&lp[nums[i]]!=nums[i]){
                nums[i]=lp[nums[i]];
                cntr+=1;
            }
            if(nums[i]>nums[i+1]) return -1;
        }
        return cntr;
    }

    int minOperations(vector<int>& nums) {
        prime();
        int vk=cal(nums);
        int vk1=cal(nums);
        if(vk==-1||vk1==-1) return -1;
        return vk+vk1;

    }
};

