        int res = 0;
        for(int i =nums.Length-2;i>=0;i--)
        {
            if(nums[i] <= nums[i+1]) continue;

            nums[i] = MinProper(nums[i]);
            if(nums[i] > nums[i+1]) return -1;
            res++;
        }
        return res;
    }
    private int MinProper(int n)
    {
        int d = 2;
        while( d != n)
        {
            if(n%d == 0) return d;
            d++;
        }

        return n; 
    }
}

