class Solution 
{
public:
    int minOperations(vector<int>& nums) 
    {
        const int N = 1001;
        vector<bool> sieve(N);
        vector<int> prime;
        for (int i = 2; i < N; i++)
        {
            if (!sieve[i]) prime.push_back(i);
            for (int p : prime)
            {
                if (i * p >= N) break;
                sieve[i * p] = true;
                if (i % p == 0) break;
            }
        }
        int n = nums.size(), ans = 0;
        for(int i = n - 2; i >= 0; i--)
        {
            while(nums[i] > nums[i + 1])
            {
                int PD = 1;//proper divisor
                for(int j = 0; j < prime.size() && prime[j] <= sqrt(nums[i]); j++)
                {
                    if(nums[i] % prime[j] == 0)
                    {
                        PD = prime[j];
                        break;
                    }
                }
                if(PD == 1)
                {
                    return -1;
                }
                nums[i] = PD;
                ans++;
            }
        }
        return ans;
    }
};

