class Solution:
    def getDivisor(self, num):
        for i in range(2, num+1):
            if num % i == 0:
                return num // i
        return 1

    def minOperations(self, nums: List[int]) -> int:
        result = 0
        for i in range(len(nums)-2, -1, -1):
            while nums[i] > nums[i+1]:
                d = self.getDivisor(nums[i])
                if d == 1:
                    return -1
                nums[i] = nums[i] // d
                result += 1
        return result

class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int left_sliding=0,right_sliding=-1;
        int ans=0;
        int now[26]={0};
        while(1){
            if(left_sliding==s.length()||right_sliding==s.length())
                break;
            int check=0;
            for(int i=0;i<=25;i++){
                if(now[i]>=k){
                    check=1;
                    break;
                }
            }
            if(check==0){
                right_sliding++;
                if(right_sliding<s.length())
                    now[(s[right_sliding]-'a')]++;
            }
            else{
                ans+=s.length()-right_sliding;
                now[(s[left_sliding]-'a')]--;
                left_sliding++;
            }
        }
        return ans;
    }
};

