const int M = 1e6+7;
vector<int> GD;
class Solution {
public:
    int minOperations(vector<int>& nums) {
        if(GD.empty())
        {
            GD = vector<int>(M,1);
            for(int k = 2; k < M; k++)
            {
                for(int m = k+k; m < M; m += k)
                {
                    GD[m] = k;
                }
            }
        }
        const int big = 1e9+7;
        map<int,int> dp[2];
        dp[1][1] = 0;
        int n = nums.size();
        for(int i = 0; i < n; i++)
        {
            int now = i % 2;
            int prev = (i+1) % 2;
            dp[now].clear();
            int t = 0;
            int x = nums[i];
            while(1)
            {
                dp[now][x] = big;
                for(auto &u : dp[prev])
                {
                    if(u.first <= x)
                    {
                        dp[now][x] = min(dp[now][x], u.second + t);
                    }
                }
                if(GD[x] == 1)
                {
                    break;
                }
                else
                {
                    x /= GD[x];
                    t++;
                }
            }

        }
        int ans = big;
        for(auto &u : dp[(n+1)%2])
        {
            ans = min(ans, u.second);
        }
        if(ans == big)
        {
            ans = -1;
        }
        return ans;
    }
};

class Solution {
    public int numberOfSubstrings(String s, int k) {
        int n = s.length();
        int[][] f = new int[n + 1][26];
        for(int i = 0; i < n; i++)
        {
            for(int j = 0; j < 26; j++)
            {
                f[i + 1][j] = f[i][j];
            }
            int p = s.charAt(i) - 'a';
            f[i + 1][p]++;
        }
        int re = 0;
        for(int i = 0; i < n; i++)
        {
            for(int j = i; j < n; j++)
            {
                int[] diff = new int[26];
                boolean found = false;
                for(int t = 0; t < 26; t++)
                {
                    diff[t] = f[j + 1][t] - f[i][t];
                    if(diff[t] >= k) found = true;
                }
                if(found) re++;
            }
        }
        return re;
    }
}

class Solution {
    public List<String> stringSequence(String target) {
        List<String> list = new ArrayList<>();
        String next = null;
        for(char c : target.toCharArray())
        {
            next = list.size() > 0 ? list.get(list.size() - 1) : "";
            next = append(next);
            list.add(next);
            while(next.charAt(next.length() - 1) != c)
            {
                next = modifyLast(next);
                list.add(next);
            }
        }
        return list;
    }

    String modifyLast(String str)
    {
        char[] c = str.toCharArray();
        char last = c[c.length - 1];
        c[c.length - 1] = (char)(last + 1);
        return String.valueOf(c);
    }

    String append(String str)
    {
        return str + "a";
    }
}

class Solution {
    public int minOperations(int[] nums) {

        int re = 0;
        int n = nums.length;
        for(int i = n - 2; i >= 0; i--)
        {
            int cur = nums[i], next = nums[i + 1];
            if(cur <= next)
            {
                //
            }
            else
            {
                // operate on cur
                while(cur > next)
                {
                    int gpd = getGpd(cur);
                    if(gpd < 0) return -1;
                    cur /= gpd;
                    re++;
                }
                nums[i] = cur;
            }
        }
        // System.out.println(Arrays.toString(nums));
        return re;
    }

    int getGpd(int k)
    {
        for(int i = 2; i <= k / 2; i++)
        {
            if(k % i == 0)
            {
                return k / i;
            }
        }
        return -1;
    }
}

