func numberOfSubstrings(s string, k int) int {
    var mem [26]int

    left := 0
    right := 0
    acc := 0
    for right < len(s) {
        mem[s[right]-'a']++
        if mem[s[right]-'a'] >= k {
            for mem[s[right]-'a'] >= k && left <= right {
                acc += len(s) - right
                mem[s[left]-'a']--
                left++
            }
        }
        right++
    }
    return acc
}

