class Solution {
public:
    int solve(int x){
        int maxi=-1;
        for(int i=1;i<=sqrt(x);i++){
            if(x%i==0){
                maxi=max(maxi,i);
                int y = x/i;
                if(y!=x) maxi=max(maxi,y);
            }
        }
        return maxi;
    }
    int minOperations(vector<int>& nums) {


        int n=nums.size();

        int prev = nums[n-1];
        int ans=0;
        for(int i=n-2;i>=0;i--){
            if(nums[i]<=prev){
                prev=nums[i];
                continue;
            }
            else{
                int x = solve(nums[i]);
                if(x==-1) return -1;
                else{
                    ans++;
                    if(nums[i]/x > prev) return -1;
                    prev = nums[i]/x;
                }
            }
        }
        return ans;
    }
};

