class Solution {
public:
    int numberOfSubstrings(string s, int k) 
    {
        int n = s.size();
        int notSatisfy = 0;
        for (int i = 0; i < n; i++)
        {
            int freq[26] = {0};
            for (int j = i; j < n; j++)
            {
                freq[s[j] - 'a']++;
                if (freq[s[j] - 'a'] >= k) break;
                notSatisfy++;
            }
        }    
        long long total = 1ll * n * (n + 1);
        total /= 2;
        return (total - notSatisfy);
    }
};

