vector<bool> sieve(1e6 + 5, 1);
vector<int> prime;
void preCalculate()
{
    sieve[0] = sieve[1] = 0;
    for (int i = 2; i * i <= 1e6 + 5; i++)
    {
        if (!sieve[i]) continue;
        for (int j = i * i; j < 1e6 + 5; j += i)
        {
            sieve[j] = 0;
        }
    }
    for (int i = 2; i < 1e6 + 5; i++)
    {
        if (sieve[i]) prime.push_back(i);
    }
}

class Solution {
public:
    int minOperations(vector<int>& nums) 
    {
        if (prime.size() == 0) preCalculate();
        int x = prime.size();
        int n = nums.size();
        int ans = 0;
        for (int i = n - 2; i >= 0; i--)
        {
            if (nums[i] > nums[i + 1])
            {
                int j = 0;
                for (j = 0; j < x; j++)
                {
                    if (nums[i] % prime[j] == 0) break;
                }
                if (nums[i] == prime[j]) return -1;
                else 
                {
                    ans++;
                    nums[i] = prime[j];
                }
            }
        }
        for (int i = 0; i < n - 1; i++)
        {
            if (nums[i] > nums[i + 1]) return -1;
        }
        return ans;
    }
};

