const int N = 1e6 + 5;

vector<int> spf(N, 0);

void SPF()
{
    spf[1] = 1;
    for (long i = 2; i < N; i++)
    {
        if (spf[i] == 0)
        {
            spf[i] = i;
            for (long j = i * i; j < N; j += i)
                if (spf[j] == 0)
                    spf[j] = i;
        }
    }
}

class Solution
{
public:
    int minOperations(vector<int> &nums)
    {
        SPF();
        int ans = 0;
        int n = nums.size();
        for (int i = n - 2; i >= 0; i--)
        {
            if (nums[i] > nums[i + 1])
            {
                int spf1 = spf[nums[i]];
                if (spf1 == nums[i])
                    return -1;
                nums[i] = spf1;
                ans++;
                i++;
            }
        }
        return ans;
    }
};

class Solution {
public:

    bool check(int* v, int k){
        for(int i=0;i<26;i++){
            if(v[i]>=k) return true;
        }
        return false;
    }

    int numberOfSubstrings(string s, int k) {

        int l=0,ans=0;
        int v[26] = {0};

        for(int i=0;i<s.size();i++){
            v[s[i]-'a']++;
            while(check(v,k)){
                v[s[l]-'a']--;
                l++;
            }
            ans += l;
        }
        return ans;
    }
};

