class Solution {
public:
    int findDivisor(int num){
        for(int i=2;i*i<=num;i++){
            if(num%i == 0) return i;
        }
        return num;
    }

    int minOperations(vector<int>& nums) {

        int idx=-1,n = nums.size();

        for(int i=n-2;i>=0;i--){
            if(nums[i]>nums[i+1]){
                idx = i; break;
            }
        }

        int ans = 0;
        while(idx>=0){
            if(nums[idx]>nums[idx+1]){
                nums[idx] = findDivisor(nums[idx]);
                ans++;
            }
            if(nums[idx]>nums[idx+1]) return -1;
            idx--;
        }

        return ans;
    }
};

class Solution {
public:

    int k;

    bool check(unordered_map<char, int> &m){
        for(auto &i : m){
            if(i.second >= k)return true;
        }
        return false;
    }

    int numberOfSubstrings(string a, int K) {
        k = K;
        int n = a.size();
        int i=0, j=0;
        int ans = 0;
        unordered_map<char, int> m;
        while(i<n && j<n && i<=j){
            m[a[j]]++;
            while(check(m)){
                ans += n-j;
                m[a[i]]--;
                i++;
            }
            j++;
        }
        return ans;
    }
};

