            }
        }
        return ans;
    }
};

class Solution {
public:
    int numberOfSubstrings(string s, int kk) {
        int n=s.size(),ans=0;

        vector<vector<int>> prefix(n,vector<int>(26,0));
        prefix[0][s[0]-'a']=1;
        for(int i=1;i<n;i++){
            prefix[i][s[i]-'a']=1;
            for(int j=0;j<26;j++){
                prefix[i][j]+=prefix[i-1][j];
            }
        }
        auto func=[&](int i,int j){
           for(int k=0;k<26;k++){
               int freq=prefix[j][k];
               if(i-1>=0) freq-=prefix[i-1][k];
               if(freq>=kk) return true;
           } 
            return false;
        };

        for(int i=0;i<n;i++){
           for(int j=i;j<n;j++){
               ans+=func(i,j);
           } 
        }
        // cout<<func(0,1)<<endl;
        return ans;
    }
};

