class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n=nums.size();

        auto func=[&](int ele){
          int gr8D=1;
          for(int j=2;j*j<=ele;j++){
              if(ele%j==0){
                  int a=j,b=ele/j;
                  gr8D=max({gr8D,a,b});
              }
          }  
          return gr8D;
        };

        int ans=0;

        for(int i=n-2;i>=0;i--){
            while(true){
                if(nums[i]<=nums[i+1]){
                    break;
                }
                int temp=func(nums[i]);
                if(temp==1) break;
                nums[i]=nums[i]/temp;
                ans++;
            }
            if(nums[i]<=nums[i+1]) continue;
            else return -1;
        }
        return ans;
    }
};

class Solution:
    def numberOfSubstrings(self, s: str, k: int) -> int:
        appearance = [0] * 26
        left = 0
        right = -1

        result = 0

        while left < len(s):
            while max(appearance) < k:
                right += 1
                if right == len(s):
                    return result
                appearance[ord(s[right]) - ord("a")] += 1

            result += len(s) - right

            appearance[ord(s[left]) - ord("a")] -= 1
            left += 1

        return result

class Solution:
    def stringSequence(self, target: str) -> List[str]:
