            right[i]=min(right[i],right[i+1]);
            if(nums[i]>right[i]) {
                for(int j=2;j*j<=nums[i];j+=1+(j&1)) {
                    if(nums[i]%j==0) {
                        nums[i]/=(nums[i]/j);
                        right[i]=min(right[i],nums[i]);
                        result++;
                        break;
                    }
                }
                if(nums[i]>right[i])
                    return -1;
            }
        }
