        int n=s.size();
        int count=0;

        for (int i=0;i<n;i++){
            unordered_map<char,int> m;
            for(int j=i;j<n;j++){
                m[s[j]]++;
                bool f=false;
                for(auto& pair:m){
                    if (pair.second >=k){
                        f=true;
                        break;
                    }
                }
                if(f){
                    count++;
                }
            }
        }
        return count;
    }
};

