class Solution {
public:
    int numberOfSubstrings(string s, int k) {
        int ans = 0;
        int strlen = s.length();
        for(int l = k; l<=strlen; l++){
            vector<int> cnt(26, 0);
            int over = 0;
            for(int i=0; i<l;i++){
                int curidx = s[i] - 'a';
                cnt[curidx]++;
                if(cnt[curidx] == k) over++;
            }
            if(over > 0) ans++;
            for(int st = 0; st<strlen-l; st++){
                int curidx = s[st]-'a';
                if(cnt[curidx]-- == k) over--;
                curidx = s[st+l] - 'a';
                if(++cnt[curidx] == k) over++;

                if(over > 0) ans++;
            }
        }
        return ans;
    }
};

