class Solution {
public:
  int numberOfSubstrings(string s, int k) {
    int n = (int) s.size();
    vector<int> cnt(26);
    auto ok = [&]() {
      return *max_element(cnt.begin(), cnt.end()) >= k;
    };  

    int ans = 0;
    for (int l = 0, r = 0; r < n; r++) {
      cnt[s[r] - 'a']++;
      while (l <= r && ok()) {
        ans += (n - r);
        cnt[s[l] - 'a']--;
        l++;
      }
    }
    return ans;
  }
};

