class Solution {
public:
  int minOperations(vector<int>& v) {
    int n = (int) v.size();
    int ans = 0;
    for (int i = n - 2; i >= 0; i--) {
      if (v[i] < v[i + 1]) {
        continue;
      }
      while (v[i] > v[i + 1]) {
        bool find = false;
        for (int x = 2; x * x <= v[i]; x++) {
          if (v[i] % x == 0) {
            v[i] = x;
            ans++;
            find = true;
            break;
          }
        }
        if (!find) {
          return -1;
        }
      }
    }

    return ans;
  }
};
